INSERT INTO `creature_text` VALUES (1413, 3, 0, 'Bringing in 12 focus centers could allow magical energies to form more stable, providing the necessary stability.', 12, 7, 100, 0, 0, 0, 209, 67516, 67516, 0, 'Janey Amschiff to Patzerle');
