INSERT INTO `creature_text` VALUES (1413, 3, 0, 'If we change the direction of the flow of the Essence in the opposite, perhaps we will be able to change its polarity.', 12, 0, 100, 0, 0, 0, 201, 870000, 870000, 0, 'Джейни Аншип');
INSERT INTO `creature_text` VALUES (1413, 3, 0, 'Maginor argues that the interweaving of additional jets of positive energy increases the stability of the flow.', 12, 0, 100, 0, 0, 0, 206, 1284000, 1284000, 0, 'Джейни Аншип');
