INSERT INTO `creature_text` VALUES (1413, 3, 0, 'Putting in twelve centers of focus might allow the magical energies to form more solidly, adding the necessary stability.', 12, 7, 100, 0, 0, 0, 209, 26109, 26109, 0, 'Janey Anship to Fizzles');
INSERT INTO `creature_text` VALUES (1413, 3, 0, 'That\'s always the case. The chances of this happening are nil - or even less.', 12, 0, 100, 0, 0, 0, 220, 133000, 133000, 0, 'Джейни Аншип');
