INSERT INTO `creature_text` VALUES (1414, 3, 0, 'However, the resulting energy can collapse, and then a week of headache is provided to you.', 12, 7, 100, 0, 0, 0, 213, 1129000, 1129000, 0, 'Лисана Пирс');
INSERT INTO `creature_text` VALUES (1414, 3, 0, 'However, this upsets the balance of magical focus and inverts astral vibrations.', 12, 7, 100, 0, 0, 0, 216, 131000, 131000, 0, 'Лисана Пирс to Пуша');
