INSERT INTO `creature_text` VALUES (10162, 12, 0, 'In this world where time is your enemy, it is my greatest ally. This grand game of life that you think you play in fact plays you. To that I say...', 14, 0, 100, 1, 0, 0, 9907, 0, 0, 0, 'Lord Victor Nefarius SAY_GAMESBEGIN_1 (BWL)');
INSERT INTO `creature_text` VALUES (10162, 13, 0, 'Let the games begin!', 14, 0, 100, 22, 0, 8280, 35709, 0, 0, 0, 'Lord Victor Nefarius SAY_GAMESBEGIN_2 (BWL)');
INSERT INTO `creature_text` VALUES (10162, 14, 0, 'Ah...the heroes. You are persistent, aren\'t you? Your ally here attempted to match his power against mine - and paid the price. Now he shall serve me...by slaughtering you. ', 14, 0, 100, 23, 0, 8279, 9794, 0, 0, 0, 'Lord Victor Nefarius SAY_VAEL_INTRO (BWL)');
INSERT INTO `creature_text` VALUES (10181, 0, 0, 'Belore...', 14, 0, 100, 0, 0, 0, 19263, 0, 0, 0, '');
