INSERT INTO `creature_text` VALUES (14566, 3, 0, '%s с громоподобным звуком освобождается от призрачных уз!', 16, 0, 100, 0, 0, 0, 9763, 200, 200, 0, 'Дух древнего коня to Тендрис Криводрев');
INSERT INTO `creature_text` VALUES (14627, 0, 0, 'Now that\'s what ye call heavy hands!', 14, 0, 100, 0, 0, 0, 47653, 0, 0, 0, 'Hansel Heavyhands to Player');
INSERT INTO `creature_text` VALUES (14627, 3, 0, 'Знай, что такое тяжелая рука!', 14, 0, 100, 0, 0, 0, 47653, 89000, 89000, 0, 'Гензель Большерук to Player');
INSERT INTO `creature_text` VALUES (14635, 0, 0, 'Не позволяйте этому безумию остаться безнаказанным!', 14, 0, 100, 0, 0, 0, 9800, 0, 0, 0, 'Сонный рабочий из клана Черного Железа to Player');
INSERT INTO `creature_text` VALUES (14636, 0, 0, 'Thieves! Scallywags! Rapscallions! Come face me gigantic pillas!', 14, 0, 100, 0, 0, 0, 9810, 0, 0, 0, 'Chambermaid Pillaclencher to Player');
INSERT INTO `creature_text` VALUES (14636, 0, 0, 'Воры! Бездельники! Негодяи! Ну-ка, идите сюда, я вас познакомлю со своими гигантскими подушками!', 14, 0, 100, 0, 0, 0, 9810, 0, 0, 0, 'Горничная Крепкие Тиски to Player');
INSERT INTO `creature_text` VALUES (14688, 0, 0, 'Hardly a fitting introduction , Spear-Wife. Now, who is this outsider that I\'ve been hearing so much about?', 14, 0, 0, 0, 0, 0, 0, 0, 0, 0, 'Prince Sandoval say 1');
INSERT INTO `creature_text` VALUES (14688, 1, 0, 'I will make this as easy as possible for you. Simply come here and die. That is all that I ask for your many trespasses. For your sullying this exlated place of battle. ', 14, 0, 0, 0, 0, 0, 0, 0, 0, 0, 'Prince Sandoval say 2');
INSERT INTO `creature_text` VALUES (14688, 2, 0, 'FOR YOUR EFFRONTERY TO THE LICH KING!', 14, 0, 0, 0, 0, 0, 31972, 0, 0, 0, 'Prince Sandoval say 3');
INSERT INTO `creature_text` VALUES (14748, 0, 0, 'Обед подан!', 12, 0, 100, 0, 0, 0, 20813, 0, 0, 0, 'Vilebranch Kidnapper');
INSERT INTO `creature_text` VALUES (14750, 0, 0, '%s fully engulfs in flame and a maddened look appears in his eyes!', 16, 0, 100, 0, 0, 0, 10425, 0, 0, 0, 'Gurubashi Bat Rider - On Unstable Concoction cast - Emote Line 0');
INSERT INTO `creature_text` VALUES (14772, 0, 0, '%s is furious!', 16, 0, 100, 0, 0, 0, 38630, 0, 0, 0, 'Воевода восточной башни Северного Волка');
INSERT INTO `creature_text` VALUES (14821, 0, 0, '%s becomes enraged!', 16, 0, 100, 0, 0, 0, 24144, 0, 0, 0, 'Razzashi Raptor - At 30% HP - Say Line 0');
INSERT INTO `creature_text` VALUES (14822, 0, 0, 'Чем дольше вы тянете, тем короче будущее, которое я могу предсказать!', 12, 0, 100, 0, 0, 0, 10128, 0, 0, 0, 'Воржей to 0');
INSERT INTO `creature_text` VALUES (14823, 0, 0, 'Everyone enjoying themselves so far?  That\'s great!  Welcome to the Darkmoon Faire, the greatest show on all of Azeroth!  Make sure that you speak with Yebb and his friends here while you\'re taking in Neblegear\'s Darkmoon Zoo Bizarre.', 12, 0, 100, 0, 0, 10153, 10153, 0, 0, 0, 'Silas Darkmoon');
INSERT INTO `creature_text` VALUES (14823, 0, 1, 'We\'re back and better than ever!  It\'s the Darkmoon Faire friend, and it\'s your lucky day!  Sparing no expense, we\'ve gathered wonders and treats from around the world for your delight.  Whether you\'re young or old, rich or poor, the Darkmoon Faire has it all!  Be sure to turn in your Darkmoon Faire Prize Tickets to Gelvas Grimegate, and choose from several exotic and wondrous prizes!', 12, 0, 100, 0, 0, 0, 10160, 0, 0, 0, 'Silas Darkmoon');
INSERT INTO `creature_text` VALUES (14823, 0, 2, 'Come one, come all.  Welcome to the Darkmoon Faire!  Don\'t be shy.  Step right up to Lhara and buy yourself an exotic artifact from far off lands.  If you\'re one of the lucky few who have found Darkmoon Cards, have a word with Professor Paleo.  Hungry?  Thirsty?  You\'re in luck!  Refreshments are available right here from Sylannia and Stamp.  I recommend the Darkmoon Special Reserve to wash down some Red Hot Wings.  And if the future is what you seek, then run, don\'t walk, to speak with Sayge.', 12, 0, 100, 0, 0, 0, 10154, 0, 0, 0, 'Silas Darkmoon');
INSERT INTO `creature_text` VALUES (14823, 0, 3, 'Welcome one and all to the Darkmoon Faire, the greatest event in all the world!  We have it all... delicious food, strong drink, exotic artifacts, fortunes read, amazing prizes and excitement without end!  Don\'t forget to turn in your Darkmoon Faire Prize Tickets to Gelvas Grimegate!  All it takes is five or more and you\'re on your way to the most wondrous prizes on all of Azeroth.  Everybody is a winner!', 12, 0, 100, 0, 0, 0, 10155, 0, 0, 0, 'Silas Darkmoon');
INSERT INTO `creature_text` VALUES (14828, 0, 0, 'Купоны! Меняйте подарочные купоны на чудесные, диковинные призы!', 12, 0, 100, 0, 0, 0, 10149, 0, 0, 0, 'Гелвас Углешлюз');
INSERT INTO `creature_text` VALUES (14828, 0, 1, 'Подарки! Подарки! Меняйте подарочные купоны ярмарки на ценные подарки!', 12, 0, 100, 0, 0, 0, 10152, 0, 0, 0, 'Гелвас Углешлюз');
INSERT INTO `creature_text` VALUES (14828, 0, 2, 'Пять купонов или пятьсот – без разницы, дружище! Выигрывает каждый!', 12, 0, 100, 0, 0, 0, 10151, 0, 0, 0, 'Гелвас Углешлюз');
INSERT INTO `creature_text` VALUES (14828, 0, 3, 'Искателей приключений ждут таинственные призы! Подходите, подходите!', 12, 0, 100, 0, 0, 0, 10150, 0, 0, 0, 'Гелвас Углешлюз');
INSERT INTO `creature_text` VALUES (14841, 0, 0, 'Ружья, карабины, пистолеты! Ну же, дружище!', 12, 0, 100, 70, 0, 0, 53455, 0, 0, 0, 'Ринлинг to Player');
INSERT INTO `creature_text` VALUES (14841, 1, 0, 'Испытай себя – ну и выиграй приз заодно!', 12, 0, 100, 70, 0, 0, 53458, 0, 0, 0, 'Ринлинг to Player');
INSERT INTO `creature_text` VALUES (14841, 2, 0, 'Эта игра настолько проста, что даже |3-6($c) имеет все шансы на победу!', 12, 0, 100, 70, 0, 0, 53453, 0, 0, 0, 'Ринлинг to Player');
INSERT INTO `creature_text` VALUES (14841, 3, 0, 'Эй, ребята, кому редкостей и диковинок – бесплатно?! Не пропустите!', 12, 0, 100, 70, 0, 0, 53457, 0, 0, 0, 'Ринлинг to Player');
INSERT INTO `creature_text` VALUES (14841, 4, 0, 'Стреляй – призы получай! Призы за меткость!', 12, 0, 100, 70, 0, 0, 53454, 0, 0, 0, 'Ринлинг to Player');
INSERT INTO `creature_text` VALUES (14846, 0, 0, 'Все, что я продаю, я приобрела лично, и я гарантирую подлинность всех этих вещей.', 12, 0, 100, 0, 0, 0, 10141, 0, 0, 0, 'Лахра');
INSERT INTO `creature_text` VALUES (14846, 0, 1, 'Да вы хоть представляете, через что мне пришлось пройти, чтобы привезти для продажи эти несравненные ценности?! Вот, поглядите на них сами!', 12, 0, 100, 0, 0, 0, 10144, 0, 0, 0, 'Лахра');
INSERT INTO `creature_text` VALUES (14846, 0, 2, 'Карты ярмарки Новолуния? Это к профессору.', 12, 0, 100, 0, 0, 0, 10142, 0, 0, 0, 'Лахра');
INSERT INTO `creature_text` VALUES (14846, 0, 3, 'Приходите взглянуть на мои товары, пока мы здесь. Мы пробудем тут неделю, а потом уедем в далекие края.', 12, 0, 100, 0, 0, 0, 10143, 0, 0, 0, 'Лахра');
