INSERT INTO `creature_text` VALUES (15181, 0, 0, 'Воины Калимдора! Герои Силитуса! Один из вас недавно нанес противнику смертельный удар! $n и $gего:ее; спутники прикончили коварного предводителя наших врагов в руинах Ан\'Киража! Оссириан Неуязвимый, проклятье Силитуса, наконец-то мертв, и армия его раздроблена!', 14, 0, 100, 0, 0, 0, 11355, 0, 0, 0, 'Командир Мар\'алит to Player');
INSERT INTO `creature_text` VALUES (15184, 0, 0, 'Taste blade, mongrel!', 12, 0, 100, 0, 0, 0, 10950, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15184, 0, 1, 'Please tell me that you didn\'t just do what I think you just did. Please tell me that I\'m not going to have to hurt you...', 12, 0, 100, 0, 0, 0, 10951, 0, 0, 0, '');
