INSERT INTO `creature_text` VALUES (15263, 0, 0, 'Are you so eager to die? I would be happy to accomodate you.', 14, 0, 100, 0, 0, 8615, 11445, 0, 0, 0, 'РџСЂРѕСЂРѕРє РЎРєРµСЂР°Рј');
