INSERT INTO `creature_text` VALUES (15263, 0, 2, 'Tremble! The end is upon you.', 14, 0, 100, 0, 0, 8621, 0, 0, 0, 0, 'РџСЂРѕСЂРѕРє РЎРєРµСЂР°Рј');
INSERT INTO `creature_text` VALUES (15263, 1, 0, 'Let your death serve as an example!', 14, 0, 100, 0, 0, 8617, 11446, 0, 0, 0, 'РџСЂРѕСЂРѕРє РЎРєРµСЂР°Рј');
INSERT INTO `creature_text` VALUES (15263, 1, 1, 'Spineless wretches! You will drown in rivers of blood!', 14, 0, 100, 0, 0, 8619, 0, 0, 0, 0, 'РџСЂРѕСЂРѕРє РЎРєРµСЂР°Рј');
INSERT INTO `creature_text` VALUES (15263, 1, 2, 'The screams of the dying will fill the air. A symphony of terror is about to begin!', 14, 0, 100, 0, 0, 8620, 0, 0, 0, 0, 'РџСЂРѕСЂРѕРє РЎРєРµСЂР°Рј');
INSERT INTO `creature_text` VALUES (15263, 2, 0, 'Prepare for the return of the ancient ones!', 14, 0, 100, 0, 0, 8618, 0, 0, 0, 0, 'РџСЂРѕСЂРѕРє РЎРєРµСЂР°Рј');
INSERT INTO `creature_text` VALUES (15263, 3, 0, 'You only delay... the inevetable.', 14, 0, 100, 0, 0, 8622, 0, 0, 0, 0, 'РџСЂРѕСЂРѕРє РЎРєРµСЂР°Рј');
