INSERT INTO `creature_text` VALUES (15420, 1, 0, 'What kind of trick is that |3-6($r)? If you want to ambush me, be warned, I won\'t die quietly!', 12, 0, 100, 6, 0, 0, 11735, 0, 0, 0, 'Prospector Anvilward');
INSERT INTO `creature_text` VALUES (15420, 1, 0, 'Это что еще за фокус, |3-6($r)? Если ты хочешь заманить меня в засаду – учти, я не стану умирать тихо!', 12, 0, 100, 6, 0, 0, 11735, 0, 0, 0, 'Prospector Anvilward');
INSERT INTO `creature_text` VALUES (15420, 2, 0, 'Эти ваши чародейские святилища очень... интересны, мистер Кайданис. Спасибо за информацию, которую вы мне предоставили.', 12, 0, 100, 1, 0, 0, 11717, 0, 0, 0, 'Prospector Anvilward');
