INSERT INTO `creature_text` VALUES (15516, 0, 0, 'РўРµР±СЏ Р¶РґРµС‚ СЃСѓРґ Р·Р° РѕСЃРєРІРµСЂРЅРµРЅРёРµ СЌС‚РёС… СЃРІСЏС‰РµРЅРЅС‹С… РјРµСЃС‚! РќРёРєРѕРјСѓ РЅРµ РґР°РЅРѕ РїРѕРєСѓС€Р°С‚СЊСЃСЏ РЅР° Р·Р°РєРѕРЅС‹ Р”СЂРµРІРЅРёС…! РќР°СЂСѓС€РёС‚РµР»Рё СѓРЅРёС‡С‚РѕР¶Р°СЋС‚СЃСЏ!', 14, 0, 100, 0, 0, 8646, 11442, 0, 0, 0, 'Р‘РѕРµРІРѕР№ СЃС‚СЂР°Р¶ РЎР°СЂС‚СѓСЂР°');
INSERT INTO `creature_text` VALUES (15516, 1, 0, 'I sentence you to death!', 14, 0, 100, 0, 0, 8647, 11443, 0, 0, 0, 'Р‘РѕРµРІРѕР№ СЃС‚СЂР°Р¶ РЎР°СЂС‚СѓСЂР°');
