INSERT INTO `creature_text` VALUES (15517, 4, 0, '%s впадает в неистовый гнев!', 16, 0, 100, 0, 0, 0, 11694, 3444, 3444, 26615, 'Оуро');
INSERT INTO `creature_text` VALUES (15550, 0, 0, 'It was... inevitable.', 14, 0, 100, 0, 0, 9169, 13460, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15550, 0, 1, 'Another trophy to add to my collection!', 14, 0, 100, 0, 0, 9300, 15333, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15550, 1, 0, 'Weapons are merely a convenience for a warrior of my skill!', 14, 0, 100, 0, 0, 9166, 13490, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15550, 2, 0, 'I always knew... someday I would become... the hunted.', 14, 0, 100, 0, 0, 9165, 13462, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15550, 3, 0, 'Such easy sport.', 14, 0, 100, 0, 0, 9170, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15550, 3, 1, 'Amateurs! Do not think you can best me! I kill for a living.', 14, 0, 100, 0, 0, 9304, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15608, 0, 0, 'Время пришло! Гул\'Дан, прикажи чернокнижникам удвоить усилия. Еще немного – и врата распахнутся, и Орда хлынет в этот мир, ничего не подозревающий и созревший для жатвы!', 14, 0, 100, 0, 0, 10435, 16787, 0, 0, 0, 'enter');
INSERT INTO `creature_text` VALUES (15608, 1, 0, 'Что это? Герои... пришли мне на помощь? Я чувствую за этим волю Темного Владыки. Воистину, это событие несет на себе печать его благословения.', 14, 0, 100, 0, 0, 0, 16789, 0, 0, 0, 'intro');
INSERT INTO `creature_text` VALUES (15608, 2, 0, 'Герои! Мой щит слабеет!', 14, 0, 100, 0, 0, 0, 16792, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15608, 3, 0, 'Все мои силы уходят на портал! Я не могу отвлекаться на щит!', 14, 0, 100, 0, 0, 0, 16794, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15608, 4, 0, 'Щит вот-вот исчезнет! Все мои планы под угрозой!', 14, 0, 100, 0, 0, 0, 16795, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15608, 5, 0, 'Нет! Будь проклята эта жалкая смертная оболочка!', 14, 0, 100, 0, 0, 0, 16790, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15608, 6, 0, 'I appreciate you, heroes. Now the Horde of Gul\'dan will pass through this world like a flock of locusts, and all my plans, all my carefully constructed plans will finally be fulfilled.', 14, 0, 100, 0, 0, 10440, 16796, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15608, 7, 0, 'Орки Орды! Это портал – ворота, ведущие к вашей новой судьбе! Азерот лежит перед вами, протяни руку да бери!', 14, 0, 100, 0, 0, 0, 19909, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15608, 8, 0, 'Гул\'дан говорит правду! Нам следует немедленно вернуться и сообщить нашим братьям эти вести! Возвращаемся через портал!', 14, 0, 100, 0, 0, 0, 19911, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15625, 0, 0, 'Come, $N. See what the Nightmare brings...', 14, 0, 100, 0, 0, 0, 11271, 0, 0, 0, 'Twilight Corrupter');
INSERT INTO `creature_text` VALUES (15625, 1, 0, 'The Nightmare cannot be stopped!', 14, 0, 100, 0, 0, 0, 11269, 0, 0, 0, 'Twilight Corrupter');
INSERT INTO `creature_text` VALUES (15625, 2, 0, 'Twilight Corrupter squeezes the last bit of life out of $N and swallows their soul.', 16, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Twilight Corrupter');
INSERT INTO `creature_text` VALUES (15638, 0, 0, 'Uphold the Law!', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15638, 0, 1, 'Serve the Public Trust!', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15638, 0, 2, 'Protect the innocent!', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15638, 1, 0, 'Служите общественному долгу!', 12, 0, 100, 0, 0, 0, 12824, 0, 0, 0, 'Волшебный часовой to Player');
INSERT INTO `creature_text` VALUES (15643, 0, 0, 'Amani Berserker becomes enraged!', 16, 0, 100, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15644, 0, 0, 'The pain...the need...I hunger for more...', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15644, 0, 1, 'I cannot stand the pain. I must find a new source.', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15644, 0, 2, 'More, more, more! I must feed soon.', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15644, 3, 0, 'Еще, еще, еще! Мне срочно нужно поесть!', 12, 10, 100, 0, 0, 0, 12150, 18143, 18143, 0, 'Презренный-бедокур');
INSERT INTO `creature_text` VALUES (15648, 0, 0, 'Manawraith bursts, showering the area with arcane residue!', 16, 0, 100, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15656, 0, 0, 'Angershade goes into a frenzy!', 16, 0, 100, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15657, 0, 0, 'Darkwraith goes into a frenzy!', 16, 0, 100, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15687, 0, 0, 'Hmm, unannounced visitors? Preparations must be made.', 14, 0, 100, 0, 0, 9211, 15021, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15687, 1, 0, 'Now, where was I? Oh yes...', 14, 0, 100, 0, 0, 9215, 15339, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15687, 1, 1, 'You rang?', 14, 0, 100, 0, 0, 9316, 15340, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15687, 2, 0, 'One more for dinner this evening.', 14, 0, 100, 0, 0, 9214, 13461, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15687, 2, 1, 'Time... Never enough time.', 14, 0, 100, 0, 0, 9314, 15085, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15687, 2, 2, 'I\'ve gone and made a mess.', 14, 0, 100, 0, 0, 9315, 15086, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15687, 3, 0, 'How terribly clumsy of me...', 14, 0, 100, 0, 0, 9213, 15022, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15688, 0, 0, 'Your blood will anoint my circle.', 14, 0, 100, 0, 0, 9264, 15145, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15688, 0, 1, 'The great one will be pleased.', 14, 0, 100, 0, 0, 9329, 15146, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15688, 1, 0, 'My life, is yours. Oh great one.', 14, 0, 100, 0, 0, 9262, 15137, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15688, 2, 0, 'Ah, you\'re just in time. The rituals are about to begin.', 14, 0, 100, 0, 0, 9260, 15141, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15688, 3, 0, 'Please, accept this humble offering, oh great one.', 14, 0, 100, 0, 0, 9263, 15147, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15688, 3, 1, 'Let the sacrifice serve his testament to my fealty.', 14, 0, 100, 0, 0, 9330, 15148, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15688, 4, 0, 'Come, you dwellers in the dark. Rally to my call!', 14, 0, 100, 0, 0, 9265, 15150, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15688, 4, 1, 'Gather, my pets. There is plenty for all.', 14, 0, 100, 0, 0, 9331, 15151, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15689, 0, 0, '%s cries out in withdrawal, opening gates to the nether.', 41, 0, 100, 0, 0, 0, 19880, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15689, 1, 0, '%s goes into a nether-fed rage!', 41, 0, 100, 0, 0, 0, 19877, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15690, 0, 0, 'Madness has brought you here to me. I shall be your undoing!', 14, 0, 100, 0, 0, 9218, 15127, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15690, 1, 0, 'Simple fools! Time is the fire in which you\'ll burn!', 14, 0, 100, 0, 0, 9220, 15341, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15690, 1, 1, 'I see the subtlety of conception is beyond primitives such as you.', 14, 0, 100, 0, 0, 9317, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15690, 2, 0, 'Who knows what secrets hide in the dark.', 14, 0, 100, 0, 0, 9223, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15690, 2, 1, 'The cerestial forces are mine to manipulate.', 14, 0, 100, 0, 0, 9320, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15690, 2, 2, 'How can you hope to withstand against such overwhelming power?', 14, 0, 100, 0, 0, 9321, 15342, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15690, 3, 0, 'Surely you did not think you could win.', 14, 0, 100, 0, 0, 9222, 15124, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15690, 3, 1, 'Your greed, your foolishness has brought you to this end.', 14, 0, 100, 0, 0, 9318, 15125, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15690, 3, 2, 'You are, but a plaything, unfit even to amuse.', 14, 0, 100, 0, 0, 9319, 15126, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15690, 4, 0, 'All realities, all dimensions are open to me!', 14, 0, 100, 0, 0, 9224, 15343, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15690, 4, 1, 'You face not Malchezaar alone, but the legions I command!', 14, 0, 100, 0, 0, 9322, 15344, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15690, 5, 0, 'I refuse to concede defeat. I am a prince of the Eredar! I am...', 14, 0, 100, 0, 0, 9221, 15123, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15691, 0, 0, 'The Menagerie is for guests only.', 14, 0, 100, 0, 0, 9183, 15055, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15691, 1, 0, 'Gallery rules will be strictly enforced.', 14, 0, 100, 0, 0, 9188, 15337, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15691, 1, 1, 'This curator is equipped for gallery protection.', 14, 0, 100, 0, 0, 9309, 15338, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15691, 2, 0, 'Your request cannot be processed.', 14, 0, 100, 0, 0, 9186, 15059, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15691, 3, 0, 'Failure to comply will result in offensive action.', 14, 0, 100, 0, 0, 9185, 15060, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15691, 4, 0, 'Do not touch the displays.', 14, 0, 100, 0, 0, 9187, 15335, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15691, 4, 1, 'You are not a guest.', 14, 0, 100, 0, 0, 9308, 15336, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15691, 5, 0, 'Curator is no longer operation-a-l.', 14, 0, 100, 0, 0, 9184, 15057, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (15698, 3, 0, 'Кстати, знаешь, что говорят о помощнике 432-А? Мне рассказывали, что... Эй! Что за?.. Эй! У нас, помощников, полно работы, между прочим!', 12, 0, 100, 396, 0, 0, 53655, 1000, 1000, 0, 'Помощник Дедушки Зимы to Player');
INSERT INTO `creature_text` VALUES (15698, 3, 0, 'Нам нужно еще двадцать тысяч шестеренок, ну и, кроме того... Эй! С чего ты $Gрешил:решила;, что можешь вот так просто взять и призвать меня, когда тебе заблагорассудится?!', 12, 0, 100, 396, 0, 0, 53654, 1000, 1000, 0, 'Помощник Дедушки Зимы to Player');
INSERT INTO `creature_text` VALUES (15698, 3, 0, 'Ну как, похоже на праздник Зимнего Покрова? Видишь все эти разноцветные огни? Украшения? Нет? Ты ведь в курсе, что все эти штуки не возникают из пустоты по мановению волшебной палочки, верно?!', 12, 0, 100, 396, 0, 0, 53656, 2000, 2000, 0, 'Помощник Дедушки Зимы to Player');
INSERT INTO `creature_text` VALUES (15698, 3, 0, 'Что за?.. ОПЯТЬ?! Послушай, |3-6($c). Я, конечно, не против посмотреть, как ты мутузишь монстров и пускаешь огонь изо рта на аукционе или чем ты там еще весь год занимаешься... но у меня ПОЛНО работы.', 12, 0, 100, 396, 0, 0, 53658, 1000, 1000, 0, 'Помощник Дедушки Зимы to Player');
INSERT INTO `creature_text` VALUES (15698, 3, 0, 'Э-э?! Где мастерская?! Вот кончится сезон – и призывай меня сколько душе угодно. Договорились?', 12, 0, 100, 396, 0, 0, 53659, 2000, 2000, 0, 'Помощник Дедушки Зимы to Player');
INSERT INTO `creature_text` VALUES (15705, 3, 0, 'Нам нужно еще двадцать тысяч шестеренок, ну и, кроме того... Эй! С чего ты $Gрешил:решила;, что можешь вот так просто взять и призвать меня, когда тебе заблагорассудится?!', 12, 0, 100, 396, 0, 0, 53654, 2000, 2000, 0, 'Маленькая помощница Дедушки Зимы to Player');
INSERT INTO `creature_text` VALUES (15705, 3, 0, 'Ну как, похоже на праздник Зимнего Покрова? Видишь все эти разноцветные огни? Украшения? Нет? Ты ведь в курсе, что все эти штуки не возникают из пустоты по мановению волшебной палочки, верно?!', 12, 0, 100, 396, 0, 0, 53656, 2000, 2000, 0, 'Снегурочка to Player');
INSERT INTO `creature_text` VALUES (15705, 3, 0, 'Так вот, |3-6($c). Попробуй осознать то, что я тебе сейчас расскажу. Игрушки, фонарики, пучки травы и все такое прочее сами себя не сделают, в курсе?.. Поэтому ХВАТИТ уже меня отвлекать. Заранее БОЛЬШОЕ СПАСИБО.', 12, 0, 100, 396, 0, 0, 53657, 1000, 1000, 0, 'Шняжка to Player');
INSERT INTO `creature_text` VALUES (15705, 3, 0, 'Ты в курсе, что Зимний Покров еще не наступил?.. У меня полно РАБОТЫ!', 12, 0, 100, 396, 0, 0, 53653, 1000, 1000, 0, 'Маленькая помощница Дедушки Зимы to Player');
INSERT INTO `creature_text` VALUES (15705, 3, 0, 'Что за?.. Какого?!.. Мне нужно делать игрушки!', 12, 0, 100, 396, 0, 0, 53652, 1000, 1000, 0, 'Маленькая помощница Дедушки Зимы to Player');
INSERT INTO `creature_text` VALUES (15705, 3, 0, 'Э-э?! Где мастерская?! Вот кончится сезон – и призывай меня сколько душе угодно. Договорились?', 12, 0, 100, 396, 0, 0, 53659, 1000, 1000, 0, 'Шняжка to Player');
INSERT INTO `creature_text` VALUES (15727, 0, 0, '%s РѕСЃР»Р°Р±Р»РµРЅ!', 16, 0, 100, 0, 0, 0, 11476, 0, 0, 0, 'Рљ\'РўСѓРЅ');
INSERT INTO `creature_text` VALUES (15746, 0, 0, 'Подарки для всех! Дедушка Зима оставил всем подарки!', 14, 0, 100, 0, 0, 0, 11430, 0, 0, 0, 'Помощник Дедушки Зимы to 0');
INSERT INTO `creature_text` VALUES (15928, 0, 0, 'Слишком поздно! Я... должен... повиноваться...', 14, 0, 100, 0, 0, 8872, 13091, 0, 0, 0, 'Таддиус to Player');
INSERT INTO `creature_text` VALUES (15928, 1, 0, 'Убью...', 14, 0, 100, 0, 0, 8867, 13086, 0, 0, 0, 'Таддиус to Player');
INSERT INTO `creature_text` VALUES (15928, 2, 0, 'Познайте же боль...', 14, 0, 100, 0, 0, 8871, 13090, 0, 0, 0, 'Таддиус to 0');
INSERT INTO `creature_text` VALUES (15928, 3, 0, 'Полярность изменилась!', 41, 0, 100, 0, 0, 8871, 32324, 0, 0, 0, 'Таддиус to 0');
INSERT INTO `creature_text` VALUES (15928, 6, 0, 'Спаси... бо...', 14, 0, 100, 0, 0, 8870, 88777, 0, 0, 0, 'Таддиус to Player');
INSERT INTO `creature_text` VALUES (15929, 0, 0, 'Сталагг сокрушить вас!', 14, 0, 100, 0, 0, 8802, 13083, 0, 0, 0, 'Сталагг to Player');
INSERT INTO `creature_text` VALUES (15929, 1, 0, '%s умирает.', 16, 0, 100, 0, 0, 0, 46212, 0, 0, 0, 'Сталагг to 0');
INSERT INTO `creature_text` VALUES (15930, 0, 0, 'I will feed you to master!', 14, 0, 100, 0, 0, 8802, 13023, 0, 0, 0, 'Фойген to Player');
INSERT INTO `creature_text` VALUES (15930, 1, 0, '%s умирает.', 16, 0, 100, 0, 0, 0, 46212, 0, 0, 0, 'Фойген to 0');
INSERT INTO `creature_text` VALUES (15931, 4, 0, '%s разбрызгивает по комнате слизь!', 41, 0, 100, 0, 0, 0, 32318, 26937, 59703, 54364, 'Гроббулус');
INSERT INTO `creature_text` VALUES (15932, 4, 0, '%s замечает жадно жрущего зомби.', 16, 0, 100, 0, 0, 0, 12242, 21203, 90766, 28371, 'Глут to Закуска зомби');
INSERT INTO `creature_text` VALUES (15936, 0, 0, 'Пришло ваше время...', 14, 0, 100, 0, 0, 8827, 13043, 0, 0, 0, 'Хейган Нечестивый to Player');
INSERT INTO `creature_text` VALUES (15936, 1, 0, '%s испускает последний вздох.', 16, 0, 100, 0, 0, 8828, 13044, 0, 0, 0, 'Хейган Нечестивый to 78116');
INSERT INTO `creature_text` VALUES (15942, 0, 0, 'Открыть огонь!', 14, 0, 100, 0, 0, 0, 146233, 0, 0, 0, 'Следопыт Сарийна');
INSERT INTO `creature_text` VALUES (15952, 0, 0, '%s is furious!', 41, 0, 100, 0, 0, 0, 38630, 0, 0, 0, 'Мексна to 0');
INSERT INTO `creature_text` VALUES (15953, 0, 0, 'Господин отомстит за меня!', 14, 0, 100, 0, 0, 8798, 12853, 0, 0, 0, 'Великая вдова Фарлина to Player');
INSERT INTO `creature_text` VALUES (15953, 1, 0, 'Вам не скрыться от меня!', 14, 0, 100, 0, 0, 8795, 12857, 0, 0, 0, 'Великая вдова Фарлина to Player');
INSERT INTO `creature_text` VALUES (15954, 0, 0, 'Прощайся с жизнью!', 14, 0, 100, 0, 0, 8846, 112561, 0, 0, 0, 'Нот Чумной to Player');
INSERT INTO `creature_text` VALUES (15954, 1, 0, 'Встаньте, мои воины! Встаньте и сражайтесь вновь!', 14, 0, 100, 0, 0, 8851, 13067, 0, 0, 0, 'Нот Чумной to 0');
INSERT INTO `creature_text` VALUES (15954, 2, 0, '%s призывает скелетов-воинов!', 41, 0, 100, 0, 0, 8851, 32974, 0, 0, 0, 'Нот Чумной to 0');
INSERT INTO `creature_text` VALUES (15954, 3, 0, 'Я буду служить господину... даже после смерти!', 14, 0, 100, 0, 0, 8848, 13064, 0, 0, 0, 'Нот Чумной to Player');
INSERT INTO `creature_text` VALUES (15956, 0, 0, 'Кого мне съесть первым? Сложный выбор... Все они пахнут так вкусно...', 14, 0, 100, 0, 0, 8792, 13008, 0, 0, 0, 'Ануб\'Рекан to Player');
INSERT INTO `creature_text` VALUES (15956, 1, 0, 'Вам отсюда не выбраться.', 14, 0, 100, 0, 0, 8786, 13002, 0, 0, 0, 'Ануб\'Рекан to Player');
INSERT INTO `creature_text` VALUES (15990, 0, 0, 'Кто посмел вторгнуться в мои владения? Всякий, явившийся без приглашения, обречен!', 14, 0, 100, 0, 0, 14463, 12984, 0, 0, 0, 'Кел\'Тузад to 78116');
INSERT INTO `creature_text` VALUES (15990, 1, 0, 'Глупцы! Наслаждаетесь своим триумфом? Вы просто сделали еще один шаг в сторону бездны!', 14, 0, 100, 0, 0, 14464, 12985, 0, 0, 0, 'Кел\'Тузад to Player');
INSERT INTO `creature_text` VALUES (15990, 2, 0, 'I am tired of these games. A little more - and I will send your souls into the darkness of oblivion!', 14, 0, 100, 0, 0, 14465, 12986, 0, 0, 0, 'Кел\'Тузад to 78116');
INSERT INTO `creature_text` VALUES (15990, 3, 0, 'Вы и представить себе не можете, какие кошмары ждут вас впереди. Вы еще ничего не видели! Вас ожидает застывшее сердце Наксрамаса!', 14, 0, 100, 0, 0, 14466, 12987, 0, 0, 0, 'Кел\'Тузад to Player');
INSERT INTO `creature_text` VALUES (15990, 4, 0, 'Ваши силы готовы нанести удар по врагу, мой повелитель.', 14, 0, 100, 0, 0, 14467, 12990, 0, 0, 0, 'Кел\'Тузад to Зеркальное изображение');
INSERT INTO `creature_text` VALUES (15990, 5, 0, 'Да, господин. Близится час их полного уничтожения... Что такое?', 14, 0, 100, 0, 0, 14468, 12991, 0, 0, 0, 'Кел\'Тузад to Зеркальное изображение');
INSERT INTO `creature_text` VALUES (15990, 6, 0, 'Как прикажете, повелитель!', 14, 0, 100, 0, 0, 14469, 101772, 0, 0, 0, 'Кел\'Тузад to Зеркальное изображение');
INSERT INTO `creature_text` VALUES (15990, 7, 0, 'Идите же, герои... По воле Короля-лича вы будете уничтожены.', 14, 0, 100, 0, 0, 0, 12993, 0, 0, 0, 'Кел\'Тузад to Зеркальное изображение');
INSERT INTO `creature_text` VALUES (15990, 8, 0, 'Соратники, слуги, солдаты холодной тьмы! Повинуйтесь зову Кел\'Тузада!', 14, 0, 100, 0, 0, 14471, 12999, 0, 0, 0, 'Кел\'Тузад to Player');
INSERT INTO `creature_text` VALUES (15990, 9, 0, 'Кричите! Кричите изо всех сил!', 14, 0, 100, 0, 0, 14476, 12996, 0, 0, 0, 'Кел\'Тузад to OLDWorld Trigger (DO NOT DELETE)');
INSERT INTO `creature_text` VALUES (15990, 10, 0, 'Кел\'Тузад вступает в бой!', 41, 0, 100, 0, 0, 0, 32803, 0, 0, 0, 'Кел\'Тузад to OLDWorld Trigger (DO NOT DELETE)');
INSERT INTO `creature_text` VALUES (15990, 11, 0, 'Господин, мне нужна помощь!', 14, 0, 100, 0, 0, 14470, 12998, 0, 0, 0, 'Кел\'Тузад to 0');
INSERT INTO `creature_text` VALUES (15990, 12, 0, 'Арргхх! Не стоит... радоваться... Ваша победа бессмысленна, ибо я вернусь в невообразимой мощи!', 14, 0, 100, 0, 0, 14480, 13019, 0, 0, 0, 'Кел\'Тузад to 78116');
INSERT INTO `creature_text` VALUES (16011, 0, 0, 'An aura of necrotic energy blocks all healing!', 41, 0, 100, 0, 0, 0, 32334, 0, 0, 0, 'Loatheb');
INSERT INTO `creature_text` VALUES (16011, 1, 0, 'The aura fades away, allowing for healing once more!', 41, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Loatheb');
INSERT INTO `creature_text` VALUES (16011, 2, 0, 'The aura\'s power begins to wane!', 41, 0, 100, 0, 0, 0, 32805, 0, 0, 0, 'Loatheb');
INSERT INTO `creature_text` VALUES (16028, 0, 0, 'Кел\'Тузад объявил Лоскутика воплощением войны!', 14, 0, 100, 0, 0, 8910, 13069, 0, 0, 0, 'Лоскутик to Player');
INSERT INTO `creature_text` VALUES (16028, 1, 0, 'Что... случилось... с Лоску...', 14, 0, 100, 0, 0, 8911, 13070, 0, 0, 0, 'Лоскутик to 78116');
INSERT INTO `creature_text` VALUES (16029, 0, 0, '%s извергает отвратительного едкого слизня!', 16, 0, 100, 0, 0, 0, 12347, 0, 0, 0, 'Изрыгатель слизи to 0');
INSERT INTO `creature_text` VALUES (16060, 0, 0, 'Глупцы! Вы сами нашли свою погибель!', 14, 0, 100, 0, 0, 8807, 13030, 0, 0, 0, 'Готик Жнец to Player');
INSERT INTO `creature_text` VALUES (16060, 1, 0, 'Вам никогда не понять, сколь велика сила, потревоженная вами.', 14, 0, 100, 0, 0, 0, 13031, 0, 0, 0, 'Готик Жнец to Player');
INSERT INTO `creature_text` VALUES (16060, 2, 0, 'Вы сражались отчаянно, чтобы проникнуть в царство жнеца.', 14, 0, 100, 0, 0, 0, 13032, 0, 0, 0, 'Готик Жнец to Player');
INSERT INTO `creature_text` VALUES (16060, 3, 0, 'Теперь перед вами лежит лишь один путь – путь проклятых.', 14, 0, 100, 0, 0, 0, 13033, 0, 0, 0, 'Готик Жнец to Player');
INSERT INTO `creature_text` VALUES (16060, 4, 0, 'Я ждал слишком долго. Сейчас вы предстанете пред ликом Жнеца душ.', 14, 0, 100, 0, 0, 8808, 13028, 0, 0, 0, 'Готик Жнец to 0');
INSERT INTO `creature_text` VALUES (16060, 5, 0, '%s телепортируется в гущу боя!', 41, 0, 100, 0, 0, 8808, 32306, 0, 0, 0, 'Готик Жнец to 0');
INSERT INTO `creature_text` VALUES (16060, 6, 0, 'Центральные ворота открываются!', 41, 0, 100, 0, 0, 0, 32307, 0, 0, 0, 'Готик Жнец to 0');
INSERT INTO `creature_text` VALUES (16060, 7, 0, 'Меня... больше... нет.', 14, 0, 100, 0, 0, 8805, 13026, 0, 0, 0, 'Готик Жнец to 78116');
INSERT INTO `creature_text` VALUES (16061, 0, 0, 'Не щадите никого!', 14, 0, 100, 397, 0, 8856, 94993, 0, 0, 0, 'Инструктор Разувий to Player');
INSERT INTO `creature_text` VALUES (16061, 1, 0, 'Достойная... смерть.', 14, 0, 100, 0, 0, 8860, 29535, 0, 0, 0, 'Инструктор Разувий to Зеркальное изображение');
INSERT INTO `creature_text` VALUES (16063, 0, 0, 'Чужаки, откажитесь от этой безрассудной авантюры! Бегите, пока не поздно!', 14, 0, 100, 0, 0, 8917, 13101, 0, 0, 0, 'Сэр Зелиек to 78116');
INSERT INTO `creature_text` VALUES (16063, 1, 0, 'Может быть, они облагоразумятся... и успеют скрыться.', 14, 0, 100, 0, 0, 8918, 13102, 0, 0, 0, 'Сэр Зелиек to 78116');
INSERT INTO `creature_text` VALUES (16064, 0, 0, 'К оружию, олухи! У нас гости!', 14, 0, 100, 0, 0, 8903, 13038, 0, 0, 0, 'Тан Кортазз to 78116');
INSERT INTO `creature_text` VALUES (16064, 1, 0, 'Хорош скулить! Заткнитесь, пока я не разозлился!', 14, 0, 100, 0, 0, 8904, 13039, 0, 0, 0, 'Тан Кортазз to 78116');
INSERT INTO `creature_text` VALUES (16064, 2, 0, 'Все это... было зря...', 12, 0, 100, 0, 0, 8900, 13035, 0, 0, 0, 'Тан Кортазз to Player');
INSERT INTO `creature_text` VALUES (16065, 0, 0, 'Первая жертва будет на моем счету! Кто-нибудь хочет пари?', 14, 0, 100, 0, 0, 8898, 13016, 0, 0, 0, 'Леди Бломе to Player');
INSERT INTO `creature_text` VALUES (16065, 1, 0, 'Ну что ж, Зелиек, не прогоняй их! Сперва мы с ними позабавимся!', 14, 0, 100, 0, 0, 8896, 13014, 0, 0, 0, 'Леди Бломе to 78116');
INSERT INTO `creature_text` VALUES (16065, 2, 0, 'Надеюсь, они проживут достаточно долго, чтобы я... успела представиться.', 14, 0, 100, 0, 0, 8897, 13015, 0, 0, 0, 'Леди Бломе to 78116');
INSERT INTO `creature_text` VALUES (16065, 3, 0, '%s применяет на всех заклинание \"Неутолимая боль\"!', 41, 0, 100, 0, 0, 0, 33087, 0, 0, 0, 'Леди Бломе to 0');
INSERT INTO `creature_text` VALUES (16128, 0, 0, 'Он был послан, чтобы решить судьбу нашего мира.', 14, 0, 100, 0, 0, 0, 33986, 0, 0, 0, 'Ронин to Player');
INSERT INTO `creature_text` VALUES (16151, 0, 0, 'Well done Midnight!', 14, 0, 100, 0, 0, 9173, 15334, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16151, 1, 0, 'Cowards! Wretches!', 14, 0, 100, 0, 0, 9167, 13459, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16151, 1, 1, 'Who dares attack the steed of the Huntsman?', 14, 0, 100, 0, 0, 9298, 15378, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16151, 1, 2, 'Perhaps you would rather test yourselves against a more formidable opponent?!', 14, 0, 100, 0, 0, 9299, 15379, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16151, 2, 0, 'Come, Midnight, let\'s disperse this petty rabble!', 14, 0, 100, 0, 0, 9168, 13456, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16168, 0, 0, '%s издает странный звук.', 16, 0, 100, 0, 0, 0, 10755, 0, 0, 0, 'Каменная горгулья to 0');
INSERT INTO `creature_text` VALUES (16189, 0, 0, 'Guards!', 14, 1, 100, 0, 0, 0, 4583, 0, 0, 0, 'Skymaster Sunwing');
INSERT INTO `creature_text` VALUES (16192, 0, 0, 'Guards!', 14, 1, 100, 0, 0, 0, 4583, 0, 0, 0, 'Skymistress Gloaming');
INSERT INTO `creature_text` VALUES (16197, 3, 0, 'Послушай, у меня полно других дел, кроме как сидеть и ждать этого послания! Госпожа Златилен поручила мне несколько важных заданий.', 12, 1, 100, 0, 0, 0, 12411, 430282, 430282, 0, 'Чародей Вандрил');
INSERT INTO `creature_text` VALUES (16206, 0, 0, 'Th... thank you.  I thought I was going to die.', 12, 0, 100, 0, 0, 0, 12222, 0, 0, 0, 'Apprentice Varnis');
INSERT INTO `creature_text` VALUES (16208, 0, 0, 'Thanks, I should\'ve never left Silverpine Forest.', 12, 0, 100, 6, 0, 0, 12220, 0, 0, 0, 'Apothecary Enith');
INSERT INTO `creature_text` VALUES (16209, 0, 0, 'You have my thanks!', 12, 0, 100, 0, 0, 0, 96432, 0, 0, 0, 'Ranger Vedoran');
INSERT INTO `creature_text` VALUES (16218, 3, 0, '%s теряет связь!', 41, 0, 100, 0, 0, 0, 12156, 185000, 185000, 0, 'Катушка Теслы to Катушка Теслы');
INSERT INTO `creature_text` VALUES (16218, 4, 0, '%s перезагружается!', 41, 0, 100, 0, 0, 0, 12178, 26000, 26000, 0, 'Катушка Теслы to OLDWorld Trigger (DO NOT DELETE)');
INSERT INTO `creature_text` VALUES (16220, 0, 0, 'Lilatha, get someone to look at those injuries. Thank you for bringing her back safely.', 12, 0, 100, 0, 0, 0, 12193, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16227, 0, 0, 'Guards!', 14, 1, 100, 0, 0, 0, 4583, 0, 0, 0, 'Skymistress Gloaming');
INSERT INTO `creature_text` VALUES (16244, 4, 0, '%s is furious!', 16, 0, 100, 0, 0, 0, 38630, 47578, 47578, 54701, 'Заразный вурдалак');
INSERT INTO `creature_text` VALUES (16295, 0, 0, 'Let\'s go.', 12, 0, 100, 0, 0, 0, 12393, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16295, 1, 0, '$N, let\'s use the antechamber to the right.', 12, 0, 100, 0, 0, 0, 12187, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16295, 2, 0, 'I can see the light at the end of the tunnel!', 12, 0, 100, 0, 0, 0, 12188, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16295, 3, 0, 'There\'s Farstrider Enclave now, $c. Not far to go... look out!  Troll ambush!!', 12, 0, 100, 0, 0, 0, 12189, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16295, 4, 0, 'Thank you for saving my life and bringing me back to safety, $N', 12, 0, 100, 0, 0, 0, 12191, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16295, 5, 0, 'Captain Helios, I\'ve been rescued from the Amani Catacombs. Reporting for duty, sir!', 12, 0, 100, 0, 0, 0, 12190, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16364, 0, 0, '%s releases the last of its energies into the nearby runestone, successfully reactivating it.', 16, 0, 100, 0, 0, 0, 12272, 0, 0, 0, 'Infused Crystal');
INSERT INTO `creature_text` VALUES (16457, 0, 0, 'Your behavior will not be tolerated!', 14, 0, 100, 0, 0, 9204, 15079, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16457, 1, 0, 'Ah ah ah...', 14, 0, 100, 0, 0, 9207, 15082, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16457, 1, 1, 'This is for the best.', 14, 0, 100, 0, 0, 9312, 15084, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16457, 1, 2, 'Impure thoughts lead to profane actions.', 14, 0, 100, 0, 0, 9311, 15083, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16457, 2, 0, 'Cast out your corrupt thoughts.', 14, 0, 100, 0, 0, 9313, 15080, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16457, 2, 1, 'Your impurity must be cleansed.', 14, 0, 100, 0, 0, 9208, 13396, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16457, 3, 0, 'Death comes. Will your conscience be clear?', 14, 0, 100, 0, 0, 9206, 15081, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16483, 0, 0, '$c, you saved me! I owe you a debt that I can never repay. I\'ll go see if I can help the others.', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16483, 0, 1, 'Where am I? Who are you? Oh no! What happened to the ship?', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16483, 0, 2, 'The last thing I remember is the ship falling and us getting into the pods. I\'ll go see how I can help. Thank you!', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16502, 0, 0, 'I could use some help over here if you please.', 12, 7, 100, 0, 0, 0, 13105, 0, 0, 0, 'Zalduun to 0');
INSERT INTO `creature_text` VALUES (16502, 1, 0, 'Эй, паладин, ты не поможешь? Мне бы тут еще немного залечить... Спасибо.', 12, 7, 100, 0, 0, 0, 13106, 0, 0, 0, 'Зальдуун to 0');
INSERT INTO `creature_text` VALUES (16502, 2, 0, 'Я бы с радостью принял твою помощь, если не возражаешь.', 12, 7, 100, 0, 0, 0, 13105, 0, 0, 0, 'Зальдуун to 0');
INSERT INTO `creature_text` VALUES (16502, 4, 0, 'Аурелон, мне нужна помощь.', 12, 7, 100, 0, 0, 0, 13104, 0, 0, 0, 'Зальдуун to 0');
INSERT INTO `creature_text` VALUES (16502, 13, 0, 'Паладин Аурелон, если у вас остался запас маны, не могли бы вы помочь в этом деле? Благодарю вас.', 12, 7, 100, 0, 0, 0, 13107, 0, 0, 0, 'Зальдуун to 0');
INSERT INTO `creature_text` VALUES (16514, 3, 0, 'Tedon, go ahead and try the neutralizing agent on the mutated creature.', 12, 0, 100, 1, 0, 0, 17938, 1045156, 1045156, 0, 'Botanist Taerix to Player');
INSERT INTO `creature_text` VALUES (16518, 0, 0, 'The %s seems overjoyed.', 16, 0, 100, 0, 0, 0, 12516, 0, 0, 0, 'Inoculated Nestlewood Owlkin');
INSERT INTO `creature_text` VALUES (16518, 0, 1, 'The %s seems disoriented.', 16, 0, 100, 0, 0, 0, 12518, 0, 0, 0, 'Inoculated Nestlewood Owlkin');
INSERT INTO `creature_text` VALUES (16518, 0, 2, 'The %s doesn\'t look like it minds the crystal\'s effects.', 16, 0, 100, 0, 0, 0, 12520, 0, 0, 0, 'Inoculated Nestlewood Owlkin');
INSERT INTO `creature_text` VALUES (16518, 0, 3, 'The %s didn\'t like what just happened.', 16, 0, 100, 0, 0, 0, 12521, 0, 0, 0, 'Inoculated Nestlewood Owlkin');
INSERT INTO `creature_text` VALUES (16518, 0, 4, 'The %s looks confused.', 16, 0, 100, 0, 0, 0, 12517, 0, 0, 0, 'Inoculated Nestlewood Owlkin');
INSERT INTO `creature_text` VALUES (16518, 0, 5, 'The %s nods appreciatively.', 16, 0, 100, 0, 0, 0, 12514, 0, 0, 0, 'Inoculated Nestlewood Owlkin');
INSERT INTO `creature_text` VALUES (16521, 0, 0, 'We won\'t allow you to leave this valley!', 12, 0, 100, 0, 0, 0, 13426, 0, 0, 0, 'Blood Elf Scout to Player');
INSERT INTO `creature_text` VALUES (16521, 1, 0, 'I hope you\'ve made your peace.', 12, 0, 100, 2, 0, 0, 13428, 0, 0, 0, 'Blood Elf Scout to Player');
INSERT INTO `creature_text` VALUES (16522, 0, 0, 'You\'ll not take me alive, scum!', 12, 0, 100, 0, 0, 0, 12767, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16524, 0, 0, 'Please, no more. My son... he\'s gone mad!', 14, 0, 100, 0, 0, 9241, 13529, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16524, 0, 1, 'I\'ll not be tortured again!', 14, 0, 100, 0, 0, 9323, 15353, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16524, 0, 2, 'Who are you? What do you want? Stay away from me!', 14, 0, 100, 0, 0, 9324, 13530, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16524, 1, 0, 'I\'ll show you this beaten dog still has some teeth!', 14, 0, 100, 0, 0, 9245, 13519, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16524, 1, 1, 'Burn you hellish fiends!', 14, 0, 100, 0, 0, 9326, 13520, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16524, 2, 0, 'I\'ll freeze you all!', 14, 0, 100, 0, 0, 9246, 13522, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16524, 2, 1, 'Back to the cold dark with you!', 14, 0, 100, 0, 0, 9327, 13523, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16524, 3, 0, 'Yes, yes, my son is quite powerful... but I have powers of my own!', 14, 0, 100, 0, 0, 9242, 13517, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16524, 3, 1, 'I am not some simple jester! I am Nielas Aran!', 14, 0, 100, 0, 0, 9325, 13518, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16524, 4, 0, 'Surely you would not deny an old man a replenishing drink? No, no I thought not.', 14, 0, 100, 0, 0, 9248, 13514, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16524, 5, 0, 'I\'m not finished yet! No, I have a few more tricks up me sleeve.', 14, 0, 100, 0, 0, 9251, 13513, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16524, 6, 0, 'I want this nightmare to be over!', 14, 0, 100, 0, 0, 9250, 13526, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16524, 6, 1, 'Torment me no more!', 14, 0, 100, 0, 0, 9328, 13527, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16524, 7, 0, 'You\'ve wasted enough of my time. Let these games be finished!', 14, 0, 100, 0, 0, 9247, 13569, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16524, 8, 0, 'At last... The nightmare is.. over...', 14, 0, 100, 0, 0, 9244, 15345, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16524, 9, 0, 'Where did you get that?! Did HE send you?!', 14, 0, 100, 0, 0, 9249, 13532, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16550, 0, 0, 'By the seven Ata\'mal crystals!  Others have survived the crash!  Zhanaa, is that you?  It is so good to see you again!', 12, 0, 100, 0, 0, 0, 12845, 0, 0, 0, 'Image of Technician Dyvuun');
INSERT INTO `creature_text` VALUES (16550, 1, 0, 'And who do we have here?  No doubt th... crzzzk ...ade this communication possible?  I give you greetings fro... psshzzzk... Azure Watch.', 12, 0, 100, 0, 0, 0, 12752, 0, 0, 0, 'Image of Technician Dyvuun');
INSERT INTO `creature_text` VALUES (16550, 2, 0, 'Judging by your signal, we put you... ust southeast of the larger part of the island we crashed onto.  Cross the Crystalbrook River to ge... kshhhhk zzzt. Sorry, there\'s a lot of stat...', 12, 0, 100, 0, 0, 0, 12753, 0, 0, 0, 'Image of Technician Dyvuun');
INSERT INTO `creature_text` VALUES (16551, 3, 0, 'Yes, Zhanaa, it\'s me!  Your signal is weak.', 12, 7, 100, 0, 0, 0, 13687, 1046406, 1046406, 0, 'Technician Dyvuun to Technician Dyvuun');
INSERT INTO `creature_text` VALUES (16551, 3, 0, 'Zhanaa!  Gah, I have to get this thing fixed!', 12, 7, 100, 0, 0, 0, 13692, 4248406, 4248406, 0, 'Technician Dyvuun to Technician Dyvuun');
INSERT INTO `creature_text` VALUES (16573, 0, 0, 'Некрорахнид-стражник присоединяется к схватке!', 41, 0, 100, 0, 0, 0, 29887, 0, 0, 0, 'Некрорахнид-стражник to Ануб\'Рекан');
INSERT INTO `creature_text` VALUES (16577, 0, 0, 'Brothers and sisters, I have been to the promised land. I have tasted in the sublim energy. I have felt bliss - bliss so engrossing and all encompassing that I was left wondering if I had stumbled upon the dreams of gods.!', 12, 0, 100, 5, 0, 0, 0, 0, 0, 0, 'Martik Tor\'seldoi');
INSERT INTO `creature_text` VALUES (16577, 1, 0, 'In paradise, you merely reach out and take from the Nether.', 12, 0, 100, 1, 0, 0, 12703, 0, 0, 0, 'Martik Tor\'seldoi');
INSERT INTO `creature_text` VALUES (16577, 2, 0, 'From the very air! Tendrils of arcane energy light up the obsidian sky as plumes of raw magic rise up from fissures in the land. Kneel and drink from the fissure as you do from a stream or well. Pluck a tendril from the heavens as if it were an apple hanging from a branch.', 12, 0, 100, 5, 0, 0, 12706, 0, 0, 0, 'Martik Tor\'seldoi');
INSERT INTO `creature_text` VALUES (16578, 3, 0, '%s ахает.', 16, 1, 100, 4, 0, 0, 109770, 1007000, 1007000, 0, 'Эльф крови - странник to Мартайк Тор\'сельдори');
INSERT INTO `creature_text` VALUES (16580, 0, 0, 'Ставлю десять серебряных на то, что я попаду в Оплот Чести вот этим булыжником!', 12, 1, 100, 5, 0, 0, 16991, 0, 0, 0, 'Траллмарский рубака to 0');
INSERT INTO `creature_text` VALUES (16580, 1, 0, 'Только попробуй, и я зашвырну за стену и тебя, и твои десять серебряных монет!', 12, 1, 100, 274, 0, 0, 16992, 0, 0, 0, 'Траллмарский рубака to Траллмарский рубака');
INSERT INTO `creature_text` VALUES (16580, 2, 0, '%s вздыхает.', 16, 0, 100, 92, 0, 0, 61350, 0, 0, 0, 'Траллмарский рубака to 0');
INSERT INTO `creature_text` VALUES (16580, 3, 0, 'Знаешь, я думаю, отсюда мы можем нанести удар по Оплоту Чести.', 12, 1, 100, 1, 0, 0, 16986, 0, 0, 0, 'Траллмарский рубака to 0');
INSERT INTO `creature_text` VALUES (16580, 4, 0, 'Если генерал Кракорк узнает, то съест нас заживо. Не надо.', 12, 1, 100, 274, 0, 0, 16988, 0, 0, 0, 'Траллмарский рубака to Траллмарский рубака');
INSERT INTO `creature_text` VALUES (16580, 5, 0, 'Ух! Значит, скажем, что Хагаш за него запнулся и ненароком выстрелил.', 12, 1, 100, 25, 0, 0, 16987, 0, 0, 0, 'Траллмарский рубака to 0');
INSERT INTO `creature_text` VALUES (16587, 0, 0, 'Guards!', 14, 1, 100, 0, 0, 0, 4583, 0, 0, 0, 'Barley');
INSERT INTO `creature_text` VALUES (16594, 1, 0, 'Этот мир принадлежит НАМ!', 12, 0, 100, 71, 0, 0, 16702, 0, 0, 0, 'Послушник из клана Призрачной Луны to Player');
INSERT INTO `creature_text` VALUES (16699, 1, 0, 'За Каргата! За победу!', 12, 0, 100, 0, 0, 10246, 16698, 0, 0, 0, 'Разоритель из клана Изувеченной Длани to Player');
INSERT INTO `creature_text` VALUES (16700, 0, 0, 'Мы должны остановить их! Занять позиции!', 14, 0, 100, 0, 0, 10246, 16355, 0, 0, 0, 'Легионер клана Изувеченной Длани to Player');
INSERT INTO `creature_text` VALUES (16700, 3, 0, 'Держать строй! Сокрушим этих глупцов!', 14, 0, 100, 15, 0, 10187, 16346, 44207, 44207, 0, 'Легионер клана Изувеченной Длани to Язычник из клана Изувеченной Длани');
INSERT INTO `creature_text` VALUES (16700, 4, 0, '%s is furious at the sight of a friend who fell in battle!', 16, 0, 100, 5, 0, 10201, 1151, 6715, 6715, 0, 'Легионер клана Изувеченной Длани to Буян из клана Изувеченной Длани');
INSERT INTO `creature_text` VALUES (16781, 3, 0, ' ma h raz Lokand   throm  ', 12, 1, 100, 4, 0, 0, 0, 35889, 35889, 0, 'Участница праздника Огненного солнцеворота');
INSERT INTO `creature_text` VALUES (16781, 3, 0, 'Пламя Альянса – это пламя истины!', 12, 7, 100, 4, 0, 0, 24532, 80326, 80326, 0, 'Участница праздника Огненного солнцеворота');
INSERT INTO `creature_text` VALUES (16799, 3, 0, 'Welcome, my brethren!  You\'ve been freed from demons.  Embrace the teachings of Velen!  Embrace the light!', 12, 0, 100, 0, 0, 0, 14006, 70985, 70985, 0, 'Ikan to Player');
INSERT INTO `creature_text` VALUES (16799, 3, 0, 'Добро пожаловать, братья мои! Вы были освобождены от демонов. Внемлите учению Велена! Внемлите свету!', 12, 0, 100, 0, 0, 0, 14006, 24000, 24000, 0, 'Икан to Player');
INSERT INTO `creature_text` VALUES (16807, 0, 0, 'You wish to fight us all at once? This should be amusing!', 14, 0, 100, 0, 0, 10262, 15594, 0, 0, 0, 'nethekurse SAY_INTRO');
INSERT INTO `creature_text` VALUES (16807, 1, 0, 'You can have that one. I no longer need him.', 14, 0, 100, 0, 0, 10263, 15572, 0, 0, 0, 'nethekurse PEON_ATTACK_1');
INSERT INTO `creature_text` VALUES (16807, 1, 1, 'Yes, beat him mercilessly. His skull is a thick as an ogres.', 14, 0, 100, 0, 0, 10264, 15575, 0, 0, 0, 'nethekurse PEON_ATTACK_2');
INSERT INTO `creature_text` VALUES (16807, 1, 2, 'Don\'t waste your time on that one. He\'s weak!', 14, 0, 100, 0, 0, 10265, 15573, 0, 0, 0, 'nethekurse PEON_ATTACK_3');
INSERT INTO `creature_text` VALUES (16807, 1, 3, 'You want him? Very well, take him!', 14, 0, 100, 0, 0, 10266, 15572, 0, 0, 0, 'nethekurse PEON_ATTACK_4');
INSERT INTO `creature_text` VALUES (16807, 2, 0, 'One pitiful wretch down. Go on, take another one.', 14, 0, 100, 0, 0, 10267, 15579, 0, 0, 0, 'nethekurse PEON_DIE_1');
INSERT INTO `creature_text` VALUES (16807, 2, 1, 'Ahh, what a waste... Next!', 14, 0, 100, 0, 0, 10268, 15584, 0, 0, 0, 'nethekurse PEON_DIE_2');
INSERT INTO `creature_text` VALUES (16807, 2, 2, 'I was going to kill him anyway!', 14, 0, 100, 0, 0, 10269, 15582, 0, 0, 0, 'nethekurse PEON_DIE_3');
INSERT INTO `creature_text` VALUES (16807, 2, 3, 'Thank you for saving me the trouble! Now it\'s my turn to have some fun...', 14, 0, 100, 0, 0, 10270, 15589, 0, 0, 0, 'nethekurse PEON_DIE_4');
INSERT INTO `creature_text` VALUES (16807, 3, 0, 'Beg for your pittyfull life!', 14, 0, 100, 0, 0, 10259, 94006, 0, 0, 0, 'nethekurse SAY_TAUNT_1');
INSERT INTO `creature_text` VALUES (16807, 3, 1, 'Run covad, ruun!', 14, 0, 100, 0, 0, 10260, 14132, 0, 0, 0, 'nethekurse SAY_TAUNT_2');
INSERT INTO `creature_text` VALUES (16807, 3, 2, 'Your pain amuses me.', 14, 0, 100, 0, 0, 10261, 14148, 0, 0, 0, 'nethekurse SAY_TAUNT_3');
INSERT INTO `creature_text` VALUES (16807, 4, 0, 'I\'m already bored.', 14, 0, 100, 0, 0, 10271, 16864, 0, 0, 0, 'nethekurse SAY_AGGRO_1');
INSERT INTO `creature_text` VALUES (16807, 4, 1, 'Come on! ... Show me a real fight.', 14, 0, 100, 0, 0, 10272, 15595, 0, 0, 0, 'nethekurse SAY_AGGRO_2');
INSERT INTO `creature_text` VALUES (16807, 4, 2, 'I had more fun torturing the peons.', 14, 0, 100, 0, 0, 10273, 16863, 0, 0, 0, 'nethekurse SAY_AGGRO_3');
INSERT INTO `creature_text` VALUES (16807, 5, 0, 'You Loose.', 14, 0, 100, 0, 0, 10274, 16865, 0, 0, 0, 'nethekurse SAY_SLAY_1');
INSERT INTO `creature_text` VALUES (16807, 5, 1, 'Ohh! Just die.', 14, 0, 100, 0, 0, 10275, 49571, 0, 0, 0, 'nethekurse SAY_SLAY_2');
INSERT INTO `creature_text` VALUES (16807, 6, 0, 'What a ... a shame.', 14, 0, 100, 0, 0, 10276, 119133, 0, 0, 0, 'nethekurse SAY_DIE');
INSERT INTO `creature_text` VALUES (16808, 0, 0, 'Ours is the true Horde! The only Horde!', 14, 0, 100, 0, 0, 10323, 17614, 0, 0, 0, 'kargath SAY_AGGRO1');
INSERT INTO `creature_text` VALUES (16808, 0, 1, 'I\'ll carve the meat from your bones!', 14, 0, 100, 0, 0, 10324, 17616, 0, 0, 0, 'kargath SAY_AGGRO2');
INSERT INTO `creature_text` VALUES (16808, 0, 2, 'I am called Bladefist for a reason, as you will see!', 14, 0, 100, 0, 0, 10325, 17617, 0, 0, 0, 'kargath SAY_AGGRO3');
INSERT INTO `creature_text` VALUES (16808, 1, 0, 'For the real Horde!', 14, 0, 100, 0, 0, 10326, 17619, 0, 0, 0, 'kargath SAY_SLAY1');
INSERT INTO `creature_text` VALUES (16808, 1, 1, 'I am the only Warchief!', 14, 0, 100, 0, 0, 10327, 17620, 0, 0, 0, 'kargath SAY_SLAY2');
INSERT INTO `creature_text` VALUES (16808, 2, 0, 'The true Horde... will.. prevail...', 14, 0, 100, 0, 0, 10328, 17621, 0, 0, 0, 'kargath SAY_DEATH');
INSERT INTO `creature_text` VALUES (16809, 0, 0, 'This all...your fault!', 14, 0, 100, 0, 0, 10311, 0, 0, 0, 0, 'omrogg YELL_DIE_L');
INSERT INTO `creature_text` VALUES (16809, 1, 0, 'I...hate...you...', 14, 0, 100, 0, 0, 10322, 0, 0, 0, 0, 'omrogg YELL_DIE_R');
INSERT INTO `creature_text` VALUES (16809, 2, 0, '%s enrages', 16, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'omrogg EMOTE_ENRAGE');
INSERT INTO `creature_text` VALUES (16812, 0, 0, 'Welcome Ladies and Gentlemen, to this evening\'s presentation!', 14, 0, 100, 0, 0, 9174, 14118, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16812, 1, 0, 'Tonight we plumb the depths of the human soul as we join a lost, lonely girl trying desperately -- with the help of her loyal companions -- to find her way home!', 14, 0, 100, 0, 0, 9338, 15362, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16812, 2, 0, 'But she is pursued... by a wicked malevolent crone!', 14, 0, 100, 0, 0, 9339, 15363, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16812, 3, 0, 'Will she survive? Will she prevail? Only time will tell. And now ... on with the show!', 14, 0, 100, 0, 0, 9340, 15364, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16812, 4, 0, 'Good evening, Ladies and Gentlemen! Welcome to this evening\'s presentation!', 14, 0, 100, 0, 0, 9175, 14057, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16812, 5, 0, 'Tonight, things are not what they seem. For tonight, your eyes may not be trusted', 14, 0, 100, 0, 0, 9335, 15359, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16812, 6, 0, 'Take for instance, this quiet, elderly woman, waiting for a visit from her granddaughter. Surely there is nothing to fear from this sweet, grey-haired, old lady.', 14, 0, 100, 0, 0, 9336, 15360, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16812, 7, 0, 'But don\'t let me pull the wool over your eyes. See for yourself what lies beneath those covers! And now... on with the show!', 14, 0, 100, 0, 0, 9337, 15361, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16812, 8, 0, 'Welcome, Ladies and Gentlemen, to this evening\'s presentation!', 14, 0, 100, 0, 0, 9176, 14118, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16812, 9, 0, 'Tonight, we explore a tale of forbidden love!', 14, 0, 100, 0, 0, 9341, 15365, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16812, 10, 0, 'But beware, for not all love stories end happily, as you may find out. Sometimes, love pricks like a thorn.', 14, 0, 100, 0, 0, 9342, 15366, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16812, 11, 0, 'But don\'t take it from me, see for yourself what tragedy lies ahead when the paths of star-crossed lovers meet. And now...on with the show!', 14, 0, 100, 0, 0, 9343, 15367, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16819, 0, 0, 'Welcome to Honor Hold, $n.  It\'s good to have you.', 12, 0, 100, 66, 0, 0, 17514, 0, 0, 0, 'Force Commander Danath Trollbane to Player');
INSERT INTO `creature_text` VALUES (16819, 1, 0, ' hame golvel t waldir vr waldir Meth danav cynew falhe Danav   aelge   azi    t vr  r ruft  Falhe Nevren ', 14, 7, 100, 0, 0, 0, 0, 0, 0, 0, 'Командир армии Данат Троллебой to Player');
INSERT INTO `creature_text` VALUES (16819, 2, 0, 'Ruft  o t lith ud  danav  Cynew      ', 14, 7, 100, 0, 0, 0, 0, 0, 0, 0, 'Командир армии Данат Троллебой to Player');
INSERT INTO `creature_text` VALUES (16821, 3, 0, 'Don\'t you start with me, Sid! Have it sent to my quarters in the tower instead! Your inn has become a zoo!', 12, 7, 100, 5, 0, 0, 12768, 12890, 12890, 0, 'Magus Filinthus to Magus Filinthus');
INSERT INTO `creature_text` VALUES (16821, 3, 0, 'I take my leave now, Commander. Good day!', 12, 7, 100, 1, 0, 0, 12763, 73718, 73718, 0, 'Magus Filinthus');
INSERT INTO `creature_text` VALUES (16821, 3, 0, 'Sid! Ale, NOW!', 12, 7, 100, 22, 0, 0, 12765, 49094, 49094, 0, 'Magus Filinthus');
INSERT INTO `creature_text` VALUES (16821, 3, 0, 'To trust an orc? Even if it is the progeny of Durotan himself! This is madness!', 12, 7, 100, 5, 0, 0, 12761, 335031, 335031, 0, 'Magus Filinthus');
INSERT INTO `creature_text` VALUES (16821, 3, 0, 'Не зли меня, Сид! Отправь вино в мои апартаменты в башне! Это не таверна, а вольер с мартышками!', 12, 7, 100, 5, 0, 1015, 12768, 55000, 55000, 0, 'Волхв Филинтус to Волхв Филинтус');
INSERT INTO `creature_text` VALUES (16821, 3, 0, 'Сид! Эля, быстро!', 12, 7, 100, 22, 0, 0, 12765, 49000, 49000, 0, 'Волхв Филинтус');
INSERT INTO `creature_text` VALUES (16821, 3, 0, 'Что за дурацкая манера – открывать именно то, что мы должны закрыть?', 12, 7, 100, 5, 0, 0, 12757, 264000, 264000, 0, 'Волхв Филинтус');
INSERT INTO `creature_text` VALUES (16822, 0, 0, 'Guards!', 14, 7, 100, 0, 0, 0, 4583, 0, 0, 0, 'Flightmaster Krill Bitterhue');
INSERT INTO `creature_text` VALUES (16826, 0, 0, 'Comin\' right up, yer highness! Is there anythin\' else you\'ll be needin\'? Perhaps yer hat cleaned or yer nails trimmed?', 12, 7, 100, 22, 0, 0, 12766, 0, 0, 0, 'Sid Limbardi to Magus Filinthus');
INSERT INTO `creature_text` VALUES (16826, 1, 0, 'Bless yer heart, soldier! Just put \'em in the back room.', 12, 7, 100, 1, 0, 0, 12801, 0, 0, 0, 'Sid Limbardi to Stormwind Infantry');
INSERT INTO `creature_text` VALUES (16833, 3, 0, 'No!  Not... Sedai!  The orcs must pay!', 12, 0, 100, 0, 0, 0, 13997, 131516, 131516, 0, 'Makuru to Player');
INSERT INTO `creature_text` VALUES (16833, 3, 0, 'The orcs hate us, Obadei!  They\'ve killed many of us before!  They deserve death and worse.', 12, 0, 100, 0, 0, 0, 13996, 1967500, 1967500, 0, 'Makuru to Player');
INSERT INTO `creature_text` VALUES (16833, 3, 0, 'Нет! Не... Седаи! Орки должны заплатить!', 12, 0, 100, 0, 0, 0, 13997, 9000, 9000, 0, 'Макуру to Player');
INSERT INTO `creature_text` VALUES (16833, 3, 0, 'Орки ненавидят нас, Обадий! Они уже убили многих из нас. Они заслуживают смерти и даже худшей участи, нежели просто смерть.', 12, 0, 100, 0, 0, 0, 13996, 82000, 82000, 0, 'Макуру to Player');
INSERT INTO `creature_text` VALUES (16834, 3, 0, 'I understand how you feel Makuru.  Sedai was my brother after all.  Yet we can\'t disgrace his memory by going against his very ideals.', 12, 0, 100, 0, 0, 0, 13992, 1967094, 1967094, 0, 'Anchorite Obadei to Player');
INSERT INTO `creature_text` VALUES (16834, 3, 0, 'What have you done, Makuru?!  These are not our ways!', 12, 0, 100, 0, 0, 0, 13991, 1956578, 1956578, 0, 'Anchorite Obadei to Player');
INSERT INTO `creature_text` VALUES (16834, 3, 0, 'Что ты наделал, Макуру?! Это не наши методы действия!', 12, 0, 100, 0, 0, 0, 13991, 72000, 72000, 0, 'Анахорет Обадий to Player');
INSERT INTO `creature_text` VALUES (16834, 3, 0, 'Я знаю, что ты чувствуешь, Макуру. Седаи, в конце концов, был моим братом. Но мы не можем осквернить его память, предав его идеалы.', 12, 0, 100, 0, 0, 0, 13992, 82000, 82000, 0, 'Анахорет Обадий to Player');
INSERT INTO `creature_text` VALUES (16836, 3, 0, 'I ... I want to hear about the Light. It seems ... I think I remember something ...', 12, 0, 100, 0, 0, 0, 14005, 37000, 37000, 0, 'Беглец из племени Отребья to Player');
INSERT INTO `creature_text` VALUES (16842, 3, 0, 'Do ya want me to call a medic? Maybe a priest? It\'s been over an hour, mate!', 12, 7, 100, 5, 0, 0, 12746, 7098032, 12731563, 0, 'Honor Hold Defender');
INSERT INTO `creature_text` VALUES (16842, 3, 0, 'What\'s goin\' on in there?? For the love of the LIGHT, hurry it up!', 12, 7, 100, 5, 0, 0, 12745, 7413625, 7413625, 0, 'Honor Hold Defender');
INSERT INTO `creature_text` VALUES (16842, 3, 0, 'Что там происходит? Ради Света, выходи быстрее!', 12, 7, 100, 5, 0, 0, 12745, 148000, 148000, 0, 'Защитник Оплота Чести');
INSERT INTO `creature_text` VALUES (16842, 3, 0, 'ЭЙ! У меня неотложное дело для Оплота Чести, а ты меня задерживаешь!', 12, 7, 100, 5, 0, 0, 12747, 274000, 274000, 0, 'Защитник Оплота Чести');
INSERT INTO `creature_text` VALUES (16863, 0, 0, '%s goes into a frenzy!', 16, 0, 100, 0, 0, 0, 38630, 0, 0, 0, 'Deranged Helboar to 0');
INSERT INTO `creature_text` VALUES (16863, 18, 0, '%s is furious!', 16, 0, 100, 0, 0, 0, 38630, 0, 0, 0, 'Безумный зловепрь to 0');
INSERT INTO `creature_text` VALUES (16864, 3, 0, '%s nods.', 16, 7, 100, 273, 0, 0, 144899, 12617000, 12617000, 0, 'Stormwind Infantry to Stormwind Infantry');
INSERT INTO `creature_text` VALUES (16864, 3, 0, 'Where do you want these bottles?', 12, 7, 100, 1, 0, 0, 12798, 12607063, 12607063, 0, 'Stormwind Infantry');
INSERT INTO `creature_text` VALUES (16864, 3, 0, 'А знаешь, что самое потрясное? Сколько бы бутылок я ни брал из запаса, меньше их не становится. Такое впечатление, будто я увяз в каком-то бесконечном круговороте действий...', 12, 7, 100, 1, 0, 0, 12800, 150000, 150000, 0, 'Штормградский пехотинец');
INSERT INTO `creature_text` VALUES (16867, 4, 0, '%s attempts to run away in fear!', 16, 0, 100, 0, 0, 0, 1150, 4578, 4578, 0, 'Shattered Hand Grunt');
INSERT INTO `creature_text` VALUES (16867, 4, 0, '%s is trying to escape in a panic!', 16, 0, 100, 0, 0, 0, 1150, 25000, 25000, 0, 'Рубака клана Изувеченной Длани');
INSERT INTO `creature_text` VALUES (16871, 4, 0, '%s goes into a frenzy!', 16, 0, 100, 0, 0, 0, 38630, 4531, 4531, 8599, 'Bleeding Hollow Grunt');
INSERT INTO `creature_text` VALUES (16871, 4, 0, '%s is furious!', 16, 0, 100, 0, 0, 0, 38630, 10000, 10000, 8599, 'Рубака из клана Кровавой Глазницы');
INSERT INTO `creature_text` VALUES (16873, 4, 0, '%s attempts to run away in fear!', 16, 0, 100, 0, 0, 0, 1150, 2172, 2172, 0, 'Bleeding Hollow Dark Shaman');
INSERT INTO `creature_text` VALUES (16873, 4, 0, '%s is trying to escape in a panic!', 16, 0, 100, 0, 0, 0, 1150, 7000, 7000, 0, 'Темный шаман из клана Кровавой Глазницы');
INSERT INTO `creature_text` VALUES (16876, 2, 0, '%s becomes unstable and begins to disintegrate!', 16, 0, 100, 0, 0, 0, 17338, 0, 0, 34114, 'Bonechewer Mutant');
INSERT INTO `creature_text` VALUES (16876, 4, 0, '%s goes into a frenzy!', 16, 0, 100, 0, 0, 0, 38630, 2203, 2203, 34114, 'Bonechewer Mutant');
INSERT INTO `creature_text` VALUES (16876, 4, 0, '%s is furious!', 16, 0, 100, 0, 0, 0, 38630, 6000, 6000, 8599, 'Мутант из клана Костеглодов');
INSERT INTO `creature_text` VALUES (16876, 4, 0, '%s теряет устойчивость и начинает распадаться на части!', 16, 0, 100, 0, 0, 0, 17338, 10000, 10000, 34114, 'Мутант из клана Костеглодов');
INSERT INTO `creature_text` VALUES (16878, 0, 0, '%s becomes enraged!', 16, 0, 100, 0, 0, 0, 24144, 0, 0, 0, 'Shattered Hand Berserker');
INSERT INTO `creature_text` VALUES (16880, 0, 0, '%s begins to grow stronger.', 16, 0, 100, 0, 0, 0, 16646, 0, 0, 0, 'Hulking Helboar to 0');
INSERT INTO `creature_text` VALUES (16880, 6, 0, '%s становится сильнее.', 16, 0, 100, 0, 0, 0, 16646, 0, 0, 0, 'Крупный зловепрь to 0');
INSERT INTO `creature_text` VALUES (16901, 0, 0, 'The surface of the %s begins to bubble.', 16, 0, 100, 0, 0, 0, 16647, 0, 0, 0, 'Blistering Rot to 0');
INSERT INTO `creature_text` VALUES (16906, 0, 0, '%s calls for help!', 16, 0, 100, 0, 0, 0, 2541, 0, 0, 0, 'Unyielding Knight to 0');
INSERT INTO `creature_text` VALUES (16906, 6, 0, '%s is calling for help!', 16, 0, 100, 0, 0, 0, 81221, 0, 0, 0, 'Непреклонный рыцарь to 0');
INSERT INTO `creature_text` VALUES (16907, 1, 0, 'Смерть незваным гостям!', 12, 0, 100, 0, 0, 0, 86445, 0, 0, 0, 'Батрак из клана Кровавой Глазницы to Player');
INSERT INTO `creature_text` VALUES (16907, 3, 0, 'Защитим Вождя любой ценой!', 12, 0, 100, 0, 0, 0, 12836, 77000, 77000, 0, 'Батрак из клана Кровавой Глазницы to Player');
INSERT INTO `creature_text` VALUES (16907, 4, 0, '%s attempts to run away in fear!', 16, 0, 100, 0, 0, 0, 1150, 4953, 4953, 0, 'Bleeding Hollow Peon');
INSERT INTO `creature_text` VALUES (16907, 4, 0, '%s is trying to escape in a panic!', 16, 0, 100, 0, 0, 0, 1150, 5000, 5000, 0, 'Батрак из клана Кровавой Глазницы');
INSERT INTO `creature_text` VALUES (16911, 0, 0, '%s is trying to escape in a panic!', 16, 0, 100, 0, 0, 0, 1150, 0, 0, 0, 'Маг\'харский дозорный to 0');
INSERT INTO `creature_text` VALUES (16912, 4, 0, '%s is trying to escape in a panic!', 16, 0, 100, 0, 0, 0, 1150, 2000, 2000, 0, 'Маг\'харский охотник');
INSERT INTO `creature_text` VALUES (16927, 4, 0, '%s attempts to run away in fear!', 16, 0, 100, 0, 0, 0, 1150, 9469, 9469, 0, 'Stonescythe Whelp');
INSERT INTO `creature_text` VALUES (16927, 4, 0, '%s defends himself in desperation.', 16, 0, 100, 0, 0, 0, 16744, 1329, 1329, 33896, 'Stonescythe Whelp');
INSERT INTO `creature_text` VALUES (16927, 4, 0, '%s is trying to escape in a panic!', 16, 0, 100, 0, 0, 0, 1150, 18000, 18000, 0, 'Детеныш камнеруба');
INSERT INTO `creature_text` VALUES (16927, 4, 0, '%s отчаянно защищается.', 16, 0, 100, 0, 0, 0, 16744, 9000, 9000, 33896, 'Детеныш камнеруба');
INSERT INTO `creature_text` VALUES (16929, 0, 0, '%s defends himself in desperation.', 16, 0, 100, 0, 0, 0, 16744, 0, 0, 0, 'Stonescythe Alpha to 0');
INSERT INTO `creature_text` VALUES (16929, 1, 0, '%s отчаянно защищается.', 16, 0, 100, 0, 0, 0, 16744, 0, 0, 0, 'Камнеруб-вожак to 0');
INSERT INTO `creature_text` VALUES (16932, 0, 0, '%s attempts to flee to a nearby ravager.', 16, 0, 100, 0, 0, 0, 16843, 0, 0, 0, 'Razorfang Hatchling to 0');
INSERT INTO `creature_text` VALUES (16932, 6, 0, '%s пытается убежать к взрослому опустошителю-острозубу...', 16, 0, 100, 0, 0, 0, 16843, 0, 0, 0, 'Детеныш остроклыка to 0');
INSERT INTO `creature_text` VALUES (16938, 0, 0, 'This is our chance!  Run for it!', 12, 0, 100, 0, 0, 0, 13374, 0, 0, 0, 'Fleeing Dreghood Warrior to Illidari Taskmaster');
INSERT INTO `creature_text` VALUES (16938, 1, 0, 'Put me out of this misery!', 12, 0, 100, 0, 0, 0, 16471, 0, 0, 0, 'Dreghood Brute to Illidari Taskmaster');
INSERT INTO `creature_text` VALUES (16938, 2, 0, 'Flee!  Flee!', 12, 0, 100, 0, 0, 0, 13373, 0, 0, 0, 'Fleeing Dreghood Warrior to Illidari Taskmaster');
INSERT INTO `creature_text` VALUES (16938, 3, 0, 'I will do as you ask, demon.  At least for now.', 12, 0, 100, 0, 0, 0, 16470, 0, 0, 0, 'Dreghood Brute to Illidari Taskmaster');
INSERT INTO `creature_text` VALUES (16938, 5, 0, 'Это наш шанс! Его нельзя упустить!', 12, 0, 100, 0, 0, 0, 13374, 0, 0, 0, 'Отступающий воин из племени Отребья to Иллидарский надсмотрщик');
INSERT INTO `creature_text` VALUES (16938, 6, 0, 'Беги! Беги!', 12, 0, 100, 0, 0, 0, 57179, 0, 0, 0, 'Отступающий воин из племени Отребья to Иллидарский надсмотрщик');
INSERT INTO `creature_text` VALUES (16964, 4, 0, '%s goes into a frenzy!', 16, 0, 100, 0, 0, 0, 38630, 4578, 4578, 8599, 'Warlord Morkh');
INSERT INTO `creature_text` VALUES (16971, 0, 0, 'Ughhh... I hurt.  Can you help me?', 12, 35, 100, 0, 0, 0, 13411, 0, 0, 0, 'Injured Draenei to Injured Draenei');
INSERT INTO `creature_text` VALUES (16971, 1, 0, 'Oh, the pain...', 12, 35, 100, 0, 0, 0, 100649, 0, 0, 0, 'Injured Draenei to Injured Draenei');
INSERT INTO `creature_text` VALUES (16971, 3, 0, 'I don\'t know if I can make it. Please help me...', 12, 35, 100, 0, 0, 0, 13442, 0, 0, 0, 'Injured Draenei to Injured Draenei');
INSERT INTO `creature_text` VALUES (16972, 0, 0, '%s чует свежий труп неподалеку.', 16, 0, 100, 0, 0, 0, 16746, 0, 0, 0, 'Канюк-костеклювач to Канюк-костеклювач');
INSERT INTO `creature_text` VALUES (16980, 0, 0, 'Скоро мы изничтожим Альянс и Орду. Вслед за этим Азерот падет перед мощью моей армии.', 14, 0, 100, 0, 0, 14768, 12988, 0, 0, 0, 'Король-лич to Зеркальное изображение');
INSERT INTO `creature_text` VALUES (16980, 1, 0, 'Чужаки... здесь? УНИЧТОЖЬ ИХ, Кел\'Тузад! Наксрамас должен выстоять!', 14, 0, 100, 0, 0, 14769, 12989, 0, 0, 0, 'Король-лич to Зеркальное изображение');
INSERT INTO `creature_text` VALUES (16980, 2, 0, 'Хорошо. Воины ледяных пустошей, восстаньте! Повелеваю вам сражаться, убивать и умирать во имя своего повелителя! Не щадить никого!', 14, 0, 100, 0, 0, 14770, 12994, 0, 0, 0, 'Король-лич to Кел\'Тузад');
INSERT INTO `creature_text` VALUES (16993, 0, 0, 'Thank you for agreeing to help. Now, let\'s get out of here $N.', 12, 1, 0, 0, 0, 0, 13289, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16993, 1, 0, 'Over there! They\'re following us!', 12, 1, 0, 0, 0, 0, 13255, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16993, 2, 0, 'Allow me a moment to rest. The journey taxes what little strength I have.', 12, 1, 0, 16, 0, 0, 13290, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16993, 3, 0, 'Did you hear something?', 12, 1, 0, 0, 0, 0, 4207, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16993, 4, 0, 'Falcon Watch, at last! Now, where\'s my... Oh no! My pack, it\'s missing! Where has -', 12, 1, 0, 0, 0, 0, 13292, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (16993, 5, 0, 'You won\'t keep me from getting to Falcon Watch!', 14, 1, 0, 0, 0, 0, 13659, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (17000, 3, 0, 'Fools!  You seek to abjure my father\'s presence?  Death awaits you, mortals!', 12, 0, 100, 0, 0, 0, 13157, 3766, 3766, 0, 'Aggonis to Player');
INSERT INTO `creature_text` VALUES (17000, 3, 0, 'Глупцы! Вы отрицаете существование моего отца? Умрите, смертные!', 12, 0, 100, 0, 0, 0, 13157, 4000, 4000, 0, 'Аггонис to Player');
INSERT INTO `creature_text` VALUES (17014, 4, 0, '%s начинает оседать на землю!', 16, 0, 100, 0, 0, 0, 16968, 5000, 5000, 0, 'Слабеющий демон Бездны');
INSERT INTO `creature_text` VALUES (17023, 1, 0, 'Гул\'дан говорит правду! Нам следует немедленно вернуться и сообщить нашим братьям эти вести! Возвращаемся через портал!', 14, 0, 100, 0, 0, 0, 19911, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (17058, 0, 0, 'Faster, scum!  The Master won\'t be pleased if we don\'t find the Ata\'mal crystal he\'s after.', 12, 0, 100, 0, 0, 0, 16421, 0, 0, 0, 'Illidari Taskmaster to 0');
INSERT INTO `creature_text` VALUES (17058, 1, 0, 'Do not even think of fleeing, Broken wretches!  I promise you a fate worse than death if you don\'t slay these intruders!', 12, 0, 100, 0, 0, 0, 16441, 0, 0, 0, 'Illidari Taskmaster to Player');
INSERT INTO `creature_text` VALUES (17058, 2, 0, 'Go, you little wretches!  Show these fools that our Master is not to be trifled with!', 12, 0, 100, 0, 0, 0, 16440, 0, 0, 0, 'Illidari Taskmaster to Player');
INSERT INTO `creature_text` VALUES (17058, 3, 0, 'Быстрее, мразь! Хозяин не обрадуется, если мы не найдем кристалл Ата\'мала, который ему нужен.', 12, 0, 100, 0, 0, 0, 16421, 0, 0, 0, 'Иллидарский надсмотрщик to 0');
INSERT INTO `creature_text` VALUES (17058, 4, 0, 'Смеешь вмешиваться в дела господина? Ты заплатишь, $gглупый смертный:глупая смертная;!', 12, 0, 100, 0, 0, 0, 16438, 0, 0, 0, 'Иллидарский надсмотрщик to Player');
INSERT INTO `creature_text` VALUES (17058, 5, 0, 'Вперед, мелкие проходимцы! Покажите этим болванам, что с нашим господином шутки плохи!', 12, 0, 100, 0, 0, 0, 16440, 0, 0, 0, 'Иллидарский надсмотрщик to Player');
INSERT INTO `creature_text` VALUES (17071, 0, 0, 'This is great news!  Your efforts have indeed saved us, $N!', 12, 0, 100, 0, 0, 0, 12846, 0, 0, 0, 'Technician Zhanaa');
INSERT INTO `creature_text` VALUES (17076, 3, 0, 'Thank you for allowing me to speak, A\'dal. I know many of your allies despise me and my knights for our treatment of M\'uru.', 12, 0, 100, 1, 0, 147, 24464, 64547, 64547, 0, 'Lady Liadrin to A\'dal');
INSERT INTO `creature_text` VALUES (17077, 0, 0, '%s lifts its head into the air, as if listening for something.', 41, 0, 100, 0, 0, 0, 13430, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (17077, 1, 0, '%s lets out a howl that rings across the mountains to the north and motions for you to follow.', 41, 0, 100, 0, 0, 0, 13446, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (17083, 0, 0, 'Лок\'тар иллидари!', 12, 0, 100, 0, 0, 0, 16701, 0, 0, 0, 'Новообращенный орк Скверны to Player');
INSERT INTO `creature_text` VALUES (17083, 1, 0, 'Гори, кожа, ясно!', 14, 0, 100, 15, 0, 1343, 14139, 0, 0, 0, 'Новообращенный орк Скверны to Главный чернокнижник Пустоклят');
INSERT INTO `creature_text` VALUES (17085, 0, 0, 'Avruu\'s magic... it still controls me. You must fight me, mortal. It\'s the only way to break the spell!', 14, 0, 100, 0, 0, 0, 13448, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (17085, 1, 0, 'Avruu\'s magic is broken! I\'m free once again!', 14, 0, 100, 0, 0, 0, 13447, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (17109, 3, 0, 'Ну и глупые же эти орки! У них под носом такая сила, а они просиживают штаны, пока другие расхищают их богатства!', 12, 0, 100, 0, 0, 0, 14095, 38, 38, 0, 'Серсея Певица Заката');
INSERT INTO `creature_text` VALUES (17117, 3, 0, '%s falls back into a coma.', 16, 0, 100, 0, 0, 0, 13605, 2214360, 2214360, 0, 'Injured Night Elf Priestess to Player');
INSERT INTO `creature_text` VALUES (17117, 3, 0, '%s groans.', 16, 7, 100, 0, 0, 0, 31847, 2199906, 2199906, 0, 'Injured Night Elf Priestess to Player');
INSERT INTO `creature_text` VALUES (17117, 3, 0, '%s sits up.', 16, 7, 100, 0, 0, 0, 13602, 2202188, 2202188, 0, 'Injured Night Elf Priestess to Player');
INSERT INTO `creature_text` VALUES (17117, 3, 0, 'BY THE LIGHT OF ELUNE! Eredar! Cursed demons, what have you done to me? I have not come alone, we will fight you as we have in the past! I...', 12, 7, 100, 5, 0, 0, 13604, 2208313, 2208313, 0, 'Injured Night Elf Priestess to Player');
INSERT INTO `creature_text` VALUES (17117, 3, 0, 'Whe... Where am I? What... What is this place?', 12, 7, 100, 6, 0, 0, 13603, 2203406, 2203406, 0, 'Injured Night Elf Priestess to Player');
INSERT INTO `creature_text` VALUES (17119, 0, 0, 'I think I can make it to Brackenwall on my own. They\'ve got the cargo at the top of the tower. Be careful!', 12, 0, 0, 0, 0, 0, 13500, 0, 0, 0, 'Ithania - Escape');
INSERT INTO `creature_text` VALUES (17123, 0, 0, 'Welcome, kind spirit. What has brought you to us?', 12, 0, 100, 0, 0, 0, 13512, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (17127, 0, 0, 'Prophet Velen', 12, 0, 100, 1, 0, 0, 0, 0, 0, 0, 'Smart Text');
INSERT INTO `creature_text` VALUES (17127, 1, 0, '... Thank you , a prophet. You reassured nas. I continue its work in the name of the memory Magtur.', 12, 0, 100, 1, 0, 0, 0, 0, 0, 0, 'Smart Text');
INSERT INTO `creature_text` VALUES (17189, 3, 0, 'The sound of footsteps shuffling echo throughout the cave.', 16, 0, 100, 0, 0, 0, 14019, 78, 78, 0, 'Crazed Wildkin to Player');
INSERT INTO `creature_text` VALUES (17214, 3, 0, 'It appears that the ointment is ineffective. Such a pity...', 12, 7, 100, 1, 0, 0, 13597, 884813, 884813, 0, 'Anchorite Fateema to Player');
INSERT INTO `creature_text` VALUES (17214, 3, 0, 'Man\'ari... But how... We are not eredar! She must know! If there are others like her, we must find them and explain...', 12, 7, 100, 1, 0, 0, 13608, 2215594, 2215594, 0, 'Anchorite Fateema to Player');
INSERT INTO `creature_text` VALUES (17214, 3, 0, 'Now to apply the ointment to her wounds.', 12, 7, 100, 1, 0, 0, 13596, 872641, 872641, 0, 'Anchorite Fateema to Player');
INSERT INTO `creature_text` VALUES (17215, 3, 0, 'There may still be a solution. Come here, $n. I will explain what I need.', 12, 7, 100, 1, 0, 0, 13598, 888453, 888453, 0, 'Daedal to Player');
INSERT INTO `creature_text` VALUES (17215, 3, 0, 'This should do it...', 12, 7, 100, 0, 0, 0, 13599, 2191281, 2191281, 0, 'Daedal to Player');
INSERT INTO `creature_text` VALUES (17215, 3, 0, 'Wake up little creature. Wake up from your slumber... You are safe now.', 12, 7, 100, 0, 0, 0, 13600, 2197328, 2197328, 0, 'Daedal to Player');
INSERT INTO `creature_text` VALUES (17222, 3, 0, 'Hrm, this looks much better. Let\'s have a look on the inside.', 12, 7, 100, 1, 0, 0, 13575, 326860, 326860, 0, 'Artificer Daelo');
INSERT INTO `creature_text` VALUES (17222, 3, 0, 'I won\'t be held responsible for the catastrophe that will surely result from the haphazard maintenance of this building.\n', 12, 7, 100, 1, 0, 0, 13574, 911141, 911141, 0, 'Artificer Daelo');
INSERT INTO `creature_text` VALUES (17222, 3, 0, 'This structure violates at least 8 different ordinances!', 12, 7, 100, 5, 0, 0, 13573, 907500, 907500, 0, 'Artificer Daelo');
INSERT INTO `creature_text` VALUES (17222, 3, 0, 'This won\'t do at all! We have to secure the foundation or the entire structure will crumble!', 12, 7, 100, 1, 0, 0, 13572, 889266, 889266, 0, 'Artificer Daelo');
INSERT INTO `creature_text` VALUES (17226, 0, 0, 'Ok, let\'s go. I know just the perfect spot!', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Viera Sunwhisper');
INSERT INTO `creature_text` VALUES (17226, 1, 0, 'I can\'t wait to try this wine!', 12, 0, 100, 0, 0, 0, 13590, 0, 0, 0, 'Viera Sunwhisper');
INSERT INTO `creature_text` VALUES (17226, 2, 0, 'What... is happening... to me? Get this cat away from me!', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Viera Sunwhisper');
INSERT INTO `creature_text` VALUES (17226, 3, 0, '%s scurries away, attempting to flee from Twinkle', 16, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Viera Sunwhisper');
INSERT INTO `creature_text` VALUES (17230, 0, 0, '%s looks at Viera Sunwhisper with very hungry eyes', 16, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Twinkle');
INSERT INTO `creature_text` VALUES (17240, 0, 0, 'Hey, Cookie! What\'s for dinner tonight? And don\'t say chicken!', 12, 7, 100, 22, 0, 0, 13698, 0, 0, 0, 'Admiral Odesyus to 0');
INSERT INTO `creature_text` VALUES (17240, 1, 0, 'Wow! Really?', 12, 7, 100, 5, 0, 0, 13702, 0, 0, 0, 'Admiral Odesyus to Admiral Odesyus');
INSERT INTO `creature_text` VALUES (17240, 2, 0, 'I hate you so much, Cookie.', 12, 7, 100, 1, 0, 0, 13705, 0, 0, 0, 'Admiral Odesyus to Admiral Odesyus');
INSERT INTO `creature_text` VALUES (17241, 3, 0, 'Adamant, could you please take a look at this tablet and try to decipher the runes?', 12, 7, 100, 1, 0, 0, 13711, 443031, 1658765, 0, 'Priestess Kyleen Il\'dinare to Player');
INSERT INTO `creature_text` VALUES (17241, 3, 0, 'Thank you, Adamant. I think I know just the person for the job.', 12, 7, 100, 2, 0, 0, 13719, 1708515, 1708515, 0, 'Priestess Kyleen Il\'dinare to Player');
INSERT INTO `creature_text` VALUES (17242, 3, 0, '%s slowly reads the tablet, mouthing the words in their native tongue.', 16, 7, 100, 0, 0, 0, 13714, 461265, 1679406, 0, 'Archaeologist Adamant Ironheart to Player');
INSERT INTO `creature_text` VALUES (17242, 3, 0, 'Alright, let me take a look at that tablet.', 12, 7, 100, 1, 0, 0, 13713, 458437, 1676593, 0, 'Archaeologist Adamant Ironheart to Player');
INSERT INTO `creature_text` VALUES (17242, 3, 0, 'And it looks like he\'s got reinforcements comin\' from Nazjatar!', 12, 7, 100, 5, 0, 0, 13717, 1698828, 1698828, 0, 'Archaeologist Adamant Ironheart to Player');
INSERT INTO `creature_text` VALUES (17242, 3, 0, 'Naga warlord! Oh dear...', 12, 7, 100, 5, 0, 0, 13715, 468562, 1683046, 0, 'Archaeologist Adamant Ironheart to Player');
INSERT INTO `creature_text` VALUES (17242, 3, 0, 'Of course! Anything for you, darling!', 12, 7, 100, 5, 0, 0, 13712, 450328, 1668468, 0, 'Archaeologist Adamant Ironheart to Player');
INSERT INTO `creature_text` VALUES (17242, 3, 0, 'We\'ve got to do something about this!', 12, 0, 100, 5, 0, 0, 13718, 1702453, 1702453, 0, 'Archaeologist Adamant Ironheart to Player');
INSERT INTO `creature_text` VALUES (17242, 3, 0, 'Well, you aren\'t going to like what I have to tell you, young missy. This tablet is a naga communication. Their leader, Warlord Sriss\'tiz, has ordered his naga to take the rest of the island by force.', 12, 7, 100, 1, 0, 0, 13716, 473390, 1687921, 0, 'Archaeologist Adamant Ironheart to Player');
INSERT INTO `creature_text` VALUES (17243, 1, 0, 'What`s the big idea? You nearly blew my cover, idiot! I told you to put the compass and navigation maps somewhere safe - not out in the open for any fool to discover.', 12, 0, 100, 1, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (17243, 2, 0, 'The Master has gone to great lengths to secure information about the whereabouts of the Exodar. You could have blown the entire operation, including the cover of our spy on the inside.', 12, 0, 100, 1, 0, 0, 13778, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (17243, 3, 0, 'Relax? Do you know what Kael`thas does to those that fail him, Geezle? Eternal suffering and pain... Do NOT screw this up, fool.', 12, 0, 100, 1, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (17243, 4, 0, 'Our Bloodmyst scouts have located our contact. The fool, Velen, will soon leave himself open and defenseless - long enough for us to strike! Now get out of my sight before I vaporize you...', 12, 0, 100, 1, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (17243, 5, 0, 'Does it frighten you to know that there are those that would serve the Legion with such devotion as to remain unwavering citizens of your pointless civilizations until called upon?', 12, 0, 100, 1, 0, 0, 13787, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (17243, 6, 0, 'Live in fear, die by the will of Kael\'\'thas... It\'s all the same.', 12, 0, 100, 1, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (17243, 7, 0, 'And now, I cut you!', 12, 0, 100, 1, 0, 0, 14090, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (17246, 3, 0, 'And fer dessert we be havin\' cheesecake, flown in fresh from Stormwind on the wings o\' angels...', 12, 7, 100, 1, 0, 0, 13701, 164750, 164750, 0, '\"Cookie\" McWeaksauce to Admiral Odesyus');
INSERT INTO `creature_text` VALUES (17246, 3, 0, 'It be chicken...', 12, 7, 100, 1, 0, 0, 13704, 182953, 182953, 0, '\"Cookie\" McWeaksauce to Admiral Odesyus');
INSERT INTO `creature_text` VALUES (17246, 3, 0, 'It looks like it be succulent pork ribs basted with its own delectable juices and a side o\' Captain Sander\'s Secret Sauce - fer dippin\'.\n', 12, 7, 100, 1, 0, 0, 13700, 157484, 157484, 0, '\"Cookie\" McWeaksauce to Admiral Odesyus');
INSERT INTO `creature_text` VALUES (17246, 3, 0, 'No. Not really...', 12, 7, 100, 274, 0, 0, 13703, 177250, 177250, 0, '\"Cookie\" McWeaksauce to Admiral Odesyus');
INSERT INTO `creature_text` VALUES (17246, 3, 0, 'Yarr, Admiral. Let me think about it... Arrr... It be comin\' into focus.', 12, 7, 100, 1, 0, 0, 13699, 152218, 152218, 0, '\"Cookie\" McWeaksauce to Admiral Odesyus');
INSERT INTO `creature_text` VALUES (17257, 0, 0, 'Wretched, meddling insects. Release me and perhaps I will grant you a merciful death!', 14, 0, 100, 0, 0, 10247, 17339, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (17257, 1, 0, 'Vermin! Leeches! Take my blood and choke on it!', 14, 0, 100, 0, 0, 10248, 17340, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (17257, 2, 0, 'Illidan is an arrogant fool. I will crush him and reclaim Outland as my own.', 14, 0, 100, 0, 0, 10249, 17341, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (17257, 3, 0, 'Away, you mindless parasites. My blood is my own!', 14, 0, 100, 0, 0, 10250, 17342, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (17257, 4, 0, 'How long do you believe your pathetic sorcery can hold me?', 14, 0, 100, 0, 0, 10251, 17343, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (17257, 5, 0, 'My blood will be the end of you!', 14, 0, 100, 0, 0, 10252, 17344, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (17257, 6, 0, 'I...am...UNLEASHED!!!', 14, 0, 100, 0, 0, 10253, 17346, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (17257, 7, 0, 'Thank you for releasing me. Now...die!', 14, 0, 100, 0, 0, 10254, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (17257, 8, 0, 'Not again...NOT AGAIN!', 14, 0, 100, 0, 0, 10256, 17348, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (17257, 9, 0, 'I will not be taken so easily. Let the walls of this prison tremble...and FALL!!!', 14, 0, 100, 0, 0, 10257, 17336, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (17257, 10, 0, 'Did you think me weak? Soft? Who is the weak one now?!', 14, 0, 100, 0, 0, 10255, 17349, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (17257, 11, 0, 'The Legion...will consume you...all...', 14, 0, 100, 0, 0, 10258, 17347, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (17257, 12, 0, '%s becomes enraged!', 16, 0, 100, 0, 0, 0, 10677, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (17257, 13, 0, 'begins to cast Blast Nova!', 41, 0, 100, 0, 0, 0, 18739, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (17257, 14, 0, 'bonds begin to weaken!', 16, 0, 100, 0, 0, 0, 13689, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (17259, 1, 0, 'Гакара ма!', 12, 0, 100, 0, 0, 0, 16699, 0, 0, 0, 'Алчущий из клана Костеглодов to Player');
INSERT INTO `creature_text` VALUES (17259, 3, 0, 'For Kargath!  For Victory!', 12, 0, 100, 0, 0, 0, 16698, 19578, 19578, 0, 'Bonechewer Hungerer to Player');
INSERT INTO `creature_text` VALUES (17259, 4, 0, '%s attempts to run away in fear!', 16, 0, 100, 0, 0, 0, 1150, 15438, 15438, 0, 'Bonechewer Hungerer');
INSERT INTO `creature_text` VALUES (17259, 4, 0, '%s is trying to escape in a panic!', 16, 0, 100, 0, 0, 0, 1150, 12000, 12000, 0, 'Алчущий из клана Костеглодов');
INSERT INTO `creature_text` VALUES (17264, 1, 0, 'Lok narash!', 12, 0, 100, 0, 0, 0, 16703, 0, 0, 0, 'Bonechewer Ravener to Player');
