INSERT INTO `creature_text` VALUES (17278, 0, 0, '%s attempts to run away in fear!', 16, 0, 100, 0, 0, 0, 1150, 0, 0, 0, 'Venture Co. Saboteur to 0');
INSERT INTO `creature_text` VALUES (17281, 1, 0, 'Этот мир принадлежит НАМ!', 12, 0, 100, 0, 0, 0, 16702, 0, 0, 18501, 'Потрошитель из клана Костеглодов to Player');
INSERT INTO `creature_text` VALUES (17306, 0, 0, 'I\'m going to enjoy this...', 14, 0, 100, 0, 0, 10333, 67565, 0, 0, 0, 'Watchkeeper Gargolmar to Player');
INSERT INTO `creature_text` VALUES (17306, 1, 0, 'Heal me, quickly!', 14, 0, 100, 0, 0, 10329, 17498, 0, 0, 0, 'Watchkeeper Gargolmar to 0');
INSERT INTO `creature_text` VALUES (17306, 2, 0, 'Лечите меня! Быстро!', 14, 0, 100, 0, 0, 10329, 17498, 0, 0, 0, 'Начальник стражи Гарголмар to 0');
INSERT INTO `creature_text` VALUES (17307, 0, 0, 'You have faced many challenges.... Pity they were all in vain! Soon your people will kneel to MY lord!', 14, 0, 100, 0, 0, 10292, 13981, 0, 0, 0, 'Vazruden the Herald to Hellfire Sentry');
INSERT INTO `creature_text` VALUES (17307, 1, 0, 'Nazan descends from the sky.', 41, 0, 100, 0, 0, 10294, 20472, 0, 0, 0, 'Nazan to Vazruden');
INSERT INTO `creature_text` VALUES (17308, 0, 0, 'I will not be defeated!', 14, 0, 100, 0, 0, 10279, 87355, 0, 0, 0, 'Omor the Unscarred to Player');
INSERT INTO `creature_text` VALUES (17308, 1, 0, 'Achor she-ki!  Feast, my pet!  Eat your fill!', 14, 0, 100, 0, 0, 10277, 17637, 0, 0, 0, 'Omor the Unscarred to 0');
INSERT INTO `creature_text` VALUES (17308, 2, 0, 'It is... not over.', 14, 0, 100, 0, 0, 10284, 17630, 0, 0, 0, 'Omor the Unscarred to Player');
INSERT INTO `creature_text` VALUES (17308, 3, 0, 'Это... еще не конец.', 14, 0, 100, 0, 0, 10284, 17630, 0, 0, 0, 'Омор Неодолимый to Player');
INSERT INTO `creature_text` VALUES (17318, 1, 0, 'What`s the big idea, Spark? Why`d you call for this meeting?', 12, 0, 100, 1, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (17318, 2, 0, 'Relax, Spark! I have it all under control. We`ll strip mine the Exodar right out from under `em - making both you and I very, very rich in the process.', 12, 0, 100, 1, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (17318, 3, 0, 'Yes, sir. It won`t happen again...', 12, 0, 100, 1, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (17370, 3, 0, 'Гакара ма!', 12, 0, 100, 0, 0, 0, 16699, 42000, 42000, 0, 'Головорез из клана Веселого Черепа to Player');
INSERT INTO `creature_text` VALUES (17370, 3, 0, 'За Каргата! За победу!', 12, 0, 100, 0, 0, 0, 16698, 181000, 181000, 0, 'Головорез из клана Веселого Черепа to Player');
INSERT INTO `creature_text` VALUES (17370, 3, 0, 'Мы – истинная Орда!', 12, 0, 100, 0, 0, 0, 16697, 175000, 175000, 0, 'Головорез из клана Веселого Черепа to Player');
