INSERT INTO `creature_text` VALUES (17375, 0, 0, '%s calls for help.', 16, 0, 100, 0, 0, 0, 13976, 0, 0, 0, 'Stillpine Captive to 0');
INSERT INTO `creature_text` VALUES (17375, 1, 0, '[Furbolg] Those remaining at Stillpine Hold will welcome you as a hero!', 12, 0, 100, 0, 0, 0, 13979, 0, 0, 0, 'Stillpine Captive to Player');
INSERT INTO `creature_text` VALUES (17375, 2, 0, '[Furbolg] The Stillpine furbolgs will not soon forget your bravery!', 12, 0, 100, 0, 0, 0, 13978, 0, 0, 0, 'Stillpine Captive to Player');
INSERT INTO `creature_text` VALUES (17375, 3, 0, '[Furbolg] Thank you, $n!', 12, 0, 100, 0, 0, 0, 13837, 0, 0, 0, 'Stillpine Captive to Player');
INSERT INTO `creature_text` VALUES (17377, 0, 0, 'Who dares interrupt--What is this; what have you done? You\'ll ruin everything!', 14, 0, 100, 0, 0, 10164, 15130, 0, 0, 0, 'Keli\'dan the Breaker to Player');
INSERT INTO `creature_text` VALUES (17377, 1, 0, 'Good...luck. You\'ll need it.', 14, 0, 100, 0, 0, 10171, 17672, 0, 0, 0, 'Keli\'dan the Breaker to Player');
INSERT INTO `creature_text` VALUES (17379, 0, 0, '%s urges you to follow him.', 16, 0, 100, 0, 0, 0, 13867, 0, 0, 0, 'Stillpine Ancestor Akida');
INSERT INTO `creature_text` VALUES (17379, 1, 0, '%s points to the totem of Coo.', 16, 0, 100, 25, 0, 0, 13868, 0, 0, 0, 'Stillpine Ancestor Akida');
INSERT INTO `creature_text` VALUES (17380, 0, 0, 'Kill them!', 14, 0, 100, 0, 0, 0, 79637, 0, 0, 0, 'Broggok to Player');
INSERT INTO `creature_text` VALUES (17380, 1, 0, 'Come intruders....', 14, 0, 100, 0, 0, 0, 14259, 0, 0, 0, 'Broggok to Fel Orc Neophyte');
INSERT INTO `creature_text` VALUES (17381, 0, 0, 'Anger...hate... These are tools I can use.', 14, 0, 100, 0, 0, 10288, 17681, 0, 0, 0, 'The Maker to Player');
INSERT INTO `creature_text` VALUES (17381, 1, 0, 'Stay away from... Me!', 14, 0, 100, 0, 0, 10291, 17685, 0, 0, 0, 'The Maker to Player');
INSERT INTO `creature_text` VALUES (17391, 0, 0, '%s motions for you to follow him.', 16, 0, 100, 0, 0, 0, 13869, 0, 0, 0, 'Stillpine Ancestor Coo');
INSERT INTO `creature_text` VALUES (17391, 1, 0, '[Furbolg] Ritk kin\'chikx azul azure summit...', 12, 0, 100, 0, 0, 0, 13870, 0, 0, 0, 'Stillpine Ancestor Coo');
INSERT INTO `creature_text` VALUES (17391, 2, 0, '[Furbolg] Coo xip fly... Jump ilos river. Find Tikti.', 12, 0, 100, 0, 0, 0, 13871, 0, 0, 0, 'Stillpine Ancestor Coo');
INSERT INTO `creature_text` VALUES (17392, 0, 0, '%s asks you to follow him.', 16, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Stillpine Ancestor Tikti');
INSERT INTO `creature_text` VALUES (17392, 1, 0, '[Furbolg] Far you mixik tak come. Gaze upon the kitch\'kal river. Follow. Ilog to Yor.', 12, 0, 100, 0, 0, 0, 13873, 0, 0, 0, 'Stillpine Ancestor Tikti');
INSERT INTO `creature_text` VALUES (17392, 2, 0, '[Furbolg] Go... Search yitix\'kil bottom river. South!', 12, 0, 100, 0, 0, 0, 13875, 0, 0, 0, 'Stillpine Ancestor Tikti');
INSERT INTO `creature_text` VALUES (17393, 3, 0, '[Furbolg] Come, $n. Let us leave the water together, purified.', 12, 0, 100, 0, 0, 0, 13901, 3281, 3281, 0, 'Stillpine Ancestor Yor to Player');
