INSERT INTO `creature_text` VALUES (17982, 11, 0, 'Blessed Light! She\'s siphoning energy right out of the Vector Coil!', 12, 0, 100, 53, 0, 0, 14659, 0, 0, 0, 'npc_demolitionist_legoso SAY_LEGOSO_12');
