INSERT INTO `creature_text` VALUES (18165, 0, 0, 'Ah, yes. I do. I mean did. Well, it was stolen, you see.', 12, 0, 100, 0, 0, 0, 126061, 0, 0, 0, 'Верховный маг Седрик to player');
INSERT INTO `creature_text` VALUES (18165, 1, 0, 'By ogres no less. Filthy beasts. They raided our ruins a while back and unfortunately they made off with the disc piece.', 12, 0, 100, 0, 0, 0, 126062, 0, 0, 0, 'Верховный маг Седрик to player');
INSERT INTO `creature_text` VALUES (18165, 2, 0, 'But if you\'re looking to retrieve it, I\'m sure it must be somewhere in the Ruins of Alterac where they reside.', 12, 0, 100, 0, 0, 0, 126064, 0, 0, 0, 'Верховный маг Седрик to player');
INSERT INTO `creature_text` VALUES (18165, 3, 0, 'Not to worry though. I couldn\'t figure out how to help Antonidas with it, so I\'m sure they have no clue what to do with it.', 12, 0, 100, 0, 0, 0, 126063, 0, 0, 0, 'Верховный маг Седрик to player');
INSERT INTO `creature_text` VALUES (18166, 0, 0, 'Do not burden A\'dal with mundane questions, $r.  This being\'s will is all that keeps our enemies from crushing this city.', 12, 0, 100, 0, 0, 9739, 17238, 0, 0, 0, 'Archmage Khadgar to Player');
INSERT INTO `creature_text` VALUES (18166, 1, 0, 'Show our guest around Shattrath, will you?  Keep an eye out for pickpockets in the Lower City.', 12, 0, 100, 0, 0, 0, 17266, 0, 0, 0, 'Archmage Khadgar to Player');
