INSERT INTO `creature_text` VALUES (18341, 1, 1, 'Больше... больше душ!', 14, 0, 100, 0, 0, 10565, 17775, 0, 0, 0, 'Пандемоний to Player');
INSERT INTO `creature_text` VALUES (18341, 2, 0, 'Снова... в Пустоту...', 14, 0, 100, 0, 0, 10566, 17776, 0, 0, 0, 'Пандемоний to Player');
INSERT INTO `creature_text` VALUES (18341, 3, 0, '%s превращается в ничто...', 14, 0, 100, 0, 0, 0, 21067, 0, 0, 0, 'Пандемоний to Player');
INSERT INTO `creature_text` VALUES (18344, 0, 0, 'Что такое?.. Прошу меня извинить, я не ждал гостей. Как видите, мы тут немного заняты. Но не волнуйтесь... Как гостеприимный хозяин, я уделю вам внимание...', 14, 0, 100, 0, 0, 10539, 17784, 0, 0, 0, 'Принц Шаффар to Player');
INSERT INTO `creature_text` VALUES (18344, 1, 0, 'Нас не представили друг другу должным образом.', 14, 0, 100, 0, 0, 10546, 17780, 0, 0, 0, 'Принц Шаффар to Player');
INSERT INTO `creature_text` VALUES (18344, 1, 1, 'О, я как раз соскучился по приключениям!', 14, 0, 100, 0, 0, 10546, 17782, 0, 0, 0, 'Принц Шаффар to Player');
INSERT INTO `creature_text` VALUES (18344, 1, 2, 'Достойный противник! Великолепно!', 14, 0, 100, 0, 0, 10542, 17781, 0, 0, 0, 'Принц Шаффар to Player');
INSERT INTO `creature_text` VALUES (18344, 2, 0, 'Это было... увлекательно.', 14, 0, 100, 0, 0, 10546, 17779, 0, 0, 0, 'Принц Шаффар to Player');
INSERT INTO `creature_text` VALUES (18344, 2, 1, 'И вот, мы расстаемся.', 14, 0, 100, 0, 0, 10546, 17778, 0, 0, 0, 'Принц Шаффар to Player');
INSERT INTO `creature_text` VALUES (18344, 3, 0, 'Поверьте, у меня есть чем вас удивить.', 14, 0, 100, 0, 0, 10540, 17783, 0, 0, 0, 'Принц Шаффар to 0');
INSERT INTO `creature_text` VALUES (18344, 4, 0, 'Я должен... проститься с вами.', 14, 0, 100, 0, 0, 10546, 17777, 0, 0, 0, 'Принц Шаффар to Player');
INSERT INTO `creature_text` VALUES (18351, 0, 0, 'In Nagrand, food hunt ogre!', 12, 0, 100, 0, 0, 0, 15278, 0, 0, 0, 'Lump');
INSERT INTO `creature_text` VALUES (18351, 0, 1, 'You taste good with maybe a little salt and pepper.', 12, 0, 100, 0, 0, 0, 15279, 0, 0, 0, 'Lump');
