INSERT INTO `creature_text` VALUES (18371, 0, 0, '$n оказывается в зоне внимания |3-1(%s).', 41, 0, 100, 0, 0, 0, 21077, 0, 0, 0, 'Ширрак Страж Мертвых to Player');
INSERT INTO `creature_text` VALUES (18373, 0, 0, 'You have defiled the resting place of our ancestors. For this offense, there can be but one punishment. It is fitting that you have come to a place of the dead... for you will soon be joining them.', 14, 0, 100, 0, 0, 10509, 0, 0, 0, 0, 'Р­РєР·Р°СЂС… РњР°Р»Р°РґР°Р°СЂ to Player');
INSERT INTO `creature_text` VALUES (18373, 1, 0, 'Rise my fallen brothers. Take form and fight!', 14, 0, 100, 0, 0, 10512, 15466, 0, 0, 0, 'Р­РєР·Р°СЂС… РњР°Р»Р°РґР°Р°СЂ to 0');
INSERT INTO `creature_text` VALUES (18373, 2, 0, 'You will pay with your life!', 14, 0, 100, 0, 0, 10513, 17647, 0, 0, 0, 'Р­РєР·Р°СЂС… РњР°Р»Р°РґР°Р°СЂ to Player');
INSERT INTO `creature_text` VALUES (18373, 2, 1, 'There\'s no turning back now!', 14, 0, 100, 0, 0, 10514, 17648, 0, 0, 0, 'Р­РєР·Р°СЂС… РњР°Р»Р°РґР°Р°СЂ');
INSERT INTO `creature_text` VALUES (18373, 2, 2, 'Serve your penitence!', 14, 0, 100, 0, 0, 10515, 17649, 0, 0, 0, 'Р­РєР·Р°СЂС… РњР°Р»Р°РґР°Р°СЂ');
INSERT INTO `creature_text` VALUES (18373, 3, 0, 'Let your mind be clouded.', 14, 0, 100, 0, 0, 10510, 17644, 0, 0, 0, 'Р­РєР·Р°СЂС… РњР°Р»Р°РґР°Р°СЂ');
INSERT INTO `creature_text` VALUES (18373, 4, 0, 'Stare into the darkness of your soul.', 14, 0, 100, 0, 0, 10511, 17645, 0, 0, 0, 'Р­РєР·Р°СЂС… РњР°Р»Р°РґР°Р°СЂ');
INSERT INTO `creature_text` VALUES (18373, 5, 0, 'These walls will be your tomb!', 14, 0, 100, 0, 0, 10516, 17650, 0, 0, 0, 'Р­РєР·Р°СЂС… РњР°Р»Р°РґР°Р°СЂ');
INSERT INTO `creature_text` VALUES (18373, 5, 1, '<laugh> Now, you\'ll stay for eternity!', 14, 0, 100, 0, 0, 10517, 17651, 0, 0, 0, 'Р­РєР·Р°СЂС… РњР°Р»Р°РґР°Р°СЂ');
INSERT INTO `creature_text` VALUES (18373, 6, 0, 'This is... where.. I belong...', 14, 0, 100, 0, 0, 10518, 17646, 0, 0, 0, 'Р­РєР·Р°СЂС… РњР°Р»Р°РґР°Р°СЂ');
INSERT INTO `creature_text` VALUES (18399, 0, 0, 'Blue brothers reign supreme!', 12, 0, 100, 0, 0, 0, 15460, 0, 0, 0, 'Murkblood Twin');
INSERT INTO `creature_text` VALUES (18400, 0, 0, 'ROKDAR SMASH PUNY %t!', 14, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Rokdar the Sundered Lord');
INSERT INTO `creature_text` VALUES (18401, 0, 0, 'Closer... Come closer... See what the void brings!', 14, 0, 100, 0, 0, 0, 15472, 0, 0, 0, 'Skra\'gath');
