INSERT INTO `creature_text` VALUES (18420, 3, 0, 'Хм, защита от стихий льда, огня и тайной магии работает куда быстрее, чем в 7-й версии, а вот защита от сил Природы по-прежнему не тянет...', 12, 0, 100, 0, 0, 0, 17178, 347207, 347207, 0, 'Солнцелов-геомант');
INSERT INTO `creature_text` VALUES (18445, 0, 0, 'Thanks, $C! I\'m sure my dad will reward you greatly! Bye!', 12, 0, 100, 0, 0, 0, 15297, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (18471, 0, 0, 'Get in the Ring of Blood, $N. The fight is about to start!', 12, 0, 100, 0, 0, 0, 15441, 0, 0, 0, 'Gurgthock');
INSERT INTO `creature_text` VALUES (18471, 1, 0, 'The battle is about to begin! $N versus the ferocious clefthoof, Brokentoe!', 14, 0, 100, 0, 0, 0, 15439, 0, 0, 0, 'Gurgthock');
