INSERT INTO `creature_text` VALUES (18471, 7, 0, 'From parts unkown: Skra\'gath! Can $N possibly survive the onslaught of void energies?', 14, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Gurgthock');
INSERT INTO `creature_text` VALUES (18471, 9, 0, 'This is the moment we\'ve all been waiting for! The Warmaul champion is about to make $g his:her; first showing at the Ring of Blood in weeks! Will $N go down in defeat as easily as the champion\'s other opponents? We shall see...', 14, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Gurgthock');
