INSERT INTO `creature_text` VALUES (18547, 3, 0, 'We\'re rather selective of who we befriend, $n.  You think you have what it takes?', 12, 0, 100, 0, 0, 0, 17287, 17922, 17922, 0, 'Scryer Arcanist to Player');
INSERT INTO `creature_text` VALUES (18547, 3, 0, 'Мы очень разборчивы в выборе друзей, $n. Думаешь, ты нам подойдешь?', 12, 0, 100, 0, 0, 0, 17287, 18000, 18000, 0, 'Провидец-чародей to Player');
INSERT INTO `creature_text` VALUES (18588, 0, 0, 'I choose the third option: KILLING YOU!', 12, 0, 100, 0, 0, 0, 18588, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (18596, 3, 0, 'Are you joking?  I\'m a Scryer, I always watch what I say.  More enemies than allies in this city, it seems.', 12, 0, 100, 0, 0, 0, 17285, 34062, 34062, 0, 'Arcanist Adyria to Player');
INSERT INTO `creature_text` VALUES (18596, 3, 0, 'Ты шутишь? Я из Провидцев, я всегда думаю, что говорю. Похоже, в городе больше врагов, чем друзей.', 12, 0, 100, 0, 0, 0, 17285, 29000, 29000, 0, 'Чародейка Адирия to Player');
INSERT INTO `creature_text` VALUES (18597, 3, 0, 'A newcomer to Shattrath!  Make sure to drop by later.  We can always use a hand with the injured.', 12, 0, 100, 0, 0, 0, 17282, 223594, 223594, 0, 'Sha\'nir to Player');
INSERT INTO `creature_text` VALUES (18597, 3, 0, 'О, в Шаттрате новичок! Заходи как-нибудь, не стесняйся. Нам всегда нужна помощь с ранеными...', 12, 0, 100, 0, 0, 0, 17282, 25000, 25000, 0, 'Ша\'нир to Player');
INSERT INTO `creature_text` VALUES (18598, 0, 0, 'Что-то мне... нехорошо...', 12, 0, 100, 1, 0, 0, 19520, 0, 0, 0, 'Пленный орк to 0');
INSERT INTO `creature_text` VALUES (18598, 1, 0, 'Когда мы сможем поесть?', 12, 0, 100, 1, 0, 0, 19521, 0, 0, 0, 'Пленный орк to 0');
INSERT INTO `creature_text` VALUES (18622, 3, 0, 'Be mindful of what you say, this one\'s being shown around by Khadgar\'s pet.', 12, 0, 100, 0, 0, 0, 17284, 23657, 23657, 0, 'Iz\'zard to Player');
