INSERT INTO `creature_text` VALUES (18649, 3, 0, '%s смотрит на беспорядки, качая головой.', 16, 0, 100, 0, 0, 0, 15631, 779000, 779000, 0, 'Трактирщица Моника');
INSERT INTO `creature_text` VALUES (18672, 3, 0, 'Вы не разочаруетесь, а если вдруг это случится – мы вернем ваши деньги!', 14, 0, 100, 5, 0, 0, 19558, 9000, 1134000, 0, 'Томас Янс');
INSERT INTO `creature_text` VALUES (18672, 3, 0, 'Если у меня чего-то нет – значит, оно вам не нужно!', 14, 0, 100, 5, 0, 0, 19557, 1042000, 1042000, 0, 'Томас Янс');
INSERT INTO `creature_text` VALUES (18672, 3, 0, 'Не слушайте моих слов, что товар отличный. Взгляните своими глазами!', 14, 0, 100, 5, 0, 0, 19559, 7000, 7000, 0, 'Томас Янс');
INSERT INTO `creature_text` VALUES (18688, 0, 0, 'Ancestors watch over you, kind one...', 12, 0, 100, 21, 0, 0, 16841, 0, 0, 0, 'Ancient Orc Ancestor');
INSERT INTO `creature_text` VALUES (18688, 0, 1, 'Cease your crying! STOP!', 12, 0, 100, 21, 0, 0, 15706, 0, 0, 0, 'Ancient Orc Ancestor');
INSERT INTO `creature_text` VALUES (18688, 0, 2, 'I remember everything...', 12, 0, 100, 21, 0, 0, 15701, 0, 0, 0, 'Ancient Orc Ancestor');
INSERT INTO `creature_text` VALUES (18688, 0, 3, 'It cannot be...', 12, 0, 100, 21, 0, 0, 16839, 0, 0, 0, 'Ancient Orc Ancestor');
INSERT INTO `creature_text` VALUES (18688, 0, 4, 'It comes for you...', 12, 0, 100, 21, 0, 0, 16838, 0, 0, 0, 'Ancient Orc Ancestor');
INSERT INTO `creature_text` VALUES (18688, 1, 0, 'The spirits call... I am consumed.', 12, 0, 100, 21, 0, 0, 15704, 0, 0, 0, 'Ancient Orc Ancestor');
INSERT INTO `creature_text` VALUES (18688, 1, 1, 'Cannot control... It draws me in... The void grows...', 12, 0, 100, 21, 0, 0, 15710, 0, 0, 0, 'Ancient Orc Ancestor');
INSERT INTO `creature_text` VALUES (18688, 1, 2, 'It is dying. It is dying. It is dying.', 12, 0, 100, 21, 0, 0, 15707, 0, 0, 0, 'Ancient Orc Ancestor');
INSERT INTO `creature_text` VALUES (18688, 1, 3, 'The cold embrace awaits...', 12, 0, 100, 21, 0, 0, 16837, 0, 0, 0, 'Ancient Orc Ancestor');
INSERT INTO `creature_text` VALUES (18688, 1, 4, 'The pain is unbearable.', 12, 0, 100, 21, 0, 0, 15705, 0, 0, 0, 'Ancient Orc Ancestor');
INSERT INTO `creature_text` VALUES (18688, 1, 5, 'What is happening to me?', 12, 0, 100, 21, 0, 0, 29739, 0, 0, 0, 'Ancient Orc Ancestor');
INSERT INTO `creature_text` VALUES (18688, 1, 6, 'What is this trickery? I... ARGH...', 12, 0, 100, 21, 0, 0, 16840, 0, 0, 0, 'Ancient Orc Ancestor');
INSERT INTO `creature_text` VALUES (18688, 1, 7, 'What will become of us when it falls?', 12, 0, 100, 21, 0, 0, 15709, 0, 0, 0, 'Ancient Orc Ancestor');
