INSERT INTO `creature_text` VALUES (18723, 0, 0, 'Думаю, я смогу все вам объяснить, если вы уделите мне минутку.', 12, 0, 100, 0, 0, 0, 16086, 0, 0, 0, 'Эрозион to 21124');
INSERT INTO `creature_text` VALUES (18723, 1, 0, 'Это заклинание должно стереть их память о нас и о том, что сейчас произошло. Все, что они теперь должны помнить, – это то, на что бы походила действительность без вмешательства в ход времени. Отлично. Тралл отправится навстречу своей судьбе, а Тарета...', 12, 0, 100, 0, 0, 0, 16087, 0, 0, 0, 'Эрозион to 21124');
INSERT INTO `creature_text` VALUES (18723, 2, 0, 'К сожалению, ее судьба предрешена.', 12, 0, 100, 0, 0, 0, 16088, 0, 0, 0, 'Эрозион to 21124');
INSERT INTO `creature_text` VALUES (18725, 0, 0, 'Когда соберешься в Дарнхольд – просто скажи, и я возьму тебя с собой!', 15, 0, 100, 0, 0, 0, 17753, 0, 0, 0, 'Бронзень to Player');
INSERT INTO `creature_text` VALUES (18728, 0, 0, 'I remember well the sting of defeat at the conclusion of the Third War. I have waited far too long for my revenge. Now the shadow of the Legion falls over this world. It is only a matter of time until all of your failed creation... is undone.', 14, 0, 0, 0, 0, 11332, 20076, 0, 0, 0, 'kazzak SAY_INTRO');
INSERT INTO `creature_text` VALUES (18728, 1, 0, 'The Legion will conquer all!', 14, 0, 0, 0, 0, 11333, 45232, 0, 0, 0, 'kazzak SAY_AGGRO1');
INSERT INTO `creature_text` VALUES (18728, 1, 1, 'All mortals will perish!', 14, 0, 0, 0, 0, 11334, 20078, 0, 0, 0, 'kazzak SAY_AGGRO2');
INSERT INTO `creature_text` VALUES (18728, 2, 0, 'All life must be eradicated!', 14, 0, 0, 0, 0, 11335, 20079, 0, 0, 0, 'kazzak SAY_SURPREME1');
INSERT INTO `creature_text` VALUES (18728, 2, 1, 'I\'ll rip the flesh from your bones!', 14, 0, 0, 0, 0, 11336, 20080, 0, 0, 0, 'kazzak SAY_SURPREME2');
INSERT INTO `creature_text` VALUES (18728, 3, 0, 'Kirel Narak!', 14, 0, 0, 0, 0, 11337, 91207, 0, 0, 0, 'kazzak SAY_KILL1');
INSERT INTO `creature_text` VALUES (18728, 3, 1, 'Contemptible wretch!', 14, 0, 0, 0, 0, 11338, 20082, 0, 0, 0, 'kazzak SAY_KILL2');
INSERT INTO `creature_text` VALUES (18728, 3, 2, 'The universe will be remade.', 14, 0, 0, 0, 0, 11339, 20083, 0, 0, 0, 'kazzak SAY_KILL3');
INSERT INTO `creature_text` VALUES (18728, 4, 0, 'The Legion... will never... fall.', 14, 0, 0, 0, 0, 11340, 20084, 0, 0, 0, 'kazzak SAY_DEATH');
INSERT INTO `creature_text` VALUES (18728, 5, 0, '%s goes into a frenzy!', 16, 0, 0, 0, 0, 0, 38630, 0, 0, 0, 'kazzak EMOTE_FRENZY');
INSERT INTO `creature_text` VALUES (18728, 6, 0, 'Invaders, you dangle upon the precipice of oblivion! The Burning Legion comes and with it comes your end.', 14, 0, 0, 0, 0, 0, 0, 0, 0, 0, 'kazzak SAY_RAND1');
INSERT INTO `creature_text` VALUES (18728, 6, 1, 'Impudent whelps, you only delay the inevitable. Where one has fallen, ten shall rise. Such is the will of Kazzak...', 14, 0, 0, 0, 0, 0, 16432, 0, 0, 0, 'kazzak SAY_RAND2');
