INSERT INTO `creature_text` VALUES (18999, 1, 1, 'I\'m up to looking into that bounty after this shift.', 12, 7, 100, 1, 0, 0, 16977, 0, 0, 0, 'Allerian Defender');
INSERT INTO `creature_text` VALUES (18999, 1, 2, 'I could use the extra money.', 12, 7, 100, 1, 0, 0, 16979, 0, 0, 0, 'Allerian Defender');
INSERT INTO `creature_text` VALUES (18999, 1, 3, 'I don\'t know and I don\'t care.', 12, 7, 100, 1, 0, 0, 16975, 0, 0, 0, 'Allerian Defender');
