INSERT INTO `creature_text` VALUES (19142, 3, 0, 'Light be with you, $n.  And welcome to Shattrath.', 12, 0, 100, 0, 0, 147, 17286, 5782, 5782, 0, 'Aldor Anchorite to Player');
INSERT INTO `creature_text` VALUES (19149, 3, 0, 'Он победит? Он может победить?', 12, 7, 100, 1, 0, 0, 16235, 12698, 12698, 0, 'Телаарский житель');
