INSERT INTO `creature_text` VALUES (19166, 4, 0, '%s is calling for help!', 16, 0, 100, 0, 0, 0, 81221, 13000, 13000, 0, 'Патрульный Бурекузницы');
INSERT INTO `creature_text` VALUES (19175, 0, 0, 'Хотя мы и не знаем истоков Зимнего Покрова, мы приняли традиции праздника и следуем им.', 12, 0, 100, 0, 0, 0, 16164, 0, 0, 0, 'Орк-обыватель to Орк-обыватель');
INSERT INTO `creature_text` VALUES (19175, 3, 0, 'Во время Лунного фестиваля мы навещаем наших старейшин и приобщаемся к их мудрости.', 12, 0, 100, 274, 0, 0, 24350, 0, 0, 0, 'Орк-обыватель to Орк-обыватель');
INSERT INTO `creature_text` VALUES (19175, 3, 0, 'Где мне взять красивую зимнюю шапочку?', 12, 1, 100, 0, 0, 0, 24325, 0, 0, 0, 'Орк-обыватель to Орк-обыватель');
INSERT INTO `creature_text` VALUES (19175, 3, 0, 'Где мое золото? Где мое пиво? А сам я где?', 12, 1, 100, 6, 0, 0, 23352, 0, 0, 0, 'Орк-обыватель to Орк-обыватель');
INSERT INTO `creature_text` VALUES (19175, 3, 0, 'Гоблины из пастбищ Дымного Леса в это время года всегда продают чудесные угощения.', 12, 0, 100, 273, 0, 0, 24341, 0, 0, 0, 'Орк-обыватель to Орк-обыватель');
INSERT INTO `creature_text` VALUES (19175, 3, 0, 'Дедушка Зима всегда оставляет подарки для всех и каждого под елочкой в Оргриммаре. Интересно, что он принесет мне в этом году.', 12, 0, 100, 0, 0, 0, 16464, 0, 0, 0, 'Орк-обыватель to Орк-обыватель');
INSERT INTO `creature_text` VALUES (19175, 3, 0, 'Друиды Ночной Гавани пышно празднуют Лунный фестиваль у себя на Лунной поляне.', 12, 0, 100, 0, 0, 0, 24352, 0, 0, 0, 'Орк-обыватель to Орк-обыватель');
INSERT INTO `creature_text` VALUES (19175, 3, 0, 'Кажется, я объелась конфетами...', 12, 1, 100, 6, 0, 0, 24330, 0, 0, 0, 'Орк-обыватель to Орк-обыватель');
INSERT INTO `creature_text` VALUES (19175, 3, 0, 'Легенда гласит, что великий зверь Омен спит в водах озера Элуне\'ара в Лунной поляне и показывается только раз в год. Но это всего лишь легенда.', 12, 0, 100, 0, 0, 0, 24349, 0, 0, 0, 'Орк-обыватель to Орк-обыватель');
INSERT INTO `creature_text` VALUES (19175, 3, 0, 'Надеюсь, мне удастся повидать Дедушку Зиму до окончания Зимнего Покрова.', 12, 0, 100, 0, 0, 0, 24340, 0, 0, 0, 'Орк-обыватель to Орк-обыватель');
INSERT INTO `creature_text` VALUES (19175, 3, 0, 'Поздравляю с Тыквовином!', 12, 1, 100, 0, 0, 0, 24346, 0, 0, 0, 'Орк-обыватель to Орк-обыватель');
INSERT INTO `creature_text` VALUES (19175, 3, 0, 'Ты $gвидел:видела; фейерверки? Сейчас самый лучший сезон для их закупки.', 12, 0, 100, 6, 0, 0, 24351, 0, 0, 0, 'Орк-обыватель to Орк-обыватель');
INSERT INTO `creature_text` VALUES (19181, 0, 0, 'Guards!', 14, 7, 100, 0, 0, 0, 4583, 0, 0, 0, 'Lemla Hopewing');
INSERT INTO `creature_text` VALUES (19191, 0, 0, 'What insolence! What arrogance! To believe you could defeat me on my own doorstep!', 14, 0, 100, 0, 0, 0, 17653, 0, 0, 0, 'Arazzius the Cruel to Player');
INSERT INTO `creature_text` VALUES (19191, 1, 0, 'Fool! You are a child playing in a world beyond your comprehension. Speak no more!', 14, 0, 100, 0, 0, 0, 16858, 0, 0, 0, 'Arazzius the Cruel to 510');
INSERT INTO `creature_text` VALUES (19191, 2, 0, 'Master, I have failed...', 14, 0, 100, 0, 0, 0, 36921, 0, 0, 0, 'Arazzius the Cruel to Player');
INSERT INTO `creature_text` VALUES (19216, 0, 0, 'Friends, it is my great pleasure to welcome you to the temple today.', 12, 0, 100, 1, 0, 0, 16735, 0, 0, 0, 'Grand Anchorite Almonen');
INSERT INTO `creature_text` VALUES (19216, 1, 0, 'A\'dal has been most generous in his revelations to me, a humble servant of the Light.', 12, 0, 100, 0, 0, 0, 16740, 0, 0, 0, 'Grand Anchorite Almonen');
INSERT INTO `creature_text` VALUES (19216, 2, 0, 'In accordance with my divine calling, I must share these revealed truths to all who would hear.', 12, 0, 100, 0, 0, 0, 16741, 0, 0, 0, 'Grand Anchorite Almonen');
INSERT INTO `creature_text` VALUES (19216, 3, 0, 'It has been made known to me that inside each of us, the Light resides...', 12, 0, 100, 0, 0, 0, 16742, 0, 0, 0, 'Grand Anchorite Almonen');
INSERT INTO `creature_text` VALUES (19216, 4, 0, '...that it is a gift, given freely to all naturally born beings.', 12, 0, 100, 0, 0, 0, 16743, 0, 0, 0, 'Grand Anchorite Almonen');
INSERT INTO `creature_text` VALUES (19216, 5, 0, 'It manifests itself as a feeling, small at first and easily ignored, that confirms truths and subtly prods one to do good.', 12, 0, 100, 0, 0, 0, 16752, 0, 0, 0, 'Grand Anchorite Almonen');
INSERT INTO `creature_text` VALUES (19216, 6, 0, 'Simple kindnesses, charitable deeds, service to those in need. These are all fruits of the Light.', 12, 0, 100, 0, 0, 0, 16753, 0, 0, 0, 'Grand Anchorite Almonen');
INSERT INTO `creature_text` VALUES (19216, 7, 0, 'It rewards those who heed its promptings with blessings, both seen and unseen.', 12, 0, 100, 1, 0, 0, 16754, 0, 0, 0, 'Grand Anchorite Almonen');
INSERT INTO `creature_text` VALUES (19216, 8, 0, 'Personal reservoirs of hope and faith are strengthened, and one\'s capacity for greater light increases.', 12, 0, 100, 0, 0, 0, 16755, 0, 0, 0, 'Grand Anchorite Almonen');
INSERT INTO `creature_text` VALUES (19216, 9, 0, 'Over the course of time, through obedience to the Light\'s guidance, one becomes more sensitive to its voice, and its power.', 12, 0, 100, 273, 0, 0, 16756, 0, 0, 0, 'Grand Anchorite Almonen');
INSERT INTO `creature_text` VALUES (19216, 10, 0, 'Great is the healing and blessing power of the Light\'s most diligent followers.', 12, 0, 100, 0, 0, 0, 16757, 0, 0, 0, 'Grand Anchorite Almonen');
INSERT INTO `creature_text` VALUES (19216, 11, 0, 'Sadly, there are those who wander through mortality in defiance of the Light.', 12, 0, 100, 1, 0, 0, 16761, 0, 0, 0, 'Grand Anchorite Almonen');
INSERT INTO `creature_text` VALUES (19216, 12, 0, 'From these the Light withdraws, until only darkness remains.', 12, 0, 100, 0, 0, 0, 16762, 0, 0, 0, 'Grand Anchorite Almonen');
INSERT INTO `creature_text` VALUES (19216, 13, 0, 'Where there is no light, despair, loathing and rage thrive.', 12, 0, 100, 5, 0, 0, 16763, 0, 0, 0, 'Grand Anchorite Almonen');
INSERT INTO `creature_text` VALUES (19216, 14, 0, 'We are born into a perilous age, where the forces of darkness are determined to bring about our destruction.', 12, 0, 100, 1, 0, 0, 16764, 0, 0, 0, 'Grand Anchorite Almonen');
INSERT INTO `creature_text` VALUES (19216, 15, 0, 'These are the times to find yourselves in unison with the Light.', 12, 0, 100, 5, 0, 0, 16765, 0, 0, 0, 'Grand Anchorite Almonen');
INSERT INTO `creature_text` VALUES (19216, 16, 0, 'Hear my words, and let the Light inside of you confirm the truth of them.', 12, 0, 100, 0, 0, 0, 16766, 0, 0, 0, 'Grand Anchorite Almonen');
INSERT INTO `creature_text` VALUES (19216, 17, 0, 'Embrace the light that is in you, my friends! Deny yourself all darkness...', 12, 0, 100, 5, 0, 0, 16775, 0, 0, 0, 'Grand Anchorite Almonen');
INSERT INTO `creature_text` VALUES (19216, 18, 0, 'We must endure these trying times faithfully, and one day we will find ourselves victorious.', 12, 0, 100, 5, 0, 0, 16776, 0, 0, 0, 'Grand Anchorite Almonen');
INSERT INTO `creature_text` VALUES (19218, 0, 0, 'I foresee someone\'s painful death.', 14, 0, 100, 0, 0, 11101, 20034, 0, 0, 0, 'Страж ворот Точеный Нож to Player');
INSERT INTO `creature_text` VALUES (19218, 1, 0, 'Это непредвиденная... случайность.', 14, 0, 100, 0, 0, 11106, 20039, 0, 0, 0, 'Страж ворот Точеный Нож to Player');
INSERT INTO `creature_text` VALUES (19218, 2, 0, 'Ты слышишь тихий звук отпираемого замка...', 16, 0, 100, 0, 0, 11106, 19055, 0, 0, 0, 'Страж ворот Точеный Нож to Player');
INSERT INTO `creature_text` VALUES (19219, 0, 0, 'Рассыпьтесь, пока еще есть возможность.', 14, 0, 100, 0, 0, 11162, 19952, 0, 0, 0, 'Механолорд Конденсарон to Player');
INSERT INTO `creature_text` VALUES (19219, 1, 0, 'Думаете, что можете мне повредить, а? Думаете, я вас боюсь, да?', 14, 0, 100, 0, 0, 11165, 19955, 0, 0, 0, 'Механолорд Конденсарон to 0');
INSERT INTO `creature_text` VALUES (19219, 2, 0, 'Браво!', 14, 0, 100, 0, 0, 11167, 19957, 0, 0, 0, 'Механолорд Конденсарон to Player');
INSERT INTO `creature_text` VALUES (19220, 0, 0, 'I\'m waiting for you!', 14, 0, 100, 53, 0, 0, 19059, 0, 0, 0, 'Паталеон Вычислитель to Кровостраж-врач');
INSERT INTO `creature_text` VALUES (19220, 1, 0, 'У нас очень строгий график. Не вмешивайтесь!', 14, 0, 100, 0, 0, 11193, 20041, 0, 0, 0, 'Паталеон Вычислитель to Player');
INSERT INTO `creature_text` VALUES (19220, 2, 0, 'Требуется коммуникабельный работник...', 14, 0, 100, 0, 0, 11197, 18716, 0, 0, 0, 'Паталеон Вычислитель to Player');
INSERT INTO `creature_text` VALUES (19220, 3, 0, 'Предпочитаю практичность и удобство.', 14, 0, 100, 0, 0, 11199, 18725, 0, 0, 0, 'Паталеон Вычислитель to 0');
INSERT INTO `creature_text` VALUES (19220, 4, 0, 'Проект... продолжится.', 14, 0, 100, 0, 0, 11200, 20044, 0, 0, 0, 'Паталеон Вычислитель to Player');
INSERT INTO `creature_text` VALUES (19221, 0, 0, 'Хм, кажется, вы не слишком-то цените свою жизнь?', 14, 0, 100, 0, 0, 11186, 19959, 0, 0, 0, 'Пустомант Сепетрея to Player');
INSERT INTO `creature_text` VALUES (19221, 1, 0, 'Ану... бала белоре... алон.', 14, 0, 100, 0, 0, 11192, 19966, 0, 0, 0, 'Пустомант Сепетрея to Player');
INSERT INTO `creature_text` VALUES (19227, 3, 0, 'Ты выглядишь $gбольным:больной; от любви. Кто-то дорогой заставляет тебя грустить, а? Нет проблем, нет проблем. Возьми у меня этот медальон, надень его перед свиданием, и на тебя просто набросятся, $Gмужчина:красавица;!', 12, 0, 100, 5, 0, 0, 16320, 80029, 80029, 0, 'Жуль to Player');
INSERT INTO `creature_text` VALUES (19273, 3, 0, 'Поговори с командиром крыла Бракком, $n. Он снабдит тебя одной из наших бронированных виверн-разрушителей. И удачи!', 12, 0, 100, 25, 0, 0, 17964, 707000, 707000, 0, 'Командир передовой То\'арх to Player');
