INSERT INTO `creature_text` VALUES (19294, 1, 0, 'Зло, исходящее из осколков кристаллов, привлекло одного из колоссов. Скорее останови его!', 12, 0, 100, 0, 0, 0, 18291, 0, 0, 31401, 'Землепряд Галандрия Ночной Бриз to Любопытный колосс');
INSERT INTO `creature_text` VALUES (19294, 3, 0, 'I have an idea.  Let\'s plant this shard in the ground and see what happens.', 12, 0, 100, 0, 0, 0, 18289, 57562, 57562, 0, 'Earthbinder Galandria Nightbreeze to Player');
INSERT INTO `creature_text` VALUES (19294, 3, 0, 'Up here on the hill, $n.', 15, 0, 100, 0, 0, 0, 18293, 33297, 33297, 0, 'Earthbinder Galandria Nightbreeze to Player');
INSERT INTO `creature_text` VALUES (19294, 3, 0, 'А что, если мы закопаем этот осколок в землю и посмотрим, что будет?', 12, 0, 100, 0, 0, 0, 18289, 376000, 650000, 0, 'Землепряд Галандрия Ночной Бриз to Player');
INSERT INTO `creature_text` VALUES (19294, 3, 0, 'Сюда, $n! На холм!', 15, 0, 100, 0, 0, 0, 18293, 356000, 356000, 0, 'Землепряд Галандрия Ночной Бриз to Player');
INSERT INTO `creature_text` VALUES (19294, 4, 0, 'The evil emanating from the crystal shard has lured one of the colossi.  Put it down quick!', 12, 0, 100, 0, 0, 0, 18291, 2141, 2141, 31401, 'Earthbinder Galandria Nightbreeze to Lured Colossus');
INSERT INTO `creature_text` VALUES (19308, 3, 0, 'I regret to inform you all that we sent home another ten soldiers today - in body bags.', 12, 7, 100, 1, 0, 0, 16455, 11172, 11172, 0, 'Marshal Isildor');
INSERT INTO `creature_text` VALUES (19308, 3, 0, 'С прискорбием сообщаю вам, что мы сегодня отправили домой еще десять бойцов – вперед ногами.', 12, 7, 100, 1, 0, 0, 16455, 210000, 210000, 0, 'Маршал Исилдор');
INSERT INTO `creature_text` VALUES (19308, 3, 0, 'Сколько еще солдат должно полечь, прежде чем мы обратим на них внимание?', 12, 7, 100, 1, 0, 0, 16453, 718000, 718000, 0, 'Маршал Исилдор');
INSERT INTO `creature_text` VALUES (19312, 0, 0, '%s calls for help!', 16, 0, 100, 0, 0, 0, 2541, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (19316, 3, 0, 'Tear it down, soldiers! We\'re shippin\' this thing back to Stormwind!', 12, 7, 100, 22, 0, 0, 16576, 2313437, 3025000, 0, 'Field Marshal Rohamus');
INSERT INTO `creature_text` VALUES (19316, 3, 0, 'We\'re gonna melt this hunk of junk down and make weapons with the ingots! Let\'s see how the Legion likes a taste of fel reaver served up Alliance style!', 12, 7, 100, 22, 0, 0, 16577, 2814875, 3682062, 0, 'Field Marshal Rohamus');
INSERT INTO `creature_text` VALUES (19316, 3, 0, 'Well done, soldiers! We weren\'t about to let the filthy animals of the Horde show us up!', 12, 7, 100, 22, 0, 0, 16578, 2886531, 3178140, 0, 'Field Marshal Rohamus');
INSERT INTO `creature_text` VALUES (19317, 0, 0, 'Guards!', 14, 1, 100, 0, 0, 0, 4583, 0, 0, 0, 'Drek\'Gol');
INSERT INTO `creature_text` VALUES (19354, 0, 0, 'Do not allow these wretches a moment of rest!  If there\'s an Ata\'mal crystal here then we shall find it!', 14, 0, 100, 0, 0, 0, 16476, 0, 0, 0, 'Arzeth the Merciless to 0');
INSERT INTO `creature_text` VALUES (19354, 1, 0, 'That Broken worm gave you that staff, didn\'t he?  Did he also tell you he\'s the one that sold out his tribe?  No matter, you will both pay for this!', 14, 0, 100, 0, 0, 0, 18349, 0, 0, 0, 'Arzeth the Powerless to Player');
INSERT INTO `creature_text` VALUES (19362, 4, 0, '%s is furious!', 16, 0, 100, 0, 0, 0, 38630, 3000, 3000, 0, 'Кор\'кронский защитник');
INSERT INTO `creature_text` VALUES (19389, 4, 0, '%s makes a deafening roar and calls for help!', 16, 0, 100, 0, 0, 11367, 2441, 68017, 68017, 0, 'Громила из логова');
INSERT INTO `creature_text` VALUES (19392, 3, 0, 'INFERNALS! CLEAR THE COURTYARD!', 14, 7, 100, 0, 0, 0, 16574, 8538235, 8538235, 0, 'Watch Commander Leonus to Sergeant Altumus');
INSERT INTO `creature_text` VALUES (19395, 0, 0, '%s blinks, a perplexed expression crossing his face.', 16, 0, 100, 0, 0, 0, 16587, 0, 0, 0, 'Bron Goldhammer');
INSERT INTO `creature_text` VALUES (19395, 1, 0, 'What, with me fists?', 12, 0, 100, 6, 0, 0, 16588, 0, 0, 0, 'Bron Goldhammer');
INSERT INTO `creature_text` VALUES (19395, 2, 0, 'I\'m... not sure that\'s a good idea, \'Moke. Ye might get hurt...', 12, 0, 100, 1, 0, 0, 16590, 0, 0, 0, 'Bron Goldhammer');
INSERT INTO `creature_text` VALUES (19395, 3, 0, 'Er... \'Moke?', 12, 0, 100, 6, 0, 0, 16592, 0, 0, 0, 'Bron Goldhammer');
INSERT INTO `creature_text` VALUES (19410, 4, 0, '%s attempts to run away in fear!', 16, 0, 100, 0, 0, 0, 1150, 18156, 18156, 0, 'Shattered Hand Neophyte');
INSERT INTO `creature_text` VALUES (19411, 4, 0, '%s attempts to run away in fear!', 16, 0, 100, 0, 0, 0, 1150, 32453, 32453, 0, 'Shattered Hand Warlock');
INSERT INTO `creature_text` VALUES (19411, 4, 0, '%s is trying to escape in a panic!', 16, 0, 100, 0, 0, 0, 1150, 45000, 45000, 0, 'Чернокнижник клана Изувеченной Длани');
INSERT INTO `creature_text` VALUES (19412, 0, 0, 'Легкий ветерок обдувает ваше лицо. В комнате раздается нежное, мелодичное жужжание.', 16, 0, 100, 0, 0, 10518, 16804, 0, 0, 0, 'Д\'оре to Player');
INSERT INTO `creature_text` VALUES (19422, 4, 0, '%s is trying to escape in a panic!', 16, 0, 100, 0, 0, 0, 1150, 5000, 5000, 0, 'Некролит из клана Кровавой Глазницы');
INSERT INTO `creature_text` VALUES (19424, 4, 0, '%s attempts to run away in fear!', 16, 0, 100, 0, 0, 0, 1150, 6672, 6672, 31553, 'Bleeding Hollow Tormentor to Player');
INSERT INTO `creature_text` VALUES (19424, 4, 0, '%s is trying to escape in a panic!', 16, 0, 100, 0, 0, 0, 1150, 11000, 11000, 31553, 'Мучитель из клана Кровавой Глазницы to Player');
INSERT INTO `creature_text` VALUES (19440, 0, 0, 'You are spotted by the %s!', 16, 0, 100, 0, 0, 0, 96818, 0, 0, 0, 'Eye of Grillok to Player');
INSERT INTO `creature_text` VALUES (19440, 1, 0, 'Вас замечает %s!', 16, 0, 100, 0, 0, 0, 96818, 0, 0, 0, 'Око Гриллока to Player');
INSERT INTO `creature_text` VALUES (19442, 1, 0, '%s зовет своих воргов.', 16, 0, 100, 0, 0, 0, 17593, 0, 0, 0, 'Повелитель воргов Крууш to Player');
INSERT INTO `creature_text` VALUES (19442, 4, 0, '%s goes into a frenzy!', 16, 0, 100, 0, 0, 0, 38630, 2125, 2125, 8599, 'Worg Master Kruush');
INSERT INTO `creature_text` VALUES (19442, 4, 0, '%s is furious!', 16, 0, 100, 0, 0, 0, 38630, 24000, 24000, 8599, 'Повелитель воргов Крууш');
INSERT INTO `creature_text` VALUES (19456, 0, 0, 'What good does this violence serve?  What is done is done.  I have failed my people.', 12, 0, 50, 0, 0, 0, 16774, 0, 0, 0, 'Whitebark\'s Spirit - 19456');
INSERT INTO `creature_text` VALUES (19456, 0, 1, 'Haven\'t you done enough harm?  Must you also disturb my slumber?', 12, 0, 50, 0, 0, 0, 16773, 0, 0, 0, 'Whitebark\'s Spirit - 19456');
INSERT INTO `creature_text` VALUES (19457, 4, 0, '%s is trying to escape in a panic!', 16, 0, 100, 0, 0, 0, 1150, 10000, 10000, 0, 'Гриллок \"Пустой Глаз\"');
INSERT INTO `creature_text` VALUES (19458, 4, 0, '%s is trying to escape in a panic!', 16, 0, 100, 0, 0, 0, 1150, 3000, 3000, 0, 'Ррык to Повелитель воргов Крууш');
INSERT INTO `creature_text` VALUES (19459, 4, 0, '%s is trying to escape in a panic!', 16, 0, 100, 0, 0, 0, 1150, 4000, 4000, 0, 'Фенг to Повелитель воргов Крууш');
INSERT INTO `creature_text` VALUES (19480, 0, 0, 'What... What have I become? Arrrgghhh...', 12, 0, 100, 21, 0, 0, 16835, 0, 0, 0, 'Darkened Spirit');
INSERT INTO `creature_text` VALUES (19516, 1, 0, 'Внимание! Вы подлежите уничтожению!', 14, 0, 100, 0, 0, 11213, 20906, 0, 0, 0, 'Страж Бездны to Player');
INSERT INTO `creature_text` VALUES (19516, 2, 0, 'Отключение системы...', 14, 0, 100, 0, 0, 11214, 88224, 0, 0, 0, 'Страж Бездны to Player');
INSERT INTO `creature_text` VALUES (19516, 4, 0, 'Принятие альтернативных мер.', 14, 0, 100, 0, 0, 11218, 20911, 9884, 79133, 34162, 'Страж Бездны');
INSERT INTO `creature_text` VALUES (19523, 0, 0, 'Smash!', 14, 0, 100, 0, 0, 10306, 44864, 0, 0, 0, 'omrogg GoCombat_1');
INSERT INTO `creature_text` VALUES (19523, 1, 0, 'If you nice me let you live.', 14, 0, 100, 0, 0, 10308, 14048, 0, 0, 0, 'omrogg GoCombat_2');
INSERT INTO `creature_text` VALUES (19523, 2, 0, 'Me hungry!', 14, 0, 100, 0, 0, 10309, 16918, 0, 0, 0, 'omrogg GoCombat_3');
INSERT INTO `creature_text` VALUES (19523, 3, 0, 'You stay here. Me go kill someone else!', 14, 0, 100, 0, 0, 10303, 0, 0, 0, 0, 'omrogg Threat_1');
INSERT INTO `creature_text` VALUES (19523, 4, 0, 'Me kill someone else...', 14, 0, 100, 0, 0, 10302, 0, 0, 0, 0, 'omrogg Threat_3');
INSERT INTO `creature_text` VALUES (19523, 5, 0, 'Me not like this one...', 14, 0, 100, 0, 0, 10300, 14043, 0, 0, 0, 'omrogg Threat_4');
INSERT INTO `creature_text` VALUES (19523, 6, 0, 'Me get bored...', 14, 0, 100, 0, 0, 10305, 0, 0, 0, 0, 'omrogg ThreatDelay1_2');
INSERT INTO `creature_text` VALUES (19523, 7, 0, 'Ha ha ha.', 14, 0, 100, 0, 0, 10304, 16900, 0, 0, 0, 'omrogg ThreatDelay2_1');
INSERT INTO `creature_text` VALUES (19523, 8, 0, 'H\'ey...', 14, 0, 100, 0, 0, 10307, 0, 0, 0, 0, 'omrogg ThreatDelay2_3');
INSERT INTO `creature_text` VALUES (19523, 9, 0, 'We kill his friend!', 14, 0, 100, 0, 0, 10301, 14045, 0, 0, 0, 'omrogg ThreatDelay2_4');
INSERT INTO `creature_text` VALUES (19523, 10, 0, 'This one die easy!', 14, 0, 100, 0, 0, 10310, 16922, 0, 0, 0, 'omrogg Killing_1');
INSERT INTO `creature_text` VALUES (19523, 11, 0, 'That\'s because I do all the hard work!', 14, 0, 100, 0, 0, 10321, 16923, 0, 0, 0, 'omrogg KillingDelay_2');
INSERT INTO `creature_text` VALUES (19524, 0, 0, 'Why don\'t you let me do the talking?', 14, 0, 100, 0, 0, 10317, 14047, 0, 0, 0, 'omrogg GoCombatDelay_1');
INSERT INTO `creature_text` VALUES (19524, 1, 0, 'No, we will NOT let you live!', 14, 0, 100, 0, 0, 10318, 16916, 0, 0, 0, 'omrogg GoCombatDelay_2');
INSERT INTO `creature_text` VALUES (19524, 2, 0, 'You always hungry. That why we so fat!', 14, 0, 100, 0, 0, 10319, 16919, 0, 0, 0, 'omrogg GoCombatDelay_3');
INSERT INTO `creature_text` VALUES (19524, 3, 0, 'What are you doing!', 14, 0, 100, 0, 0, 10315, 0, 0, 0, 0, 'omrogg Threat_2');
INSERT INTO `creature_text` VALUES (19524, 4, 0, 'That\'s not funny!', 14, 0, 100, 0, 0, 10314, 16899, 0, 0, 0, 'omrogg ThreatDelay1_1');
INSERT INTO `creature_text` VALUES (19524, 5, 0, 'I\'m not done yet, idiot!', 14, 0, 100, 0, 0, 10313, 16896, 0, 0, 0, 'omrogg ThreatDelay1_3');
INSERT INTO `creature_text` VALUES (19524, 6, 0, 'Hey you numbskull!', 14, 0, 100, 0, 0, 10312, 0, 0, 0, 0, 'omrogg ThreatDelay1_4');
INSERT INTO `creature_text` VALUES (19524, 7, 0, 'Whhy! He almost dead!', 14, 0, 100, 0, 0, 10316, 0, 0, 0, 0, 'omrogg ThreatDelay2_2');
INSERT INTO `creature_text` VALUES (19524, 8, 0, 'I\'m tired. You kill next one!', 14, 0, 100, 0, 0, 10320, 0, 0, 0, 0, 'omrogg Killing_2');
INSERT INTO `creature_text` VALUES (19524, 9, 0, 'That\'s because I do all the hard work!', 14, 0, 100, 0, 0, 10321, 16923, 0, 0, 0, 'omrogg KillingDelay_1');
INSERT INTO `creature_text` VALUES (19527, 1, 0, '%s поглощает Теневую энергию противника.', 16, 0, 100, 0, 0, 0, 0, 0, 0, 34338, 'Зыбкий призыватель Бездны to Зыбкий призыватель Бездны');
INSERT INTO `creature_text` VALUES (19527, 4, 0, '%s впитывает ледяную энергию атаки.', 16, 0, 100, 0, 0, 0, 17106, 10000, 10000, 34334, 'Зыбкий призыватель Бездны to Зыбкий призыватель Бездны');
INSERT INTO `creature_text` VALUES (19533, 0, 0, 'A tradesman, perhaps? You need look no further than I for supplies. My prices are quite fair, friend. These items were difficult to acquire, but what does the source matter, eh? You\'ll have what you need.', 12, 0, 100, 1, 0, 0, 17004, 0, 0, 0, 'Dealer Aljaan');
INSERT INTO `creature_text` VALUES (19534, 0, 0, 'The creatures of this place are strong, wayfarer. You\'ll need ample ammunition if you hope to survive. You\'re in luck - I am well-stocked with fine arrows, bullets, and throwing weapons. The price is reasonable, considering circumstances.', 12, 0, 100, 1, 0, 0, 17002, 0, 0, 0, 'Dealer Digriz');
INSERT INTO `creature_text` VALUES (19541, 3, 0, 'Хм, волшебные уничтожители очень сильны. Интересно, Папаша Колесун вообще знает, чего он просит?', 12, 0, 100, 1, 0, 0, 17116, 16333, 16333, 0, 'Посланник Пустоверти');
INSERT INTO `creature_text` VALUES (19544, 0, 0, 'I\'ve had my fill of this place. Let us depart.', 12, 0, 100, 1, 0, 0, 31942, 0, 0, 0, 'Smart Text');
INSERT INTO `creature_text` VALUES (19544, 1, 0, 'You must tell my brothers that I live.', 12, 0, 100, 1, 0, 0, 31944, 0, 0, 0, 'Smart Text');
INSERT INTO `creature_text` VALUES (19558, 0, 0, 'Guards!', 14, 1, 100, 0, 0, 0, 4583, 0, 0, 0, 'Amilya Airheart');
INSERT INTO `creature_text` VALUES (19561, 3, 0, 'Послушай, ничтожество. Я слепой, а не глухой. Так что не думай даже.', 12, 1, 100, 1, 0, 0, 16990, 4057000, 4057000, 0, 'Хагаш Слепой to Траллмарский рубака');
INSERT INTO `creature_text` VALUES (19606, 0, 0, 'Grek try!', 12, 0, 100, 1, 0, 0, 17069, 0, 0, 0, 'GossipSelectText');
INSERT INTO `creature_text` VALUES (19606, 1, 0, 'This oil no good for Grek! What Grek look like to you, some weakling in robes?', 12, 0, 100, 1, 0, 0, 17070, 0, 0, 0, 'GossipSelectText');
INSERT INTO `creature_text` VALUES (19622, 0, 0, 'Energy. Power. My people are addicted to it... a dependence made manifest after the Sunwell was destroyed. Welcome to the future. A pity you are too late to stop it. No one can stop me now! Selama ashal\'anore!', 14, 0, 100, 0, 0, 11256, 20195, 0, 0, 0, 'kaelthas SAY_INTRO');
INSERT INTO `creature_text` VALUES (19622, 1, 0, 'Capernian will see to it that your stay here is a short one.', 14, 0, 100, 0, 0, 11257, 19004, 0, 0, 0, 'kaelthas SAY_INTRO_CAPERNIAN');
INSERT INTO `creature_text` VALUES (19622, 2, 0, 'Well done, you have proven worthy to test your skills against my master engineer, Telonicus.', 14, 0, 100, 0, 0, 11258, 19005, 0, 0, 0, 'kaelthas SAY_INTRO_TELONICUS');
INSERT INTO `creature_text` VALUES (19622, 3, 0, 'Let us see how your nerves hold up against the Darkener, Thaladred! ', 14, 0, 100, 0, 0, 11259, 19006, 0, 0, 0, 'kaelthas SAY_INTRO_THALADRED');
INSERT INTO `creature_text` VALUES (19622, 4, 0, 'You have persevered against some of my best advisors... but none can withstand the might of the Blood Hammer. Behold, Lord Sanguinar!', 14, 0, 100, 0, 0, 11260, 19003, 0, 0, 0, 'kaelthas SAY_INTRO_SANGUINAR');
INSERT INTO `creature_text` VALUES (19622, 5, 0, 'As you see, I have many weapons in my arsenal....', 14, 0, 100, 0, 0, 11261, 19053, 0, 0, 0, 'kaelthas SAY_PHASE2_WEAPON');
INSERT INTO `creature_text` VALUES (19622, 6, 0, 'Perhaps I underestimated you. It would be unfair to make you fight all four advisors at once, but... fair treatment was never shown to my people. I\'m just returning the favor.', 14, 0, 100, 0, 0, 11262, 19060, 0, 0, 0, 'kaelthas SAY_PHASE3_ADVANCE');
INSERT INTO `creature_text` VALUES (19622, 7, 0, 'Alas, sometimes one must take matters into one\'s own hands. Balamore shanal!', 14, 0, 100, 0, 0, 11263, 19195, 0, 0, 0, 'kaelthas SAY_PHASE4_INTRO2');
INSERT INTO `creature_text` VALUES (19622, 8, 0, 'I have not come this far to be stopped! The future I have planned will not be jeopardized! Now you will taste true power!!', 14, 0, 100, 0, 0, 11273, 20208, 0, 0, 0, 'kaelthas SAY_PHASE5_NUTS');
INSERT INTO `creature_text` VALUES (19622, 9, 0, 'You will not prevail!', 14, 0, 100, 0, 0, 11270, 20204, 0, 0, 0, 'kaelthas SAY_SLAY1');
INSERT INTO `creature_text` VALUES (19622, 9, 1, 'You gambled. And lost.', 14, 0, 100, 0, 0, 11271, 20205, 0, 0, 0, 'kaelthas SAY_SLAY2');
INSERT INTO `creature_text` VALUES (19622, 9, 2, 'This was child\'s play.', 14, 0, 100, 0, 0, 11272, 20206, 0, 0, 0, 'kaelthas SAY_SLAY3');
INSERT INTO `creature_text` VALUES (19622, 10, 0, 'Obey me!', 14, 0, 100, 0, 0, 11268, 20202, 0, 0, 0, 'kaelthas SAY_MINDCONTROL1');
INSERT INTO `creature_text` VALUES (19622, 10, 1, 'Bow to my will.', 14, 0, 100, 0, 0, 11269, 18259, 0, 0, 0, 'kaelthas SAY_MINDCONTROL2');
INSERT INTO `creature_text` VALUES (19622, 11, 0, 'Let us see how you fare when your world is turned upside down.', 14, 0, 100, 0, 0, 11264, 20198, 0, 0, 0, 'kaelthas SAY_GRAVITYLAPSE1');
INSERT INTO `creature_text` VALUES (19622, 11, 1, 'Having trouble staying grounded?', 14, 0, 100, 0, 0, 11265, 20199, 0, 0, 0, 'kaelthas SAY_GRAVITYLAPSE2');
INSERT INTO `creature_text` VALUES (19622, 12, 0, 'Anar\'anel belore!', 14, 0, 100, 0, 0, 11267, 20201, 0, 0, 0, 'kaelthas SAY_SUMMON_PHOENIX1');
INSERT INTO `creature_text` VALUES (19622, 12, 1, 'By the power of the sun!', 14, 0, 100, 0, 0, 11266, 20200, 0, 0, 0, 'kaelthas SAY_SUMMON_PHOENIX2');
INSERT INTO `creature_text` VALUES (19622, 13, 0, 'For... Quel\'...Thalas!', 14, 0, 100, 0, 0, 11274, 20207, 0, 0, 0, 'kaelthas SAY_DEATH');
INSERT INTO `creature_text` VALUES (19632, 4, 0, '%s falls into a frenzy!', 16, 0, 100, 0, 0, 0, 30726, 15970, 36632, 34392, 'Светящийся острожал');
INSERT INTO `creature_text` VALUES (19645, 3, 0, 'Чубис, когда управишься, не забудь нанести еще слой полировки на Колесомобиль. Я хочу сегодня вечером взять маму на прогулку.', 12, 0, 100, 5, 0, 0, 19380, 113205, 113205, 0, 'Папаша Колесун');
INSERT INTO `creature_text` VALUES (19684, 0, 0, 'Сам Кадгар велел тебе все показать? Должно быть, ты $gпроизвел:произвела; на него хорошее впечатление, $n.', 12, 0, 100, 0, 0, 147, 17283, 0, 0, 0, 'Хаггард Ветеран to Player');
INSERT INTO `creature_text` VALUES (19684, 3, 0, 'Khadgar himself is showing you around?  You must have made a good impression, $n.', 12, 0, 100, 0, 0, 149, 17283, 96093, 96093, 0, 'Haggard War Veteran to Player');
INSERT INTO `creature_text` VALUES (19685, 0, 0, 'Follow me, stranger.  This won\'t take long.', 12, 0, 100, 0, 0, 0, 17239, 0, 0, 0, 'Khadgar\'s Servant to Player');
INSERT INTO `creature_text` VALUES (19685, 1, 0, 'Shattrath was once the draenei capital of this world. Its name means \"dwelling of light.\"', 15, 0, 100, 0, 0, 147, 17240, 0, 0, 0, 'Khadgar\'s Servant to Player');
INSERT INTO `creature_text` VALUES (19685, 2, 0, 'When the Burning Legion turned the orcs against the draenei, the fiercest battle was fought here. The draenei fought tooth and nail, but in the end the city fell.', 15, 0, 100, 0, 0, 147, 17268, 0, 0, 0, 'Khadgar\'s Servant to Player');
INSERT INTO `creature_text` VALUES (19685, 3, 0, 'The city was left in ruins and darkness... until the Sha\'tar arrived.', 15, 0, 100, 0, 0, 147, 17269, 0, 0, 0, 'Khadgar\'s Servant to Player');
INSERT INTO `creature_text` VALUES (19685, 4, 0, 'Let us go into the Lower City.  I will warn you that as one of the only safe havens in Outland, Shattrath has attracted droves of refugees from all wars, current and past.', 15, 0, 100, 0, 0, 147, 17270, 0, 0, 0, 'Khadgar\'s Servant to Player');
INSERT INTO `creature_text` VALUES (19685, 5, 0, 'The Sha\'tar, or \"born from light\" are the naaru that came to Outland to fight the demons of the Burning Legion.', 15, 0, 100, 0, 0, 0, 17242, 0, 0, 0, 'Khadgar\'s Servant to Player');
INSERT INTO `creature_text` VALUES (19685, 6, 0, 'They were drawn to the ruins of Shattrath City where a small remnant of the draenei priesthood conducted its rites inside a ruined temple on this very spot.\n', 15, 0, 100, 0, 0, 0, 17271, 0, 0, 0, 'Khadgar\'s Servant to Player');
INSERT INTO `creature_text` VALUES (19685, 7, 0, 'The priesthood, known as the Aldor, quickly regained its strength as word spread that the naaru had returned and reconstruction soon began.  The ruined temple is now used as an infirmary for injured refugees.', 15, 0, 100, 0, 0, 0, 17272, 0, 0, 0, 'Khadgar\'s Servant to Player');
INSERT INTO `creature_text` VALUES (19685, 8, 0, 'It wouldn\'t be long, however, before the city came under attack once again.  This time, the attack came from Illidan\'s armies. A large regiment of blood elves had been sent by Illidan\'s ally, Kael\'thas Sunstrider, to lay waste to the city.', 15, 0, 100, 0, 0, 1002, 17245, 0, 0, 0, 'Khadgar\'s Servant to Player');
INSERT INTO `creature_text` VALUES (19685, 9, 0, 'As the regiment of blood elves crossed this very bridge, the Aldor\'s exarchs and vindicators lined up to defend the Terrace of Light.  But then the unexpected happened.\n', 15, 0, 100, 0, 0, 7080, 17274, 0, 0, 0, 'Khadgar\'s Servant to Player');
INSERT INTO `creature_text` VALUES (19685, 10, 0, 'The blood elves laid down their weapons in front of the city\'s defenders; their leader, a blood elf elder known as Voren\'thal, stormed into the Terrace of Light and demanded to speak to A\'dal.', 15, 0, 100, 0, 0, 7080, 17247, 0, 0, 0, 'Khadgar\'s Servant to Player');
INSERT INTO `creature_text` VALUES (19685, 11, 0, 'As the naaru approached him, Voren\'thal kneeled before him and uttered the following words: \"I\'ve seen you in a vision, naaru. My race\'s only hope for survival lies with you. My followers and I are here to serve you.\"', 15, 0, 100, 0, 0, 134, 17275, 0, 0, 0, 'Khadgar\'s Servant to Player');
INSERT INTO `creature_text` VALUES (19685, 12, 0, 'The defection of Voren\'thal and his followers was the largest loss ever incurred by Kael\'s forces. And these weren\'t just any blood elves.  Many of the best and brightest amongst Kael\'s scholars and magisters had been swayed by Voren\'thal\'s influence.\n', 15, 0, 100, 0, 0, 0, 17250, 0, 0, 0, 'Khadgar\'s Servant to Player');
INSERT INTO `creature_text` VALUES (19685, 13, 0, 'The naaru accepted the defectors, who would be known as the Scryers; their dwelling lies in the platform above.  Only those initiated with the Scryers are allowed there.', 15, 0, 100, 0, 0, 0, 17276, 0, 0, 0, 'Khadgar\'s Servant to Player');
INSERT INTO `creature_text` VALUES (19685, 14, 0, 'The Aldor are followers of the Light and forgiveness and redemption are values they understand. However, they found hard to forget the deeds of the blood elves while under Kael\'s command.', 15, 0, 100, 0, 0, 0, 17253, 0, 0, 0, 'Khadgar\'s Servant to Player');
INSERT INTO `creature_text` VALUES (19685, 15, 0, 'Many of the priesthood had been slain by the same magisters who now vowed to serve the naaru.  They were not happy to share the city with their former enemies.', 15, 0, 100, 0, 0, 0, 17277, 0, 0, 0, 'Khadgar\'s Servant to Player');
INSERT INTO `creature_text` VALUES (19685, 16, 0, 'The Aldor\'s most holy temple and its surrounding dwellings lie on the terrace above.  As a holy site, only the initiated are welcome inside.\n', 15, 0, 100, 0, 0, 0, 17278, 0, 0, 0, 'Khadgar\'s Servant to Player');
INSERT INTO `creature_text` VALUES (19685, 17, 0, 'The attacks against Shattrath continued, but the city did not fall, as you can see. On the contrary, the naaru known as Xi\'ri led a successful incursion into Shadowmoon Valley - Illidan\'s doorstep.', 15, 0, 100, 0, 0, 0, 17257, 0, 0, 0, 'Khadgar\'s Servant to Player');
INSERT INTO `creature_text` VALUES (19685, 18, 0, 'There he continues to wage war on Illidan with the assistance of the Aldor and the Scryers.  The two factions have not given up on their old feuds, though.', 15, 0, 100, 0, 0, 0, 17279, 0, 0, 0, 'Khadgar\'s Servant to Player');
INSERT INTO `creature_text` VALUES (19685, 19, 0, 'Such is their animosity that they vie for the honor of being sent to assist the naaru there. Each day, that decision is made here by A\'dal.  The armies gather here to receive A\'dal\'s blessing before heading to Shadowmoon.', 15, 0, 100, 0, 0, 0, 17280, 0, 0, 0, 'Khadgar\'s Servant to Player');
INSERT INTO `creature_text` VALUES (19685, 20, 0, 'Khadgar should be ready to see you again.  Just remember that to serve the Sha\'tar you will most likely have to ally with the Aldor or the Scryers. And seeking the favor of one group will cause the others\' dislike.\n', 15, 0, 100, 0, 0, 0, 17262, 0, 0, 0, 'Khadgar\'s Servant to Player');
INSERT INTO `creature_text` VALUES (19685, 21, 0, 'Good luck stranger, and welcome to Shattrath City.', 15, 0, 100, 0, 0, 0, 17281, 0, 0, 0, 'Khadgar\'s Servant to Player');
INSERT INTO `creature_text` VALUES (19685, 22, 0, 'Let\'s get to the others, and keep an eye open for those wolves cutside...', 12, 0, 100, 0, 0, 0, 481, 0, 0, 0, 'Khadgar\'s Servant');
INSERT INTO `creature_text` VALUES (19685, 23, 0, 'Be careful, $N. Those wolves like to hide among the trees.', 12, 0, 100, 0, 0, 0, 482, 0, 0, 0, 'Khadgar\'s Servant');
INSERT INTO `creature_text` VALUES (19685, 24, 0, 'A $C attacks!', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Khadgar\'s Servant');
INSERT INTO `creature_text` VALUES (19685, 24, 1, 'Oh no! A $C is upon us!', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Khadgar\'s Servant');
INSERT INTO `creature_text` VALUES (19685, 25, 0, 'Beware! I am under attack!', 12, 0, 100, 0, 0, 0, 544, 0, 0, 0, 'Khadgar\'s Servant');
INSERT INTO `creature_text` VALUES (19685, 26, 0, 'We\'re almost there!', 12, 0, 100, 0, 0, 0, 483, 0, 0, 0, 'Khadgar\'s Servant');
INSERT INTO `creature_text` VALUES (19685, 28, 0, 'It\'s good to see you again, Erland. What is your report?', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Khadgar\'s Servant');
INSERT INTO `creature_text` VALUES (19685, 29, 0, 'Masses of wolves are to the east, and whoever lived at Malden\'s Orchard is gone.', 12, 0, 100, 0, 0, 0, 535, 0, 0, 0, 'Khadgar\'s Servant');
INSERT INTO `creature_text` VALUES (19685, 30, 0, 'If I am excused, then I\'d like to check on Quinn...', 12, 0, 100, 0, 0, 0, 536, 0, 0, 0, 'Khadgar\'s Servant');
INSERT INTO `creature_text` VALUES (19685, 32, 0, 'I\'ve been better. Ivar the Foul got the better of me...', 12, 0, 100, 0, 0, 0, 539, 0, 0, 0, 'Khadgar\'s Servant');
INSERT INTO `creature_text` VALUES (19701, 4, 0, '%s is trying to escape in a panic!', 16, 0, 100, 0, 0, 0, 1150, 4000, 4000, 0, 'Вызыватель из клана Костеглодов');
INSERT INTO `creature_text` VALUES (19710, 0, 0, 'Жить вам осталось около пяти секунд.', 14, 0, 100, 0, 0, 11109, 20033, 0, 0, 0, 'Страж ворот Стальная Клешня to Player');
INSERT INTO `creature_text` VALUES (19710, 1, 0, '%s угрожающе поднимает свой молот...', 41, 0, 100, 0, 0, 11113, 20710, 0, 0, 0, 'Страж ворот Стальная Клешня to Страж ворот Стальная Клешня');
INSERT INTO `creature_text` VALUES (19710, 2, 0, 'Примитивно, но эффективно.', 14, 0, 100, 0, 0, 11113, 20029, 0, 0, 0, 'Страж ворот Стальная Клешня to 0');
INSERT INTO `creature_text` VALUES (19710, 3, 0, 'Мои расчеты не... оправдались...', 14, 0, 100, 0, 0, 11114, 20030, 0, 0, 0, 'Страж ворот Стальная Клешня to Player');
INSERT INTO `creature_text` VALUES (19710, 4, 0, 'Ты слышишь тихий звук отпираемого замка...', 16, 0, 100, 0, 0, 11114, 19055, 0, 0, 0, 'Страж ворот Стальная Клешня to Player');
INSERT INTO `creature_text` VALUES (19720, 0, 0, 'Time to teach you a lesson in manners, little $Gboy:girl;!', 12, 0, 100, 1, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (19720, 1, 0, 'Now I\'m gonna give you to the count of \'3\' to get out of here before I sick the dogs on you.', 12, 0, 100, 1, 0, 0, 17354, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (19720, 2, 0, '1...', 12, 0, 100, 0, 0, 0, 66169, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (19720, 3, 0, '2...', 12, 0, 100, 0, 0, 0, 66168, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (19720, 4, 0, 'Time to meet your maker!', 12, 0, 100, 1, 0, 0, 17357, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (19720, 5, 0, 'Alright, we give up! Don\'t hurt us!', 12, 0, 100, 0, 0, 0, 17361, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (19792, 3, 0, 'Слушаюсь!', 12, 0, 100, 66, 0, 0, 118627, 4165, 4165, 0, 'Центурион лагеря Затмения to Кровостраж лагеря Затмения');
INSERT INTO `creature_text` VALUES (19827, 4, 0, '%s falls into a frenzy!', 16, 0, 100, 0, 0, 0, 30726, 5000, 5000, 8599, 'Враностраж из Темного конклава');
INSERT INTO `creature_text` VALUES (19830, 0, 0, 'You cannot be serious! We are severely understaffed and can barely keep this manaforge functional!', 12, 0, 100, 0, 0, 0, 18166, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (19830, 1, 0, 'Yes, my lord.', 12, 0, 100, 0, 0, 0, 19189, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (19831, 0, 0, 'We need you to send reinforcements to Manaforge Duro, Ardonis. This is not a request, it\'s an order.', 12, 0, 100, 0, 0, 0, 18165, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (19831, 1, 0, 'You will do as ordered. Manaforge Duro has come under heavy attack by mana creatures and the situation is out of control. Failure to comply will not be tolerated!', 12, 0, 100, 0, 0, 0, 18167, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (19831, 2, 0, 'My lord!', 12, 0, 100, 0, 0, 0, 19186, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (19831, 3, 0, 'See to it, Ardonis!', 12, 0, 100, 0, 0, 0, 19190, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (19862, 3, 0, 'Смерть от рук Уртака!', 12, 0, 100, 0, 0, 0, 17457, 1000, 1000, 0, 'Уртрак to Player');
INSERT INTO `creature_text` VALUES (19864, 3, 0, 'Это наша месть! Вперед, братья мои!', 12, 0, 100, 0, 0, 0, 17458, 0, 0, 33900, 'Мстительный дух непреклонного капитана');
INSERT INTO `creature_text` VALUES (19934, 3, 0, 'Иди с миром, дитя.', 14, 0, 100, 0, 0, 0, 20522, 296636, 296636, 0, 'Заладорму to Страж времени');
INSERT INTO `creature_text` VALUES (19946, 0, 0, '%s зовет себе на помощь ближайшего раба!', 16, 0, 100, 0, 0, 0, 17532, 0, 0, 0, 'Поработитель из клана Темного Гребня to Player');
INSERT INTO `creature_text` VALUES (19947, 4, 0, '%s is trying to escape in a panic!', 16, 0, 100, 0, 0, 0, 1150, 5000, 5000, 6136, 'Колдунья из клана Темного Гребня');
INSERT INTO `creature_text` VALUES (20031, 3, 0, 'Наши мечи и заклинания наготове!', 14, 0, 100, 113, 0, 0, 18037, 87498, 87498, 0, 'Кровостраж-легионер to Кровостраж-маршал');
INSERT INTO `creature_text` VALUES (20035, 3, 0, 'Как и ты!', 14, 0, 100, 66, 0, 0, 18045, 92338, 92338, 0, 'Кровостраж-маршал to Кровостраж-маршал');
INSERT INTO `creature_text` VALUES (20040, 1, 0, 'Эта часть действует в настоящий момент с 95-процентной эффективностью.', 12, 0, 100, 1, 0, 0, 17820, 0, 0, 0, 'Кристаллиновый уничтожитель to Кузнец крепости');
INSERT INTO `creature_text` VALUES (20041, 4, 0, 'Рука |3-1(%s) начинает источать магическую энергию!', 16, 0, 100, 0, 0, 0, 19264, 24488, 24488, 0, 'Кристаллиновый часовой');
INSERT INTO `creature_text` VALUES (20042, 1, 0, 'После этого испытания на маневренность нам останется только в последний раз проверить вооружение – и все.', 12, 0, 100, 1, 0, 0, 17841, 0, 0, 37120, 'Кузнец крепости');
INSERT INTO `creature_text` VALUES (20042, 3, 0, 'Голем. Команда. Отчет о статусе операции.', 12, 0, 100, 1, 0, 0, 17818, 1397650, 1397650, 0, 'Кузнец крепости');
INSERT INTO `creature_text` VALUES (20060, 0, 0, 'Blood for blood!', 14, 0, 100, 0, 0, 11152, 20859, 0, 0, 0, 'sanguinar SAY_SANGUINAR_AGGRO');
INSERT INTO `creature_text` VALUES (20060, 1, 0, 'NO! I... will... not...', 14, 0, 100, 0, 0, 11153, 20858, 0, 0, 0, 'sanguinar SAY_SANGUINAR_DEATH');
INSERT INTO `creature_text` VALUES (20062, 0, 0, 'The sin\'dorei reign supreme!', 14, 0, 100, 0, 0, 11117, 20847, 0, 0, 0, 'capernian SAY_CAPERNIAN_AGGRO');
INSERT INTO `creature_text` VALUES (20062, 1, 0, 'This is not over!', 14, 0, 100, 0, 0, 11118, 20848, 0, 0, 0, 'capernian SAY_CAPERNIAN_DEATH');
INSERT INTO `creature_text` VALUES (20063, 0, 0, 'Anar\'alah belore!', 14, 0, 100, 0, 0, 11157, 21705, 0, 0, 0, 'telonicus SAY_TELONICUS_AGGRO');
INSERT INTO `creature_text` VALUES (20063, 1, 0, 'More perils... await...', 14, 0, 100, 0, 0, 11158, 20861, 0, 0, 0, 'telonicus SAY_TELONICUS_DEATH');
INSERT INTO `creature_text` VALUES (20064, 0, 0, 'Prepare yourselves!', 14, 0, 100, 0, 0, 11203, 35758, 0, 0, 0, 'thaladred SAY_THALADRED_AGGRO');
INSERT INTO `creature_text` VALUES (20064, 1, 0, 'Forgive me, my prince! I have... failed.', 14, 0, 100, 0, 0, 11204, 20904, 0, 0, 0, 'thaladred SAY_THALADRED_DEATH');
INSERT INTO `creature_text` VALUES (20064, 2, 0, '%s sets eyes on $n!', 16, 0, 100, 0, 0, 0, 11074, 0, 0, 0, 'thaladred EMOTE_THALADRED_GAZE');
INSERT INTO `creature_text` VALUES (20071, 0, 0, 'Let us hold our discussion in a more... private place. Follow me, $n.', 12, 0, 0, 1, 0, 0, 17615, 0, 0, 0, 'Smart Text');
INSERT INTO `creature_text` VALUES (20071, 1, 0, 'You didn\'t really think I\'d do business with you again, did you? Sometimes, the best way to return to profitability is to know when to cut your losses.', 12, 0, 0, 1, 0, 0, 17618, 0, 0, 0, 'Smart Text');
INSERT INTO `creature_text` VALUES (20079, 3, 0, 'Вас замечает %s!', 16, 0, 100, 0, 0, 0, 96818, 1315000, 1315000, 0, 'Караульный из клана Темного Гребня to Player');
INSERT INTO `creature_text` VALUES (20088, 1, 0, '%s зовет себе на помощь ближайшего раба!', 16, 0, 100, 0, 0, 0, 17532, 0, 0, 0, 'Надзиратель из клана Кровавой Чешуи to Player');
INSERT INTO `creature_text` VALUES (20102, 3, 0, 'Друиды Ночной Гавани пышно празднуют Лунный фестиваль у себя на Лунной поляне.', 12, 0, 100, 6, 0, 0, 24352, 0, 0, 0, 'Гоблин-обыватель to Гоблин-обыватель');
INSERT INTO `creature_text` VALUES (20102, 3, 0, 'Откуда эти замечательные зимние шапки?', 12, 0, 100, 0, 0, 0, 16503, 126000, 126000, 33227, 'Гоблин-обыватель to Гоблин-обыватель');
INSERT INTO `creature_text` VALUES (20115, 0, 0, '%s is trying to escape in a panic!', 16, 0, 100, 0, 0, 0, 1150, 0, 0, 0, 'Знахарь Тенетопи to 0');
INSERT INTO `creature_text` VALUES (20201, 3, 0, 'Стой! Ни шагу дальше! Ты не $gготов:готова; предстать перед силами рода Бесконечности. Иди, я помогу тебе.', 12, 0, 100, 5, 0, 0, 17814, 4875, 4875, 0, 'Са\'ат to Player');
INSERT INTO `creature_text` VALUES (20206, 3, 0, '%s buries his treat!', 16, 0, 100, 0, 0, 0, 20313, 7521063, 7521063, 0, 'Fei Fei to Player');
INSERT INTO `creature_text` VALUES (20206, 3, 0, '%s digs in the dirt...', 16, 0, 100, 35, 0, 0, 20312, 7472531, 7518219, 0, 'Fei Fei to Fei Fei Stash Bunny');
INSERT INTO `creature_text` VALUES (20206, 3, 0, '%s looks for a hiding spot...', 16, 0, 100, 0, 0, 0, 20316, 7468688, 7468688, 0, 'Fei Fei to Fei Fei Stash Bunny');
INSERT INTO `creature_text` VALUES (20206, 3, 0, '%s sniffs around, unsatisfied with this hiding spot.', 16, 0, 100, 0, 0, 0, 20315, 7476156, 7476156, 0, 'Fei Fei to Fei Fei Stash Bunny');
INSERT INTO `creature_text` VALUES (20206, 3, 0, '%s ищет тайник...', 16, 0, 100, 0, 0, 0, 20316, 353000, 497000, 0, 'Шар-Ик to Fei Fei Stash Bunny');
INSERT INTO `creature_text` VALUES (20206, 3, 0, '%s принюхивается, выражая недовольство тайником.', 16, 0, 100, 0, 0, 0, 20315, 504000, 504000, 0, 'Шар-Ик to Fei Fei Stash Bunny');
INSERT INTO `creature_text` VALUES (20206, 3, 0, '%s разгребает грязь...', 16, 0, 100, 35, 0, 0, 20312, 356000, 499000, 0, 'Шар-Ик to Fei Fei Stash Bunny');
INSERT INTO `creature_text` VALUES (20227, 3, 0, 'Looks like it\'s time to let you out of this cage.', 12, 0, 100, 1, 0, 0, 17925, 1048797, 1048797, 0, 'Apprentice Tedon to Player');
INSERT INTO `creature_text` VALUES (20227, 3, 0, 'Now, to put the neutralizing agent on it...', 12, 0, 100, 0, 0, 0, 17934, 1058500, 1058500, 0, 'Apprentice Tedon to Player');
INSERT INTO `creature_text` VALUES (20227, 3, 0, 'Success!', 12, 0, 100, 71, 0, 0, 87235, 1065766, 1065766, 0, 'Apprentice Tedon to Player');
INSERT INTO `creature_text` VALUES (20234, 0, 0, 'Guards!', 14, 7, 100, 0, 0, 0, 4583, 0, 0, 0, 'Runetog Wildhammer');
INSERT INTO `creature_text` VALUES (20239, 3, 0, 'As the neutralizing agent mixes into the waters of the lake, the water that was irradiated by the crystal seems to clear.', 16, 0, 100, 0, 0, 0, 17912, 413109, 413109, 0, 'Neutralizing Emote Placeholder to Player');
INSERT INTO `creature_text` VALUES (20242, 0, 0, 'The best selection of smuggled goods is available right here, $N.  Great for the whole family!  Avoid goblin taxation and naaru prohibition - the Consortium is here to fill your every shopping need!', 12, 0, 100, 1, 0, 0, 17916, 0, 0, 0, 'Karaaz');
INSERT INTO `creature_text` VALUES (20243, 0, 0, 'The Scrapped Fel Reaver\'s mechanical heart begins to beat softly.', 16, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'SmartText');
INSERT INTO `creature_text` VALUES (20281, 0, 0, 'Keep them off me!', 12, 0, 100, 0, 0, 0, 17950, 0, 0, 0, 'Texto al aggrear');
INSERT INTO `creature_text` VALUES (20281, 1, 0, 'Very well. Before we head down there, take a moment to prepare yourself.', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Texto al aceptar quest');
INSERT INTO `creature_text` VALUES (20281, 2, 0, 'Let\'s proceed at a brisk pace.', 12, 0, 100, 0, 0, 0, 17941, 0, 0, 0, 'Texto WP 1');
INSERT INTO `creature_text` VALUES (20281, 3, 0, 'We\'ll start at that first energy pylon, straight ahead. Remember, try to keep them off of me.', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Texto WP 2');
INSERT INTO `creature_text` VALUES (20281, 4, 0, 'I\'m done with this pylon. On to the next.', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Texto WP 3');
INSERT INTO `creature_text` VALUES (20281, 5, 0, 'Alright, pylon two down. Now for the heat mainfold.', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Texto WP 9');
INSERT INTO `creature_text` VALUES (20281, 6, 0, 'That should do it. The teleporter should blow any second now !', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Texto WP 13');
INSERT INTO `creature_text` VALUES (20281, 7, 0, 'Ok, let\'s get out of here!', 12, 0, 100, 0, 0, 0, 17946, 0, 0, 0, 'Texto WP 14');
INSERT INTO `creature_text` VALUES (20281, 8, 0, 'Thank you, $n! I couldn\'t have done it without you. You\'ll let Gahruj know?', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Texto WP 17 final');
INSERT INTO `creature_text` VALUES (20294, 0, 0, '%s is trying to escape in a panic!', 16, 0, 100, 0, 0, 0, 1150, 0, 0, 0, 'Крабстер-острощип to 0');
INSERT INTO `creature_text` VALUES (20295, 0, 0, '%s is trying to escape in a panic!', 16, 0, 100, 0, 0, 0, 1150, 0, 0, 0, 'Крабстер-сокрушитель to 0');
INSERT INTO `creature_text` VALUES (20415, 0, 0, 'Bessy, is that you?', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (20415, 1, 0, 'Thank you for bringing back my Bessy, $N. I couldn\'t live without her!', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (20454, 0, 0, 'Prepare to enter oblivion, meddlers. You have unleashed a god!', 14, 0, 100, 0, 0, 0, 18443, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (20610, 0, 0, '%s calls for the aid of a nearby male!', 16, 0, 100, 0, 0, 0, 19207, 0, 0, 0, 'Talbuk Doe');
INSERT INTO `creature_text` VALUES (20610, 1, 0, '%s seems to have weakened.', 16, 0, 100, 0, 0, 0, 18606, 0, 0, 0, 'Talbuk Doe');
INSERT INTO `creature_text` VALUES (20677, 0, 0, 'You\'ve freed me!  The winds speak to my people once again and grant us their strength.  I thank you, stranger.', 12, 0, 100, 1, 0, 0, 18358, 0, 0, 0, 'Morod the Windstirrer to Player');
INSERT INTO `creature_text` VALUES (20678, 0, 0, 'I am free!  I will ask the spirit of fire to return to us so that my people may have the courage to fight their masters!  I thank you, $r.', 12, 0, 100, 15, 0, 0, 18356, 0, 0, 0, 'Akoru the Firecaller to Player');
INSERT INTO `creature_text` VALUES (20679, 0, 0, 'I\'m free!  The spirit of water returns to my people.  It will bring us the wisdom we need to survive in this harsh land.  I am in your debt, $n.', 12, 0, 100, 1, 0, 0, 18357, 0, 0, 0, 'Aylaan the Waterwaker to Player');
INSERT INTO `creature_text` VALUES (20762, 0, 0, 'Guards!', 14, 1, 100, 0, 0, 0, 4583, 0, 0, 0, 'Gur\'zil');
INSERT INTO `creature_text` VALUES (20763, 0, 0, 'Commander! This fleshling rescued me!', 12, 0, 100, 1, 0, 0, 18567, 0, 0, 0, 'Smart Text');
INSERT INTO `creature_text` VALUES (20774, 0, 0, '%s goes into a frenzy!', 16, 0, 100, 0, 0, 0, 38630, 0, 0, 0, 'Farahlon Lasher');
INSERT INTO `creature_text` VALUES (20777, 0, 0, '%s seems to have weakened.', 16, 0, 100, 0, 0, 0, 18606, 0, 0, 0, 'Talbuk Sir');
INSERT INTO `creature_text` VALUES (20802, 0, 0, 'Let\'s do this... Just keep me covered and I\'ll deliver the package.', 12, 0, 100, 0, 0, 0, 18432, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (20802, 1, 0, 'Alright, keep me protected while I plant this disruptor. This shouldn\'t take very long.', 12, 0, 100, 0, 0, 0, 18436, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (20802, 2, 0, 'Looks like my work here is done. Report back to the holo-image of Ameer over at the transponder.', 12, 0, 100, 0, 0, 0, 18442, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (20812, 0, 0, 'This is the last time I get caught! I promise! Bye!', 12, 0, 100, 0, 0, 0, 15308, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (20870, 0, 0, 'Жизненная сила... пища.', 14, 0, 100, 0, 0, 11250, 20045, 0, 0, 0, 'Зерекет Бездонный to Player');
INSERT INTO `creature_text` VALUES (20870, 1, 0, 'Этот сосуд пуст.', 14, 0, 100, 0, 0, 11251, 20046, 0, 0, 0, 'Зерекет Бездонный to Player');
INSERT INTO `creature_text` VALUES (20870, 1, 1, 'Жизненная сила... кончилась.', 14, 0, 100, 0, 0, 11253, 20047, 0, 0, 0, 'Зерекет Бездонный to Player');
