INSERT INTO `creature_text` VALUES (20873, 4, 0, '%s: у основания концентрируется энергия Бездны!', 16, 0, 100, 0, 0, 0, 19392, 12336, 47466, 36813, 'Мастер искажения Негатона');
INSERT INTO `creature_text` VALUES (20875, 4, 0, '%s поглощает энергию света.', 16, 0, 100, 0, 0, 0, 17110, 1934, 1934, 0, 'Крикун Негатона to Крикун Негатона');
INSERT INTO `creature_text` VALUES (20880, 3, 0, 'Наше заключение было невыносимо. Чем скорее мы покинем это проклятое место, тем лучше.', 12, 0, 100, 1, 0, 0, 19131, 573844, 573844, 38845, 'Смертоносный эредар');
INSERT INTO `creature_text` VALUES (20885, 0, 0, 'Don\'t worry about me; kill that worthless dullard instead!', 14, 0, 100, 0, 0, 11085, 19979, 0, 0, 0, 'Dalliah the Doomsayer - Aggro Soccothrates First');
INSERT INTO `creature_text` VALUES (20885, 1, 0, 'It is unwise to anger me.', 14, 0, 100, 0, 0, 11086, 0, 0, 0, 0, 'Dalliah the Doomsayer - Aggro');
INSERT INTO `creature_text` VALUES (20885, 2, 0, 'Completely ineffective. Just like someone else I know.', 14, 0, 100, 0, 0, 11087, 0, 0, 0, 0, 'Dalliah the Doomsayer - Kill');
INSERT INTO `creature_text` VALUES (20885, 2, 1, 'You chose the wrong opponent.', 14, 0, 100, 0, 0, 11088, 19981, 0, 0, 0, 'Dalliah the Doomsayer - Kill');
INSERT INTO `creature_text` VALUES (20885, 3, 0, 'Reap the Whirlwind!', 14, 0, 100, 0, 0, 11089, 19982, 0, 0, 0, 'Dalliah the Doomsayer - Cast Whirlwind');
INSERT INTO `creature_text` VALUES (20885, 3, 1, 'I\'ll cut you to pieces!', 14, 0, 100, 0, 0, 11090, 91104, 0, 0, 0, 'Dalliah the Doomsayer - Cast Whirlwind');
INSERT INTO `creature_text` VALUES (20885, 4, 0, 'Ahh... That is much better.', 14, 0, 100, 0, 0, 11091, 0, 0, 0, 0, 'Dalliah the Doomsayer - Cast Heal');
INSERT INTO `creature_text` VALUES (20885, 4, 1, 'Ahh... Just what I needed.', 14, 0, 100, 0, 0, 11092, 19985, 0, 0, 0, 'Dalliah the Doomsayer - Cast Heal');
INSERT INTO `creature_text` VALUES (20885, 5, 0, 'Now I\'m really... angry...', 14, 0, 100, 0, 0, 11093, 0, 0, 0, 0, 'Dalliah the Doomsayer - Death');
INSERT INTO `creature_text` VALUES (20885, 6, 0, 'More than you can handle, scryer?', 14, 0, 100, 0, 0, 11094, 19987, 0, 0, 0, 'Dalliah the Doomsayer - Soccothrates at 25%');
INSERT INTO `creature_text` VALUES (20885, 6, 1, 'I suppose I\'ll end up fighting them all myself.', 14, 0, 100, 0, 0, 11095, 19988, 0, 0, 0, 'Dalliah the Doomsayer - Soccothrates at 25%');
INSERT INTO `creature_text` VALUES (20885, 6, 2, 'I\'ve grown used to cleaning up your messes.', 14, 0, 100, 0, 0, 11096, 19989, 0, 0, 0, 'Dalliah the Doomsayer - Soccothrates at 25%');
INSERT INTO `creature_text` VALUES (20885, 7, 0, 'Congratulations. I\'ve wanted to do that for years.', 14, 0, 100, 0, 0, 11097, 0, 0, 0, 0, 'Dalliah the Doomsayer - Soccothratess dies');
INSERT INTO `creature_text` VALUES (20886, 0, 0, 'Have you come to kill Dalliah? Can I watch?', 14, 0, 100, 0, 0, 11237, 0, 0, 0, 0, 'Wrath-Scryer Soccothrates - Aggro Dalliah First');
INSERT INTO `creature_text` VALUES (20886, 1, 0, 'At last, a target for my frustrations!', 14, 0, 100, 0, 0, 11238, 19967, 0, 0, 0, 'Wrath-Scryer Soccothrates - Aggro');
INSERT INTO `creature_text` VALUES (20886, 2, 0, 'Yes, that was quite satisfying', 14, 0, 100, 0, 0, 11239, 0, 0, 0, 0, 'Wrath-Scryer Soccothrates - Kill');
INSERT INTO `creature_text` VALUES (20886, 3, 0, 'On guard!', 14, 0, 100, 0, 0, 11241, 87865, 0, 0, 0, 'Wrath-Scryer Soccothrates - Charge');
INSERT INTO `creature_text` VALUES (20886, 3, 1, 'Defend yourself, for all the good it will do...', 14, 0, 100, 0, 0, 11242, 0, 0, 0, 0, 'Wrath-Scryer Soccothrates - Charge');
INSERT INTO `creature_text` VALUES (20886, 4, 0, 'Knew this was... the only way out', 14, 0, 100, 0, 0, 11243, 0, 0, 0, 0, 'Wrath-Scryer Soccothrates - Death');
INSERT INTO `creature_text` VALUES (20886, 5, 0, 'Having problems, Dalliah? How nice.', 14, 0, 100, 0, 0, 11244, 0, 0, 0, 0, 'Wrath-Scryer Soccothrates - Dalliah at 25%');
INSERT INTO `creature_text` VALUES (20886, 5, 1, 'This may be the end of you Dalliah, what a shame that would be.', 14, 0, 100, 0, 0, 11245, 0, 0, 0, 0, 'Wrath-Scryer Soccothrates - Dalliah at 25%');
INSERT INTO `creature_text` VALUES (20886, 5, 2, 'I suggest a new strategy, you draw the attackers while I gather reinforcements. Hahaha!', 14, 0, 100, 0, 0, 11246, 0, 0, 0, 0, 'Wrath-Scryer Soccothrates - Dalliah at 25%');
INSERT INTO `creature_text` VALUES (20886, 6, 0, 'Finally! Well done!', 14, 0, 100, 0, 0, 11247, 0, 0, 0, 0, 'Wrath-Scryer Soccothrates - Dalliah dies');
INSERT INTO `creature_text` VALUES (20904, 0, 0, 'I knew the prince would be angry, but I... I have not been myself. I had to let them out! The great one speaks to me, you see. Wait--outsiders. Kael\'thas did not send you! Good... I\'ll just tell the prince you released the prisoners!', 14, 0, 100, 0, 0, 11222, 19103, 0, 0, 0, 'Warden Mellichar');
INSERT INTO `creature_text` VALUES (20904, 1, 0, 'The naaru kept some of the most dangerous beings in existence here in these cells. Let me introduce you to another....', 14, 0, 100, 0, 0, 11223, 19104, 0, 0, 0, 'Warden Mellichar');
INSERT INTO `creature_text` VALUES (20904, 2, 0, 'Yes, yes... another! Your will is mine!', 14, 0, 100, 0, 0, 11224, 19106, 0, 0, 0, 'Warden Mellichar');
INSERT INTO `creature_text` VALUES (20904, 3, 0, 'Behold, yet another terrifying creature of incomprehensible power!', 14, 0, 100, 0, 0, 11225, 19107, 0, 0, 0, 'Warden Mellichar');
INSERT INTO `creature_text` VALUES (20904, 4, 0, 'What is this? A lowly gnome? I will do better, oh great one.', 14, 0, 100, 0, 0, 11226, 19109, 0, 0, 0, 'Warden Mellichar');
INSERT INTO `creature_text` VALUES (20904, 5, 0, 'Anarchy! Bedlam! Oh, you are so wise! Yes, I see it now, of course!', 14, 0, 100, 0, 0, 11227, 19110, 0, 0, 0, 'Warden Mellichar');
INSERT INTO `creature_text` VALUES (20904, 6, 0, 'One final cell remains. Yes, O great one, right away!', 14, 0, 100, 0, 0, 11228, 19111, 0, 0, 0, 'Warden Mellichar');
INSERT INTO `creature_text` VALUES (20904, 7, 0, 'Welcome, O great one. I am your humble servant.', 14, 0, 100, 0, 0, 11229, 19114, 0, 0, 0, 'Warden Mellichar');
INSERT INTO `creature_text` VALUES (20907, 0, 0, 'A-Me home! A-Me good! Good A-Me. Home. Home. Home.', 12, 0, 0, 0, 0, 0, 5156, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (20908, 1, 0, 'Ты $gпосмел:посмела; заключить меня в тюрьму? Ты умрешь!', 14, 0, 100, 0, 0, 0, 19831, 0, 0, 12980, 'Аккирис Штормоход to Player');
INSERT INTO `creature_text` VALUES (20908, 2, 0, 'Ты... ничто!', 14, 0, 100, 0, 0, 11178, 19832, 0, 0, 0, 'Аккирис Штормоход to Миллхаус Манашторм');
INSERT INTO `creature_text` VALUES (20909, 0, 0, 'Тебя поглотит пламя!', 14, 0, 100, 0, 0, 0, 19833, 0, 0, 0, 'Сульфурон Метатель Магмы to Player');
INSERT INTO `creature_text` VALUES (20909, 1, 0, 'К-к-к-ак х-холодно!', 14, 0, 100, 0, 0, 11227, 19834, 0, 0, 0, 'Сульфурон Метатель Магмы to Player');
INSERT INTO `creature_text` VALUES (20910, 2, 0, 'Черный дракон одолеет всех!', 14, 0, 100, 0, 0, 0, 19837, 0, 0, 12980, 'Сумеречный драконаар to Player');
INSERT INTO `creature_text` VALUES (20911, 0, 0, 'Жалкие, низкие смертные!', 14, 0, 100, 0, 0, 0, 19835, 0, 0, 0, 'Драконид Крыла Тьмы to Player');
INSERT INTO `creature_text` VALUES (20911, 1, 0, 'Дракон... уничтожит тебя.', 14, 0, 100, 0, 0, 11228, 19836, 0, 0, 0, 'Драконид Крыла Тьмы to Player');
INSERT INTO `creature_text` VALUES (20912, 0, 0, 'It is a small matter to control the mind of the weak... for I bear allegiance to powers untouched by time, unmoved by fate. No force on this world or beyond harbors the strength to bend our knee... not even the mighty Legion! ', 14, 0, 100, 0, 0, 11122, 19112, 0, 0, 0, 'skyriss SAY_INTRO');
INSERT INTO `creature_text` VALUES (20912, 1, 0, 'Bear witness to the agent of your demise!', 14, 0, 100, 0, 0, 11123, 19113, 0, 0, 0, 'skyriss SAY_AGGRO');
INSERT INTO `creature_text` VALUES (20912, 2, 0, 'Your fate is written.', 14, 0, 100, 0, 0, 11124, 19813, 0, 0, 0, 'skyriss SAY_KILL_1');
INSERT INTO `creature_text` VALUES (20912, 2, 1, 'The chaos I have sown here is but a taste....', 14, 0, 100, 0, 0, 11125, 19814, 0, 0, 0, 'skyriss SAY_KILL_2');
INSERT INTO `creature_text` VALUES (20912, 3, 0, 'You will do my bidding, weakling.', 14, 0, 100, 0, 0, 11127, 19816, 0, 0, 0, 'skyriss SAY_MIND_1');
INSERT INTO `creature_text` VALUES (20912, 3, 1, 'Your will is no longer your own.', 14, 0, 100, 0, 0, 11128, 34363, 0, 0, 0, 'skyriss SAY_MIND_2');
INSERT INTO `creature_text` VALUES (20912, 4, 0, 'Flee in terror.', 14, 0, 100, 0, 0, 11129, 19818, 0, 0, 0, 'skyriss SAY_FEAR_1');
INSERT INTO `creature_text` VALUES (20912, 4, 1, 'I will show you horrors undreamed of.', 14, 0, 100, 0, 0, 11130, 19819, 0, 0, 0, 'skyriss SAY_FEAR_2');
INSERT INTO `creature_text` VALUES (20912, 5, 0, 'We span the universe, as countless as the stars!', 14, 0, 100, 0, 0, 11131, 19821, 0, 0, 0, 'skyriss SAY_IMAGE');
INSERT INTO `creature_text` VALUES (20912, 6, 0, 'I am merely one of... infinite multitudes.', 14, 0, 100, 0, 0, 11126, 19815, 0, 0, 0, 'skyriss SAY_DEATH');
INSERT INTO `creature_text` VALUES (20923, 3, 0, 'Огонь!', 14, 0, 100, 0, 0, 10158, 137474, 131701, 132888, 0, 'Кровавый страж Порунг to Player');
INSERT INTO `creature_text` VALUES (20926, 3, 0, 'Вы слышите слабое эхо...', 16, 0, 100, 0, 0, 0, 18599, 783425, 863084, 0, 'Контроллер двери Кривого Клыка to Player');
INSERT INTO `creature_text` VALUES (20977, 0, 0, 'Where in Bonzo\'s Brass Buttons am I? And who are-- yaaghh, that\'s one mother of a headache!', 14, 0, 100, 0, 0, 11171, 19108, 0, 0, 0, 'Millhouse Manastorm');
INSERT INTO `creature_text` VALUES (20977, 1, 0, '\"Lowly\"? I don\'t care who you are, friend: no one refers to the mighty Millhouse Manastorm as \"lowly\"!', 14, 0, 100, 0, 0, 11172, 19116, 0, 0, 0, 'Millhouse Manastorm');
INSERT INTO `creature_text` VALUES (20977, 2, 0, 'I just need to get some things ready first. You guys go ahead and get started. I need to summon up some water....', 14, 0, 100, 0, 0, 11173, 19117, 0, 0, 0, 'Millhouse Manastorm');
INSERT INTO `creature_text` VALUES (20977, 3, 0, 'Fantastic! Next, some protective spells. Yeah, now we\'re cookin\'!', 14, 0, 100, 0, 0, 11174, 19119, 0, 0, 0, 'Millhouse Manastorm');
INSERT INTO `creature_text` VALUES (20977, 4, 0, 'And of course I\'ll need some mana. You guys are gonna love this; just wait....', 14, 0, 100, 0, 0, 11175, 19120, 0, 0, 0, 'Millhouse Manastorm');
INSERT INTO `creature_text` VALUES (20977, 5, 0, 'Aaalllriiiight!! Who ordered up an extra large can of whoop-ass?', 14, 0, 100, 0, 0, 11176, 19121, 0, 0, 0, 'Millhouse Manastorm');
INSERT INTO `creature_text` VALUES (20977, 6, 0, 'I didn\'t even break a sweat on that one!', 14, 0, 100, 0, 0, 11177, 19824, 0, 0, 0, 'Millhouse Manastorm');
INSERT INTO `creature_text` VALUES (20977, 6, 1, 'You guys feel free to jump in anytime.', 14, 0, 100, 0, 0, 11178, 19825, 0, 0, 0, 'Millhouse Manastorm');
INSERT INTO `creature_text` VALUES (20977, 7, 0, 'I\'m gonna light you up, sweet cheeks!', 14, 0, 100, 0, 0, 11179, 19826, 0, 0, 0, 'Millhouse Manastorm');
INSERT INTO `creature_text` VALUES (20977, 8, 0, 'Ice, ice baby.', 14, 0, 100, 0, 0, 11180, 19827, 0, 0, 0, 'Millhouse Manastorm');
INSERT INTO `creature_text` VALUES (20977, 9, 0, 'Heal me! For the love of all that\'s holy, heal me! I\'m dying!!', 14, 0, 100, 0, 0, 11181, 19828, 0, 0, 0, 'Millhouse Manastorm');
INSERT INTO `creature_text` VALUES (20977, 10, 0, 'You\'ll be hearing from my lawyer!', 14, 0, 100, 0, 0, 11182, 19829, 0, 0, 0, 'Millhouse Manastorm');
INSERT INTO `creature_text` VALUES (20977, 11, 0, 'Who\'s bad? Who\'s bad? That\'s right: we bad!', 14, 0, 100, 0, 0, 11183, 19146, 0, 0, 0, 'Millhouse Manastorm');
