INSERT INTO `creature_text` VALUES (21104, 2, 0, 'Победа или смерть!', 12, 0, 100, 0, 0, 0, 15184, 0, 0, 0, 'RiftKeeper');
INSERT INTO `creature_text` VALUES (21104, 2, 0, 'У тебя мало времени!', 12, 0, 100, 0, 0, 0, 15183, 0, 0, 0, 'RiftKeeper');
INSERT INTO `creature_text` VALUES (21107, 0, 0, 'Guards!', 14, 7, 100, 0, 0, 0, 4583, 0, 0, 0, 'Rip Pedalslam');
