INSERT INTO `creature_text` VALUES (21127, 1, 0, 'Умри, теплокровка!', 12, 0, 100, 0, 0, 0, 16710, 0, 0, 0, 'Шквальник резервуара Кривого Клыка to Player');
INSERT INTO `creature_text` VALUES (21127, 3, 0, 'За господина!', 12, 0, 100, 0, 0, 0, 16708, 276000, 276000, 0, 'Шквальник резервуара Кривого Клыка to Player');
INSERT INTO `creature_text` VALUES (21133, 3, 0, '%s inspects the talisman $n gave him...', 16, 0, 100, 0, 0, 0, 20178, 1912062, 1912062, 35998, 'Corporal Ironridge to Player');
INSERT INTO `creature_text` VALUES (21133, 3, 0, '%s рассматривает талисман, который ему $gдал:дала; $n.', 16, 0, 100, 0, 0, 0, 20178, 9000, 9000, 35998, 'Капрал Железный Хребет to Player');
INSERT INTO `creature_text` VALUES (21133, 3, 0, 'Ah, yes... Private Guarding.  He always was quick to laugh... until a Bleeding Hollow Raid tore out his throat!', 12, 0, 100, 1, 0, 0, 20181, 1915125, 1915125, 0, 'Corporal Ironridge to Player');
INSERT INTO `creature_text` VALUES (21133, 3, 0, 'Это принадлежало капралу Стоунвеллу... он умер, защищая полевой госпиталь.', 12, 0, 100, 1, 0, 0, 20180, 12000, 12000, 0, 'Капрал Железный Хребет to Player');
INSERT INTO `creature_text` VALUES (21134, 0, 0, 'A deep, bone chilling voice echoes from the %s...', 16, 0, 100, 0, 0, 10030, 18774, 0, 0, 0, 'Eye of the Citadel to Player');
INSERT INTO `creature_text` VALUES (21134, 2, 0, 'How dare you trifle with my playthings, $n!', 12, 0, 100, 0, 0, 0, 18775, 0, 0, 0, 'Eye of the Citadel to Player');
INSERT INTO `creature_text` VALUES (21140, 2, 0, 'Тебе никогда не победить нас всех!', 14, 0, 100, 0, 0, 0, 15185, 0, 0, 0, 'Повелитель временного разлома to Player');
INSERT INTO `creature_text` VALUES (21148, 0, 0, 'Начать осаду!', 14, 0, 100, 0, 0, 0, 15181, 0, 0, 0, 'Хранительница временного разлома to Портал Времени');
INSERT INTO `creature_text` VALUES (21148, 1, 0, 'Нужно защитить ущелье!', 12, 0, 100, 0, 0, 0, 15182, 0, 0, 0, 'Хранительница временного разлома to Player');
INSERT INTO `creature_text` VALUES (21148, 2, 0, 'Нет! Разлом...', 14, 0, 100, 0, 0, 0, 15187, 0, 0, 0, 'Хранительница временного разлома to Player');
INSERT INTO `creature_text` VALUES (21148, 3, 0, 'Скоро история будет переписана с чистого листа!', 14, 0, 100, 0, 0, 0, 15180, 22, 22, 0, 'Хранительница временного разлома to Портал Времени');
INSERT INTO `creature_text` VALUES (21174, 3, 0, 'Away, you mindless parasites! My blood is my own!', 14, 0, 100, 0, 0, 10250, 17342, 788468, 788468, 0, 'Magtheridon to Magtheridon');
INSERT INTO `creature_text` VALUES (21174, 3, 0, 'How long do you believe your pathetic sorcery can hold me?', 14, 0, 100, 0, 0, 10251, 17343, 275906, 275906, 0, 'Magtheridon to Magtheridon');
INSERT INTO `creature_text` VALUES (21174, 3, 0, 'Wretched, meddling insects! Release me, and perhaps I will grant you a merciful death!', 14, 0, 100, 0, 0, 10247, 17339, 538328, 538328, 0, 'Magtheridon to Magtheridon');
INSERT INTO `creature_text` VALUES (21174, 3, 0, 'Вы думаете, что ваша жалкая магия будет удерживать меня вечно?', 14, 0, 100, 0, 0, 10251, 17343, 285000, 285000, 0, 'Магтеридон');
INSERT INTO `creature_text` VALUES (21174, 3, 0, 'Гнусные, назойливые насекомые! Освободите меня – и я, быть может, дарую вам легкую смерть!', 14, 0, 100, 0, 0, 10247, 17339, 758000, 758000, 0, 'Магтеридон');
INSERT INTO `creature_text` VALUES (21174, 3, 0, 'Иллидан – самодовольный глупец! Я сокрушу его, и Запределье будет моим!', 14, 0, 100, 0, 0, 10249, 17341, 254000, 254000, 0, 'Магтеридон');
INSERT INTO `creature_text` VALUES (21174, 3, 0, 'Моя кровь станет вашей погибелью!', 14, 0, 100, 0, 0, 10252, 17344, 499000, 499000, 0, 'Магтеридон to Магтеридон');
INSERT INTO `creature_text` VALUES (21174, 3, 0, 'Паразиты! Кровососы! Пейте мою кровь – и захлебнитесь ею!', 14, 0, 100, 0, 0, 10248, 17340, 769000, 769000, 0, 'Магтеридон to Магтеридон');
INSERT INTO `creature_text` VALUES (21174, 3, 0, 'Прочь, паразиты! Моя кровь принадлежит мне!', 14, 0, 100, 0, 0, 10250, 17342, 246000, 246000, 0, 'Магтеридон to Магтеридон');
INSERT INTO `creature_text` VALUES (21181, 0, 0, 'Кто отважится играть с огнем, получит ожоги!', 14, 0, 100, 0, 0, 0, 19302, 0, 0, 0, 'Цирух Повелитель Огня to Player');
INSERT INTO `creature_text` VALUES (21181, 0, 0, 'Цирух проснулся!', 14, 0, 100, 0, 0, 0, 19298, 0, 0, 0, 'Цирух Повелитель Огня to Player');
INSERT INTO `creature_text` VALUES (21212, 0, 0, 'Water is life. It has become a rare commodity here in Outland. A commodity that we alone shall control. We are the Highborne, and the time has come at last for us to retake our rightful place in the world!', 14, 0, 100, 0, 0, 11531, 20085, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21212, 1, 0, 'I\'ll split you from stem to stern!', 14, 0, 100, 0, 0, 11532, 20088, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21212, 1, 1, 'Victory to Lord Illidan!', 14, 0, 100, 0, 0, 11533, 20089, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21212, 1, 2, 'I spit on you, surface filth!', 14, 0, 100, 0, 0, 11534, 20091, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21212, 1, 3, 'Death to the outsiders!', 14, 0, 100, 0, 0, 11535, 20090, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21212, 2, 0, 'I did not wish to lower myself by engaging your kind, but you leave me little choice!', 14, 0, 100, 0, 0, 11538, 19679, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21212, 3, 0, 'Straight to the heart!', 14, 0, 100, 0, 0, 11536, 20086, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21212, 3, 1, 'Seek your mark!', 14, 0, 100, 0, 0, 11537, 20087, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21212, 4, 0, 'Your time ends now!', 14, 0, 100, 0, 0, 11541, 20093, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21212, 4, 1, 'You have failed!', 14, 0, 100, 0, 0, 11542, 20094, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21212, 4, 2, 'Be\'lamere an\'delay', 14, 0, 100, 0, 0, 11543, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21212, 5, 0, 'Lord Illidan, I... I am... sorry.', 14, 0, 100, 0, 0, 11544, 20096, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21212, 6, 0, 'The time is now! Leave none standing!', 14, 0, 100, 0, 0, 11539, 20092, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21212, 7, 0, 'You may want to take cover.', 14, 0, 100, 0, 0, 11540, 20210, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21213, 0, 0, 'Flood of the deep, take you!', 14, 0, 0, 0, 0, 11321, 20931, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21213, 1, 0, 'By the Tides, kill them at once!', 14, 0, 0, 0, 0, 11322, 20933, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21213, 1, 1, 'Destroy them my subjects!', 14, 0, 0, 0, 0, 11323, 20934, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21213, 2, 0, 'There is nowhere to hide!', 14, 0, 0, 0, 0, 11324, 20935, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21213, 2, 1, 'Soon it will be finished!', 14, 0, 0, 0, 0, 11325, 20936, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21213, 3, 0, 'It is done!', 14, 0, 0, 0, 0, 11326, 20937, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21213, 3, 1, 'Strugging only makes it worse.', 14, 0, 0, 0, 0, 11327, 20938, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21213, 3, 2, 'Only the strong survive.', 14, 0, 0, 0, 0, 11328, 20939, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21213, 4, 0, 'Great... currents of... Ageon.', 14, 0, 0, 0, 0, 11329, 20940, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21213, 5, 0, '%s sends his enemies to their watery graves!', 41, 0, 0, 0, 0, 0, 20701, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21213, 6, 0, 'The violent earthquake has alerted nearby murlocs!', 41, 0, 0, 0, 0, 0, 20700, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21213, 7, 0, 'summons Watery Globules!', 41, 0, 0, 0, 0, 0, 20703, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21214, 0, 0, 'Guards, attention! We have visitors...', 14, 0, 100, 0, 0, 11277, 20000, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21214, 1, 0, 'Your overconfidence will be your undoing! Guards, lend me your strength!', 14, 0, 100, 0, 0, 11278, 19854, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21214, 2, 0, 'Go on, kill them! I\'ll be the better for it!', 14, 0, 100, 0, 0, 11279, 19643, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21214, 3, 0, 'I am more powerful than ever!', 14, 0, 100, 0, 0, 11280, 19645, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21214, 4, 0, 'More knowledge, more power!', 14, 0, 100, 0, 0, 11281, 19644, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21214, 5, 0, 'Land-dwelling scum!', 14, 0, 100, 0, 0, 11282, 20001, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21214, 5, 1, 'Alana be\'lendor!', 14, 0, 100, 0, 0, 11283, 20002, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21214, 5, 2, 'I am rid of you.', 14, 0, 100, 0, 0, 11284, 20003, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21214, 6, 0, 'Her ... excellency ... awaits!', 14, 0, 100, 0, 0, 11285, 20004, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21215, 0, 0, 'Finally, my banishment ends!', 14, 0, 100, 0, 0, 11312, 19596, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21215, 1, 0, 'Be gone, trifling elf. I am in control now!', 14, 0, 100, 0, 0, 11304, 19595, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21215, 2, 0, 'We all have our demons...', 14, 0, 100, 0, 0, 11305, 19597, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21215, 3, 0, 'I have no equal.', 14, 0, 100, 0, 0, 11306, 19993, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21215, 3, 1, 'Perish, mortal.', 14, 0, 100, 0, 0, 11307, 19994, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21215, 3, 2, 'Yes, YES! Ahahah!', 14, 0, 100, 0, 0, 11308, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21215, 4, 0, 'Kill! KILL!', 14, 0, 100, 0, 0, 11314, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21215, 4, 1, 'That\'s right! Yes!', 14, 0, 100, 0, 0, 11315, 19997, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21215, 4, 2, 'Who\'s the master now?', 14, 0, 100, 0, 0, 11316, 19998, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21215, 5, 0, 'No... no! What have you done? I am the master! Do you hear me? I am... aaggh! Can\'t... contain him...', 14, 0, 100, 0, 0, 11313, 19501, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21215, 6, 0, 'At last I am liberated. It has been too long since I have tasted true freedom!', 14, 0, 100, 0, 0, 11309, 19502, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21215, 7, 0, 'You cannot kill me! Fools, I\'ll be back! I\'ll... aarghh...', 14, 0, 100, 0, 0, 11317, 19999, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21216, 0, 0, 'I cannot allow you to interfere!', 14, 0, 100, 0, 0, 11289, 20231, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21216, 1, 0, 'Better, much better.', 14, 0, 100, 0, 0, 11290, 19607, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21216, 2, 0, 'They have forced me to this...', 14, 0, 100, 0, 0, 11291, 20235, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21216, 2, 1, 'I have no choice.', 14, 0, 100, 0, 0, 11292, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21216, 3, 0, 'I am... released...', 14, 0, 100, 0, 0, 11293, 20238, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21216, 4, 0, 'Aaghh, the poison...', 14, 0, 100, 0, 0, 11297, 19606, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21216, 5, 0, 'I will purge you from this place.', 14, 0, 100, 0, 0, 11298, 20233, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21216, 5, 1, 'You are no better than they!', 14, 0, 100, 0, 0, 11299, 20234, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21216, 6, 0, 'You are the disease, not I', 14, 0, 100, 0, 0, 11300, 20239, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21217, 4, 0, '%s глубоко вдыхает!', 41, 0, 100, 0, 0, 0, 20774, 41809, 486677, 0, 'Скрытень из глубин');
INSERT INTO `creature_text` VALUES (21218, 3, 0, 'Откройте очистной клапан и продолжайте работу.', 12, 0, 100, 1, 0, 0, 18898, 334763, 334763, 0, 'Отважный страж Вайш\'ира to Жрица резервуара Кривого Клыка');
INSERT INTO `creature_text` VALUES (21218, 4, 0, 'Довольно! Хватит с меня грязных теплокровок!', 14, 0, 100, 0, 0, 0, 19891, 37752, 37752, 38947, 'Отважный страж Вайш\'ира');
INSERT INTO `creature_text` VALUES (21220, 3, 0, 'Вы говорите правду.', 12, 0, 100, 1, 0, 0, 18905, 326260, 326260, 0, 'Жрица резервуара Кривого Клыка to Отважный страж Вайш\'ира');
INSERT INTO `creature_text` VALUES (21252, 0, 0, 'Конклав Ветра близок к обретению абсолютной силы!', 41, 0, 100, 0, 0, 0, 48590, 0, 0, 0, 'World Trigger (Not Immune PC) to Player');
INSERT INTO `creature_text` VALUES (21254, 3, 0, 'А-А-А!', 12, 0, 100, 0, 0, 0, 135125, 2153, 2153, 0, 'Дулграмский землечерп to Призывающий бурю Векх\'нира');
INSERT INTO `creature_text` VALUES (21257, 3, 0, 'Ага, ясно...', 12, 0, 100, 0, 0, 0, 19023, 4175000, 4175000, 0, 'Аптекарь Зелана to Player');
INSERT INTO `creature_text` VALUES (21257, 3, 0, 'Да, это очень некстати.', 12, 0, 100, 0, 0, 0, 19024, 4178000, 4178000, 0, 'Аптекарь Зелана to Player');
INSERT INTO `creature_text` VALUES (21257, 3, 0, 'Спасибо, $n. Что ж, начнем испытание...', 12, 0, 100, 1, 0, 0, 19022, 4169000, 4169000, 35998, 'Аптекарь Зелана to Player');
INSERT INTO `creature_text` VALUES (21277, 0, 0, 'Тс-с-с, |3-6($r), иди сюда, ко входу! Я в клетке! Поторопись!', 15, 0, 100, 0, 0, 0, 18922, 0, 0, 0, 'Воздаятельница Вуулина to Player');
INSERT INTO `creature_text` VALUES (21279, 3, 0, 'Если бы моя кровь не свернулась давным-давно, сейчас я кипел бы от ярости...', 12, 0, 100, 1, 0, 0, 19069, 44000, 4067000, 0, 'Аптекарь Альбрек to Player');
INSERT INTO `creature_text` VALUES (21279, 3, 0, 'Интересно...', 12, 0, 100, 0, 0, 0, 23107, 27000, 4047000, 0, 'Аптекарь Альбрек to Player');
INSERT INTO `creature_text` VALUES (21279, 3, 0, 'Но что это?', 12, 0, 100, 0, 0, 0, 19067, 4051000, 4051000, 0, 'Аптекарь Альбрек to Player');
INSERT INTO `creature_text` VALUES (21279, 3, 0, 'ОЙ!', 12, 0, 100, 0, 0, 0, 144842, 4053000, 4053000, 0, 'Аптекарь Альбрек to Player');
INSERT INTO `creature_text` VALUES (21279, 3, 0, 'Прошу меня извинить, мне нужно начать эксперименты...', 12, 0, 100, 1, 0, 0, 19065, 22000, 4042000, 0, 'Аптекарь Альбрек to Player');
INSERT INTO `creature_text` VALUES (21291, 0, 0, 'I\'m through asking nicely, fish-man.', 12, 0, 100, 25, 0, 0, 18954, 0, 0, 0, 'Grom\'tor, Son of Oronok');
INSERT INTO `creature_text` VALUES (21291, 1, 0, 'Where is the Cipher of Damnation? I know a third of it is in this village.', 12, 0, 100, 6, 0, 0, 18955, 0, 0, 0, 'Grom\'tor, Son of Oronok');
INSERT INTO `creature_text` VALUES (21291, 2, 0, 'No... Of course not. What was I thinking? Why would you have a third of the Cipher of Damnation?', 12, 0, 100, 274, 0, 0, 18958, 0, 0, 0, 'Grom\'tor, Son of Oronok');
INSERT INTO `creature_text` VALUES (21291, 3, 0, 'I feel so stupid. Maybe I should unchain you and set you free?', 12, 0, 100, 11, 0, 0, 18959, 0, 0, 0, 'Grom\'tor, Son of Oronok');
INSERT INTO `creature_text` VALUES (21291, 4, 0, 'DO I HONESTLY LOOK THAT STUPID TO YOU, NAGA? NOW YOU FEEL PAIN!', 12, 0, 100, 5, 0, 0, 18960, 0, 0, 0, 'Grom\'tor, Son of Oronok');
INSERT INTO `creature_text` VALUES (21291, 5, 0, '%s spits on the Coilskar naga.', 16, 0, 100, 5, 0, 0, 18962, 0, 0, 0, 'Grom\'tor, Son of Oronok');
INSERT INTO `creature_text` VALUES (21291, 6, 0, 'GET UP YOU ROTTEN PIECE OF TRASH! GET UP BEFORE I END YOU!', 12, 0, 100, 5, 0, 0, 18963, 0, 0, 0, 'Grom\'tor, Son of Oronok');
INSERT INTO `creature_text` VALUES (21291, 7, 0, 'I\'m listening...', 12, 0, 100, 273, 0, 0, 18966, 0, 0, 0, 'Grom\'tor, Son of Oronok');
INSERT INTO `creature_text` VALUES (21295, 0, 0, 'Whhaaat... are you sssspeaking of, ssssoft-sskin?', 12, 0, 100, 1, 0, 0, 18956, 0, 0, 0, 'Coilskar Commander');
INSERT INTO `creature_text` VALUES (21295, 1, 0, 'The naga do nottt... have thissss... cipherrr...', 12, 0, 100, 1, 0, 0, 18957, 0, 0, 0, 'Coilskar Commander');
INSERT INTO `creature_text` VALUES (21295, 2, 0, 'Yesss... Yesss... Ssset me freee...', 12, 0, 100, 1, 0, 0, 18961, 0, 0, 0, 'Coilskar Commander');
INSERT INTO `creature_text` VALUES (21295, 3, 0, '%s regains consciousness.', 16, 0, 100, 0, 0, 0, 25036, 0, 0, 0, 'Coilskar Commander');
INSERT INTO `creature_text` VALUES (21295, 4, 0, 'Do not beat the Coilsssskaarrr commander anymore, orc! I will tell you! The cipherrr... It is hidden in one of the chests at Coilssskarrr Point... The naga there hold the keysss...', 12, 0, 100, 1, 0, 0, 18965, 0, 0, 0, 'Coilskar Commander');
INSERT INTO `creature_text` VALUES (21295, 5, 0, 'COILSSSKARRR!', 12, 0, 100, 15, 0, 0, 18967, 0, 0, 0, 'Coilskar Commander');
INSERT INTO `creature_text` VALUES (21319, 0, 0, 'Hah! The Thunderspike is mine. Die!', 12, 0, 0, 1, 0, 0, 0, 0, 0, 0, 'Smart Text');
INSERT INTO `creature_text` VALUES (21332, 0, 0, 'It is dying! The second part of the Cipher of Damnation is ours. I...', 12, 0, 100, 1, 0, 0, 19040, 0, 0, 0, 'Spirit Hunter to Veneratus the Many');
INSERT INTO `creature_text` VALUES (21332, 1, 0, 'I am fading... Return to Ar\'tor... Ret... rn... to...', 12, 0, 100, 1, 0, 0, 19041, 0, 0, 0, 'Spirit Hunter to Veneratus the Many');
INSERT INTO `creature_text` VALUES (21409, 0, 0, 'Halt!', 12, 0, 100, 1, 0, 0, 74361, 0, 0, 0, 'Icarius');
INSERT INTO `creature_text` VALUES (21409, 1, 0, 'Zarath you must return to the Black Temple at once! I... I seem to have misplaced Lord Illidan\'s orders. Quickly!', 12, 0, 100, 5, 0, 0, 19173, 0, 0, 0, 'Icarius');
INSERT INTO `creature_text` VALUES (21409, 2, 0, 'Zarath, I am perfectly capable of making it up this road to Eclipse Point. If we do not deliver the missive, Lord Illidan will have both of our heads! You are dismissed!', 12, 0, 100, 1, 0, 0, 19175, 0, 0, 0, 'Icarius');
INSERT INTO `creature_text` VALUES (21409, 3, 0, 'Ah, sweet, sweet bloodthistle... Probably left behind by one of those filthy addicts at Eclipse Point.', 12, 0, 100, 1, 0, 0, 19177, 0, 0, 0, 'Icarius');
INSERT INTO `creature_text` VALUES (21409, 4, 0, 'Their loss is most definitely my gain...', 12, 0, 100, 275, 0, 0, 19178, 0, 0, 0, 'Icarius');
INSERT INTO `creature_text` VALUES (21409, 5, 0, 'Envoy Icarius puts the bundle of bloodthistle in his robe.', 16, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Icarius');
INSERT INTO `creature_text` VALUES (21409, 6, 0, 'Ah, damn it all! Clever trap. Too bad you\'ll never live to tell the tale...', 12, 0, 100, 1, 0, 0, 19184, 0, 0, 0, 'Icarius');
INSERT INTO `creature_text` VALUES (21410, 0, 0, 'What is it, my lord?', 12, 0, 100, 6, 0, 0, 19172, 0, 0, 0, 'Zarath');
INSERT INTO `creature_text` VALUES (21410, 1, 0, 'My lord, surely you do not expect me to leave you unattended. Lord Illidan would have my head if anything were to happen to you.', 12, 0, 100, 1, 0, 0, 19174, 0, 0, 0, 'Zarath');
INSERT INTO `creature_text` VALUES (21410, 2, 0, 'As you wish, my lord.', 12, 0, 100, 66, 0, 0, 37953, 0, 0, 0, 'Zarath');
INSERT INTO `creature_text` VALUES (21469, 0, 0, 'Good $N, you are under the spell\'s influence. I must analyze it quickly, then we can talk.', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21502, 0, 0, 'Doom Lord Kazzak will be pleased. You are to increase the pace of your attacks. Destroy the orcish and dwarven strongholds with all haste.', 12, 0, 100, 1, 0, 0, 19150, 0, 0, 0, 'Razuun');
INSERT INTO `creature_text` VALUES (21502, 1, 0, 'Don\'t worry about that. I\'ve increased production at the Deathforge. You\'ll have all the infernals you need to carry out your orders. Don\'t fail, Jovaan.', 12, 0, 100, 1, 0, 0, 19151, 0, 0, 0, 'Razuun');
INSERT INTO `creature_text` VALUES (21502, 2, 0, 'Yes?', 12, 0, 100, 6, 0, 0, 112250, 0, 0, 0, 'Razuun');
INSERT INTO `creature_text` VALUES (21502, 3, 0, 'Crate? I didn\'t send you a crate, Jovaan. Don\'t you have more important things to worry about? Go see to them!', 12, 0, 100, 274, 0, 0, 19281, 0, 0, 0, 'Razuun');
INSERT INTO `creature_text` VALUES (21504, 0, 0, 'Indeed, it is not a request.', 12, 0, 100, 0, 0, 0, 19185, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21504, 1, 0, 'Duro will be reinforced! Ultris was a complete disaster. I will NOT have that mistake repeated!', 12, 0, 100, 0, 0, 0, 19187, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21504, 2, 0, 'We\'ve had too many setbacks along the way: Hellfire Citadel, Fallen Sky Ridge, Firewing Point... Prince Kael\'thas will tolerate no further delays. I will tolerate nothing other than complete success!', 12, 0, 100, 0, 0, 0, 19188, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21504, 3, 0, 'I am returning to Tempest Keep. See to it that I do not have reason to return!', 12, 0, 100, 0, 0, 0, 19191, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21633, 0, 0, 'Everything is in readiness, warbringer.', 12, 0, 100, 0, 0, 0, 19274, 0, 0, 0, 'Jovaan');
INSERT INTO `creature_text` VALUES (21633, 1, 0, 'Warbringer, that will require the use of all the hold\'s infernals. It may leave us vulnerable to a counterattack.', 12, 0, 100, 0, 0, 0, 19275, 0, 0, 0, 'Jovaan');
INSERT INTO `creature_text` VALUES (21633, 2, 0, 'It shall be as you say, warbringer. One last question, if I may...', 12, 0, 100, 6, 0, 0, 19279, 0, 0, 0, 'Jovaan');
INSERT INTO `creature_text` VALUES (21633, 3, 0, 'What\'s in the crate?', 12, 0, 100, 6, 0, 0, 19280, 0, 0, 0, 'Jovaan');
INSERT INTO `creature_text` VALUES (21648, 0, 0, 'Thank you, mortal.', 12, 11, 100, 0, 0, 0, 19849, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21657, 0, 0, 'НАПАДЕМ СО ВСЕЙ МОЩЬЮ КРЫЛЬЕВ ПУСТОТЫ, ДЕТИ МОИ! ВПЕРЕД!', 14, 0, 100, 0, 0, 0, 20137, 0, 0, 0, 'Нельтараку to Зулухед Измученный');
INSERT INTO `creature_text` VALUES (21685, 0, 0, 'Ты не будешь биться в одиночку, $n! Вместе мы поразим это порождение адского огня!', 14, 0, 100, 0, 0, 0, 19304, 0, 0, 0, 'Оронок Горемычный to Player');
INSERT INTO `creature_text` VALUES (21790, 3, 0, 'I built several control panels down the hill. Quickly take one and take control of the fel robot! You have little time.', 12, 0, 100, 0, 0, 0, 19666, 50000, 50000, 0, 'Плекси to Player');
INSERT INTO `creature_text` VALUES (21797, 0, 0, 'Your body is mine! Our fates are forever intertwined!', 14, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Ancient Shadowmoon Spirit');
INSERT INTO `creature_text` VALUES (21865, 1, 0, 'Моя кровь – словно яд!', 12, 0, 100, 0, 0, 0, 16712, 0, 0, 37770, 'Душительница резервуара Кривого Клыка to Player');
INSERT INTO `creature_text` VALUES (21873, 0, 0, 'By Nazjatar\'s Depths!', 12, 0, 0, 0, 0, 0, 16711, 0, 0, 0, 'Coilfang Guardian');
INSERT INTO `creature_text` VALUES (21873, 0, 1, 'Die, warmblood!', 12, 0, 0, 0, 0, 0, 16710, 0, 0, 0, 'Coilfang Guardian');
INSERT INTO `creature_text` VALUES (21873, 0, 2, 'For the Master!', 12, 0, 0, 0, 0, 0, 16708, 0, 0, 0, 'Coilfang Guardian');
INSERT INTO `creature_text` VALUES (21873, 0, 3, 'Illidan reigns!', 12, 0, 0, 0, 0, 0, 16709, 0, 0, 0, 'Coilfang Guardian');
INSERT INTO `creature_text` VALUES (21873, 0, 4, 'My blood is like venom!', 12, 0, 0, 0, 0, 0, 16712, 0, 0, 0, 'Coilfang Guardian');
INSERT INTO `creature_text` VALUES (21875, 0, 0, 'Finally, my banishment ends!', 14, 0, 100, 0, 0, 11312, 19596, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21875, 1, 0, 'Be gone, trifling elf. I am in control now!', 14, 0, 100, 0, 0, 11304, 19595, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21875, 2, 0, 'We all have our demons...', 14, 0, 100, 0, 0, 11305, 19597, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21875, 3, 0, 'I have no equal.', 14, 0, 100, 0, 0, 11306, 19993, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21875, 3, 1, 'Perish, mortal.', 14, 0, 100, 0, 0, 11307, 19994, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21875, 3, 2, 'Yes, YES! Ahahah!', 14, 0, 100, 0, 0, 11308, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21875, 4, 0, 'Kill! KILL!', 14, 0, 100, 0, 0, 11314, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21875, 4, 1, 'That\'s right! Yes!', 14, 0, 100, 0, 0, 11315, 19997, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21875, 4, 2, 'Who\'s the master now?', 14, 0, 100, 0, 0, 11316, 19998, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21875, 5, 0, 'No... no! What have you done? I am the master! Do you hear me? I am... aaggh! Can\'t... contain him...', 14, 0, 100, 0, 0, 11313, 19501, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21875, 6, 0, 'At last I am liberated. It has been too long since I have tasted true freedom!', 14, 0, 100, 0, 0, 11309, 19502, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (21875, 7, 0, 'You cannot kill me! Fools, I\'ll be back! I\'ll... aarghh...', 14, 0, 100, 0, 0, 11317, 19999, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (22019, 0, 0, '%s becomes enraged!', 16, 0, 100, 0, 0, 0, 24144, 0, 0, 0, 'Kolphis Darkscale');
INSERT INTO `creature_text` VALUES (22054, 3, 0, '%s гневно рычит.', 16, 0, 100, 0, 0, 3685, 19739, 334981, 334981, 0, 'Чудищ, король Колоссов to Player');
INSERT INTO `creature_text` VALUES (22059, 3, 0, 'Что такое, |3-6($r)? Ты $gраздобыл:раздобыла; какие-то новые сведения?', 12, 7, 100, 1, 0, 0, 19742, 4000, 4000, 0, 'Всадник на грифоне Громового Молота to Player');
INSERT INTO `creature_text` VALUES (22083, 0, 0, 'What is the meaning of this, Mor\'ghor?', 14, 0, 100, 1, 0, 0, 21804, 0, 0, 0, 'Р’Р»Р°РґС‹РєР° РР»Р»РёРґР°РЅ РЇСЂРѕСЃС‚СЊ Р‘СѓСЂРё');
INSERT INTO `creature_text` VALUES (22083, 1, 0, 'SILENCE!', 14, 0, 100, 22, 0, 0, 21807, 0, 0, 0, 'Р’Р»Р°РґС‹РєР° РР»Р»РёРґР°РЅ РЇСЂРѕСЃС‚СЊ Р‘СѓСЂРё');
INSERT INTO `creature_text` VALUES (22083, 2, 0, 'Blathering idiot. You incomprehensibly incompetent buffoon...', 14, 0, 100, 1, 0, 0, 21808, 0, 0, 0, 'Р’Р»Р°РґС‹РєР° РР»Р»РёРґР°РЅ РЇСЂРѕСЃС‚СЊ Р‘СѓСЂРё');
INSERT INTO `creature_text` VALUES (22083, 3, 0, 'THIS is your hero?', 14, 0, 100, 6, 0, 0, 21809, 0, 0, 0, 'Р’Р»Р°РґС‹РєР° РР»Р»РёРґР°РЅ РЇСЂРѕСЃС‚СЊ Р‘СѓСЂРё');
INSERT INTO `creature_text` VALUES (22083, 4, 0, 'You have been deceived, imbecile.', 14, 0, 100, 1, 0, 0, 21810, 0, 0, 0, 'Р’Р»Р°РґС‹РєР° РР»Р»РёРґР°РЅ РЇСЂРѕСЃС‚СЊ Р‘СѓСЂРё');
INSERT INTO `creature_text` VALUES (22083, 5, 0, 'This... whole... operation... HAS BEEN COMPROMISED!', 14, 0, 100, 22, 0, 0, 21811, 0, 0, 0, 'Р’Р»Р°РґС‹РєР° РР»Р»РёРґР°РЅ РЇСЂРѕСЃС‚СЊ Р‘СѓСЂРё');
INSERT INTO `creature_text` VALUES (22083, 6, 0, 'I expect to see this insect\'s carcass in pieces in my lair within the hour. Fail and you will suffer a fate so much worse than death.', 14, 0, 100, 1, 0, 0, 21812, 0, 0, 0, 'Р’Р»Р°РґС‹РєР° РР»Р»РёРґР°РЅ РЇСЂРѕСЃС‚СЊ Р‘СѓСЂРё');
INSERT INTO `creature_text` VALUES (22083, 7, 0, 'РС‚Р°Рє, РїРѕР±РµРґРёРІ РљСЂРѕРІР°РІСѓСЋ РџРµС‡Р°С‚СЊ, С‚С‹ С‚РµРїРµСЂСЊ С…РѕС‡РµС€СЊ Р±СЂРѕСЃРёС‚СЊ РІС‹Р·РѕРІ РјРѕРµРјСѓ РІР»Р°СЃС‚РІРѕРІР°РЅРёСЋ? Р”Р°Р¶Рµ РђСЂС‚Р°СЃ РЅРµ СЃРјРѕРі РїРѕР±РµРґРёС‚СЊ РјРµРЅСЏ, вЂ“ Р° С‚С‹ СЃРјРµРµС€СЊ РІС‹РЅР°С€РёРІР°С‚СЊ РїРѕРґРѕР±РЅС‹Рµ РјС‹СЃР»Рё? РўРѕРіРґР° СЃРєР°Р¶Сѓ С‚РµР±Рµ: РїСЂРёС…РѕРґРё! РџСЂРёС…РѕРґРё, $n! Р§РµСЂРЅС‹Р№ С…СЂР°Рј Р¶РґРµС‚ С‚РµР±СЏ...', 14, 0, 100, 0, 0, 0, 19801, 0, 0, 0, 'Р’Р»Р°РґС‹РєР° РР»Р»РёРґР°РЅ РЇСЂРѕСЃС‚СЊ Р‘СѓСЂРё to Player');
INSERT INTO `creature_text` VALUES (22083, 8, 0, 'Emergency shutdown will complete in ten seconds.', 41, 0, 100, 0, 0, 0, 17885, 0, 0, 0, 'Р’Р»Р°РґС‹РєР° РР»Р»РёРґР°РЅ РЇСЂРѕСЃС‚СЊ Р‘СѓСЂРё to Player');
INSERT INTO `creature_text` VALUES (22083, 9, 0, 'Emergency shutdown complete.', 41, 0, 100, 0, 0, 0, 17900, 0, 0, 0, 'Р’Р»Р°РґС‹РєР° РР»Р»РёРґР°РЅ РЇСЂРѕСЃС‚СЊ Р‘СѓСЂРё to Player');
INSERT INTO `creature_text` VALUES (22083, 10, 0, 'Emergency shutdown aborted.', 41, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Р’Р»Р°РґС‹РєР° РР»Р»РёРґР°РЅ РЇСЂРѕСЃС‚СЊ Р‘СѓСЂРё to Player');
INSERT INTO `creature_text` VALUES (22113, 0, 0, 'Мама!', 14, 0, 100, 0, 0, 0, 113020, 0, 0, 0, 'Морденай to Player');
INSERT INTO `creature_text` VALUES (22127, 0, 0, 'It\'s a good thing I was able to make duplicates of the Felsworn Gas Mask.', 12, 0, 0, 1, 0, 0, 20215, 0, 0, 0, 'Smart Text');
INSERT INTO `creature_text` VALUES (22224, 3, 0, 'Иди в мое логово! Иди ко мне и заплати за свою наглость!', 12, 0, 100, 0, 0, 0, 19914, 12000, 12000, 0, 'Голос Гриллока to Player');
INSERT INTO `creature_text` VALUES (22224, 3, 0, 'Как ты $gпосмел:посмела; взять мой глаз?! Я раздавлю твою душу и скормлю ее моим слепым скулящим бесятам!', 12, 0, 100, 0, 0, 0, 19913, 6000, 6000, 38594, 'Голос Гриллока to Player');
INSERT INTO `creature_text` VALUES (22243, 3, 0, 'About time you showed up!  That forge has been busted for almost an hour!', 14, 0, 100, 22, 0, 0, 21614, 8000, 8000, 0, 'Bash\'ir Arcanist');
INSERT INTO `creature_text` VALUES (22281, 0, 0, 'May whatever god you believe in have mercy on you.  For I will show you none.', 14, 0, 100, 0, 0, 0, 21694, 0, 0, 0, 'Galvanoth to Player');
INSERT INTO `creature_text` VALUES (22315, 3, 0, '%s взорвется через 5 секунд!', 16, 0, 100, 0, 0, 0, 20104, 1000, 1000, 0, 'Мина Кузницы Смерти to Ремонтник Кузницы Смерти');
INSERT INTO `creature_text` VALUES (22373, 0, 0, 'More Minions of Terokk are coming!', 12, 0, 100, 0, 0, 0, 20266, 0, 0, 0, 'Defender Grashna');
INSERT INTO `creature_text` VALUES (22373, 1, 0, 'The invaders persist! Hold them off!', 12, 0, 100, 0, 0, 0, 20267, 0, 0, 0, 'Defender Grashna');
INSERT INTO `creature_text` VALUES (22373, 2, 0, 'An Avatar of Terokk!! To arms!', 12, 0, 100, 0, 0, 0, 20268, 0, 0, 0, 'Defender Grashna');
INSERT INTO `creature_text` VALUES (22373, 3, 0, 'The Avatar of Terokk has been defeated! Death to Terokk! Death to Skettis!', 12, 0, 100, 0, 0, 0, 20270, 0, 0, 0, 'Defender Grashna');
INSERT INTO `creature_text` VALUES (22374, 0, 0, 'Who dares slay one of my Kargath\'s commanders?  You will pay for this... in flesh!', 14, 0, 100, 0, 0, 0, 20156, 0, 0, 0, 'Hand of Kargath');
INSERT INTO `creature_text` VALUES (22430, 3, 0, 'I fear that Colonel Jules may only be saved through a dangerous ritual... an exorcism.', 12, 0, 100, 396, 0, 0, 20646, 7232656, 7232656, 0, 'Assistant Klatu to Player');
INSERT INTO `creature_text` VALUES (22430, 3, 0, 'Speak with me, $n, for we have much to prepare...', 12, 0, 100, 397, 0, 0, 20647, 7237422, 7237422, 0, 'Assistant Klatu to Player');
INSERT INTO `creature_text` VALUES (22430, 3, 0, 'Поговори со мной, $n, нам многое нужно подготовить...', 12, 0, 100, 397, 0, 1015, 20647, 52000, 52000, 0, 'Ассистент Клату to Player');
INSERT INTO `creature_text` VALUES (22430, 3, 0, 'Я боюсь, полковник Джулс может быть спасен лишь после совершения опасного ритуала, экзорцизма.', 12, 0, 100, 396, 0, 1015, 20646, 47000, 47000, 0, 'Ассистент Клату to Player');
INSERT INTO `creature_text` VALUES (22431, 0, 0, 'It is time. The rite of exorcism will now commence...', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Barada');
INSERT INTO `creature_text` VALUES (22431, 1, 0, 'Prepare yourself. Do not allow the ritual to be interrupted or we may lose our patient...', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Barada');
INSERT INTO `creature_text` VALUES (22431, 2, 0, 'Back foul beings of darkness! You have no power here!', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Barada');
INSERT INTO `creature_text` VALUES (22431, 3, 0, 'I... must not... falter', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Barada');
INSERT INTO `creature_text` VALUES (22431, 4, 0, 'The Light is my guide... it is my sustenance!', 12, 0, 100, 0, 0, 0, 20408, 0, 0, 0, 'Barada');
INSERT INTO `creature_text` VALUES (22431, 5, 0, 'The power of light compells you! Back to your pit!', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Barada');
INSERT INTO `creature_text` VALUES (22431, 6, 0, 'Be cleansed with Light, human! Let not the demonic corruption overwhelm you.', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Barada');
INSERT INTO `creature_text` VALUES (22431, 7, 0, 'Back! I cast you back... corruptor of faith! Author of pain! Do not return, or suffer the same fate as you did here today!', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Barada');
INSERT INTO `creature_text` VALUES (22432, 0, 0, 'Keep away. The fool is mine.', 12, 0, 100, 0, 0, 0, 20402, 0, 0, 0, 'Colonel Jules');
INSERT INTO `creature_text` VALUES (22432, 1, 0, 'Ah! Cease the incantations, Anchorite! Cease, or I will show you such pain that your pathetic people have never imagined!', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Colonel Jules');
INSERT INTO `creature_text` VALUES (22432, 2, 0, 'This is fruitless, draenei! You and your little helper cannot wrest control of this pathetic human. He is mine!', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Colonel Jules');
INSERT INTO `creature_text` VALUES (22432, 3, 0, 'I see your ancestors, Anchorite! They writhe and scream in the darkness... they are with us!', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Colonel Jules');
INSERT INTO `creature_text` VALUES (22432, 4, 0, 'I will tear your soul into morsels and slow roast them over demon fire.', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Colonel Jules');
INSERT INTO `creature_text` VALUES (22454, 0, 0, 'Vengeance will not be yours, $n!', 12, 0, 100, 15, 0, 0, 20301, 0, 0, 0, 'Fel Spirit to Player');
INSERT INTO `creature_text` VALUES (22454, 3, 0, 'Отомстить тебе не удастся, $n!', 12, 0, 100, 15, 0, 0, 20301, 1000, 1000, 39205, 'Дух Скверны to Player');
INSERT INTO `creature_text` VALUES (22458, 0, 0, '\'Aright, listen up! Form a circle around me and move out!', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (22458, 1, 0, 'Aright, $R, just keep us safe from harm while we work. We\'ll pay you when we return.', 12, 0, 100, 0, 0, 0, 20328, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (22458, 2, 0, 'The dig site is just north of here.', 12, 0, 100, 0, 0, 0, 20329, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (22458, 3, 0, 'We\'re here! Start diggin\'!', 12, 0, 100, 0, 0, 0, 20330, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (22458, 4, 0, 'I think there\'s somethin\' buried here, beneath the sand!', 12, 0, 100, 396, 0, 0, 20331, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (22458, 5, 0, 'Almost got it!', 12, 0, 100, 396, 0, 0, 20332, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (22458, 6, 0, 'By Brann\'s brittle bananas! What is it?! It... It looks like a drum.', 12, 0, 100, 396, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (22458, 7, 0, 'Have ye gone mad? You expect me to leave behind a drum without first beatin\' on it? Not this son of Ironforge! No sir!', 12, 0, 100, 0, 0, 0, 20337, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (22458, 8, 0, 'Shut yer yaps! I\'m gonna bang on this drum and that\'s that!', 12, 0, 100, 0, 0, 0, 20344, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (22458, 9, 0, 'IN YOUR FACE! I told you there was somethin\' here!', 12, 0, 100, 0, 0, 0, 20348, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (22458, 10, 0, 'Don\'t just stand there! Help him out!', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (22458, 11, 0, 'You\'ve been a tremendous help, $R! Let\'s get out of here before more of those things show up! I\'ll let Dwarfowitz know you did the job asked of ya\' admirably.', 12, 0, 100, 0, 0, 0, 20363, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (22464, 0, 0, 'Wow... a drum.', 12, 0, 100, 0, 0, 0, 20334, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (22464, 1, 0, 'This discovery will surely rock the foundation of modern archaeology.', 12, 0, 100, 0, 0, 0, 20335, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (22464, 2, 0, 'Yea, great. Can we leave now? This desert is giving me hives.', 12, 0, 100, 0, 0, 0, 20336, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (22464, 3, 0, 'This reminds me of that one time where you made us search Silithus for evidence of sand gnomes.', 12, 0, 100, 0, 0, 0, 20339, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (22464, 4, 0, 'Or that time when you told us that you\'d discovered the cure for the plague of the 20th century. What is that even? 20th century?', 12, 0, 100, 0, 0, 0, 20340, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (22464, 5, 0, 'I don\'t think it can top the one time where he told us that he\'d heard that Arthas\'s cousin\'s skeleton was frozen beneath a glacier in Winterspring. I\'ll never forgive you for that one, Letoll. I mean honestly... Arthas\'s cousin?', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (22464, 6, 0, 'I dunno. It can\'t possibly beat the time he tried to convince us that we\'re all actually a figment of some being\'s imagination and that they only use us for their own personal amusement. That went over well during dinner with the family.', 12, 0, 100, 0, 0, 0, 20343, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (22464, 7, 0, 'Say, do you guys hear that?', 12, 0, 100, 0, 0, 0, 20346, 0, 0, 0, '');
