INSERT INTO `creature_text` VALUES (23178, 3, 0, 'Тралл загнал себя в ловушку в часовне. Теперь он не сможет сбежать.', 12, 0, 100, 0, 0, 0, 15976, 0, 0, 15620, 'Смотритель Мельницы Таррен to Player');
INSERT INTO `creature_text` VALUES (23179, 3, 0, 'I did not see anything.', 12, 0, 100, 0, 0, 0, 15968, 5000, 5000, 0, 'Заступник Мельницы Таррен to Player');
INSERT INTO `creature_text` VALUES (23179, 3, 0, 'I have not seen anything.', 12, 0, 100, 0, 0, 0, 15968, 4000, 4000, 0, 'Заступник Мельницы Таррен to Player');
INSERT INTO `creature_text` VALUES (23179, 4, 0, 'Думаете, вы победили?', 12, 0, 100, 0, 0, 0, 19531, 8000, 8000, 0, 'Заступник Мельницы Таррен to Player');
