INSERT INTO `creature_text` VALUES (23180, 4, 0, 'Ты ничего не $gдобился:добилась;!', 12, 0, 100, 0, 0, 0, 19532, 7000, 7000, 0, 'Заступник Мельницы Таррен to Player');
INSERT INTO `creature_text` VALUES (23191, 3, 0, 'Сломленные из племени Пеплоустов, ваш предводитель говорит!', 14, 0, 100, 15, 0, 0, 21342, 259367, 259367, 40854, 'Акама to Player');
INSERT INTO `creature_text` VALUES (23197, 3, 0, 'Наконец-то моя долгая охота завершилась. Сегодня свершится правосудие.', 14, 0, 100, 5, 0, 11492, 21071, 14789, 14789, 0, 'Майев Песнь Теней to Иллидан Ярость Бури');
INSERT INTO `creature_text` VALUES (23197, 4, 0, 'Он прав. Я ничего не чувствую... Я – ничто...', 14, 0, 100, 0, 0, 11497, 121761, 1404, 1404, 0, 'Майев Песнь Теней to Иллидан Ярость Бури');
INSERT INTO `creature_text` VALUES (23222, 4, 0, '%s runs into the battle madness!', 16, 0, 100, 0, 0, 0, 9764, 16022, 75552, 41254, 'Буян из клана Костеглодов to Буян из клана Костеглодов');
INSERT INTO `creature_text` VALUES (23237, 3, 0, 'Как долго нам ждать?', 12, 0, 100, 396, 0, 0, 21267, 1303841, 1303841, 0, 'Кровавый пророк из клана Костеглодов');
INSERT INTO `creature_text` VALUES (23257, 0, 0, 'So small. So soft. It\'\'s a wonder you\'ve even lasted this long down here, fleshling.', 12, 7, 100, 0, 0, 0, 0, 0, 0, 0, 'Say_text');
INSERT INTO `creature_text` VALUES (23257, 1, 0, ' I propose this: We will march on the Twilight cult and extinguish any utterings of Deathwing\'\'s name from this realm. Your Earthen Ring will march with us.', 12, 7, 100, 0, 0, 0, 0, 0, 0, 0, 'Say_text');
INSERT INTO `creature_text` VALUES (23257, 2, 0, 'You do this, and I will send Gorsik to the temple with our piece of the World Pillar.', 12, 7, 100, 0, 0, 0, 43876, 0, 0, 0, 'Say_text');
INSERT INTO `creature_text` VALUES (23257, 3, 0, 'Save your thanks. We march upon the Twilight Precipice as soon as our forces are gathered. I expect to see you on the battlefield.', 12, 7, 100, 0, 0, 0, 0, 0, 0, 0, 'Say_text');
INSERT INTO `creature_text` VALUES (23311, 3, 0, 'Работа – гадость! ХВАТИТ!', 12, 0, 100, 15, 0, 0, 21325, 188730, 188730, 0, 'Непокорный батрак клана Драконьей Пасти');
INSERT INTO `creature_text` VALUES (23319, 0, 0, 'Hail our leader! Hail Akama!', 14, 0, 100, 0, 0, 0, 21350, 0, 0, 0, 'РџРµРїР»РѕСѓСЃС‚-СЃР»РѕРјР»РµРЅРЅС‹Р№');
INSERT INTO `creature_text` VALUES (23319, 1, 0, 'РЎР»Р°РІСЊСЃСЏ, РђРєР°РјР°!', 14, 0, 100, 0, 0, 0, 21348, 0, 0, 0, 'РџРµРїР»РѕСѓСЃС‚-СЃР»РѕРјР»РµРЅРЅС‹Р№');
INSERT INTO `creature_text` VALUES (23330, 3, 0, 'Драконьи всадники, в седло!', 14, 0, 100, 0, 0, 0, 20823, 66253, 66253, 0, 'Ветробой из клана Драконьей Пасти to Призывательница драконов из клана Драконьей Пасти');
INSERT INTO `creature_text` VALUES (23334, 3, 0, 'I don\'t think yer hearin\' me. Nether rays just aren\'t made for --', 12, 0, 100, 1, 0, 0, 21473, 5850000, 5850000, 0, 'Sky Commander Keller to Torkus');
INSERT INTO `creature_text` VALUES (23334, 3, 0, 'No, lad, not Bronco! He\'s not been broken yet! You\'ll get yerself killed up there!', 14, 0, 100, 5, 0, 0, 21467, 5870000, 5870000, 0, 'Sky Commander Keller to Torkus');
INSERT INTO `creature_text` VALUES (23340, 0, 0, 'I may be old but I can still take on a young whippersnapper like you, $N. Try not to fall behind...', 12, 0, 100, 1, 0, 0, 21362, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23342, 0, 0, 'Trope will show you how to fly like a Dragonmaw... You will show Trope how to die like a scrub.', 12, 0, 100, 1, 0, 0, 21418, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23342, 1, 1, 'You did well. Certainly a surprise to Trope... Report back to Ja\'y.', 12, 0, 100, 1, 0, 0, 21419, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23344, 0, 0, 'Let\'s get this over with...', 12, 0, 100, 1, 0, 0, 21421, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23344, 1, 1, 'You put up a hell of a fight, newbie. Hell of a fight...', 12, 0, 100, 1, 0, 0, 21422, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23345, 0, 0, ' I\'m taking this back to the old school. I\'ll be the Alliance and you be Frostwolf Village. BOMBS AWAY!', 12, 0, 100, 1, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23345, 1, 1, 'Thank you for that... It was humbling to be served in such a manner.', 12, 0, 100, 1, 0, 0, 21424, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23346, 0, 0, 'You\'re in for a rough ride, $N. I hope you\'ve already made funeral arrangements.', 12, 0, 100, 1, 0, 0, 21425, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23346, 1, 1, 'You\'re the best I\'ve ever seen. I can\'t believe I\'m saying this but you might have a chance against Skyshatter. And hey, if that doesn\'t go so well you can be my wing man...', 12, 0, 100, 1, 0, 0, 21426, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23347, 3, 0, 'Have we taken enough magical flasks to join the Skyguard yet?', 12, 0, 100, 396, 0, 0, 21407, 5278000, 5278000, 0, 'Tork');
INSERT INTO `creature_text` VALUES (23347, 3, 0, 'The Skyguard need our help! We need to get more magical flasks.', 12, 0, 100, 396, 0, 0, 21408, 5809000, 6487000, 0, 'Tork');
INSERT INTO `creature_text` VALUES (23347, 3, 0, 'We can\'t wait to join the Skyguard. We just need to take a few more magical flasks, right?', 12, 0, 100, 396, 0, 0, 21409, 2376000, 2376000, 0, 'Tork');
INSERT INTO `creature_text` VALUES (23347, 3, 0, 'When are we going to get some more magical flasks?', 12, 0, 100, 396, 0, 0, 21406, 16000, 16000, 0, 'Tork');
INSERT INTO `creature_text` VALUES (23348, 0, 0, 'Prepare a funeral pyre! $N has challenged Skyshatter!', 14, 0, 100, 22, 0, 0, 21430, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23348, 1, 1, 'I weep for you, $N. You really have no idea what you\'ve gotten yourself into...', 12, 0, 100, 1, 0, 0, 21432, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23348, 2, 2, 'I... I am undone... The new top orc is $N!', 14, 0, 100, 22, 0, 0, 21431, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23365, 3, 0, '%s makes a gesture of dismissal and heads for the launch pad.', 16, 0, 100, 11, 0, 0, 21450, 74000, 74000, 0, 'Torkus Jr. to Torkus');
INSERT INTO `creature_text` VALUES (23365, 3, 0, 'Come back, Mr. Bronco! We\'re gonna be in the Skyguard together!', 14, 0, 100, 15, 0, 0, 21476, 107000, 107000, 0, 'Torkus Jr. to Torkus');
INSERT INTO `creature_text` VALUES (23365, 3, 0, 'Nonsense!', 12, 0, 100, 11, 0, 0, 21488, 74000, 74000, 0, 'Torkus Jr. to Torkus');
INSERT INTO `creature_text` VALUES (23365, 3, 0, 'Now that the flasks are ready, we can show the Skyguard our moves!', 12, 0, 100, 1, 0, 0, 21445, 7000, 7000, 0, 'Torkus Jr. to Torkus');
INSERT INTO `creature_text` VALUES (23365, 3, 0, 'Thank you for helping us with the flasks.', 12, 0, 100, 1, 0, 0, 21479, 3000, 3000, 0, 'Torkus Jr. to Torkus');
INSERT INTO `creature_text` VALUES (23365, 3, 0, 'Yes, sir. An ogre, sir. But give us a chance, sir! We\'ve been preparing for this since the first time the Skyguard flew over Ogri\'la, sir!', 12, 0, 100, 1, 0, 0, 21449, 68000, 68000, 0, 'Torkus Jr. to Torkus');
INSERT INTO `creature_text` VALUES (23410, 3, 0, 'Ты не один, Акама.', 12, 0, 100, 0, 0, 0, 21545, 1420, 1420, 0, 'Дух Адало to Player');
INSERT INTO `creature_text` VALUES (23411, 3, 0, 'Твой народ всегда будет с тобой!', 12, 0, 100, 0, 0, 0, 21546, 7504, 7504, 0, 'Дух Олума to Player');
INSERT INTO `creature_text` VALUES (23417, 0, 0, 'Now what do I do?', 14, 0, 100, 0, 0, 11421, 21765, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23417, 1, 0, 'I won\'t be far...', 14, 0, 100, 0, 0, 11414, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23418, 0, 0, 'Pain and suffering are all that await you!', 14, 0, 100, 0, 0, 11415, 21759, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23418, 1, 0, 'Don\'t leave me alone!', 14, 0, 100, 0, 0, 11416, 21760, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23418, 2, 0, 'Look at what you make me do!', 14, 0, 100, 0, 0, 11417, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23418, 2, 1, 'I didn\'t ask for this!', 14, 0, 100, 0, 0, 11418, 21762, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23418, 2, 2, 'The pain is only beginning!', 14, 0, 100, 0, 0, 11419, 21763, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23418, 3, 0, 'I don\'t want to go back!', 14, 0, 100, 0, 0, 11420, 21764, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23418, 4, 0, '%s becomes enraged!', 16, 0, 100, 0, 0, 0, 10677, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23419, 0, 0, 'You can have anything you desire... for a price.', 14, 0, 100, 0, 0, 11408, 21752, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23419, 1, 0, 'Fulfilment is at hand!', 14, 0, 100, 0, 0, 11409, 21753, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23419, 1, 1, 'Yes... you\'ll stay with us now...', 14, 0, 100, 0, 0, 11410, 21754, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23419, 1, 2, 'Your reach exceeds your grasp.', 14, 0, 100, 0, 0, 11412, 21756, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23419, 2, 0, 'Be careful what you wish for...', 14, 0, 100, 0, 0, 11411, 21755, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23419, 3, 0, 'I\'ll be waiting...', 14, 0, 100, 0, 0, 11413, 21757, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23420, 0, 0, 'Beware: I live!', 14, 0, 100, 0, 0, 11399, 21746, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23420, 0, 1, 'So... foolish.', 14, 0, 100, 0, 0, 11400, 21747, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23420, 1, 0, '<maniacal cackle>', 14, 0, 100, 0, 0, 11401, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23420, 1, 1, 'Enough. No more.', 14, 0, 100, 0, 0, 11402, 21748, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23420, 2, 0, 'On your knees!', 14, 0, 100, 0, 0, 11403, 21749, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23420, 3, 0, 'Beware, coward.', 14, 0, 100, 0, 0, 11405, 21751, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23420, 4, 0, 'I won\'t... be... ignored.', 14, 0, 100, 0, 0, 11404, 21750, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23434, 0, 0, 'Провидцы победили! Драконья Пасть повержена!', 14, 0, 100, 0, 0, 0, 21663, 0, 0, 0, 'Командир Хобб to Командир Хобб');
INSERT INTO `creature_text` VALUES (23452, 0, 0, 'Алдоры победили! Драконья Пасть повержена!', 14, 0, 100, 0, 0, 0, 21728, 0, 0, 0, 'Командир Аркус to Player');
INSERT INTO `creature_text` VALUES (23543, 0, 0, 'Погасло пламя у тебя в груди! И победитель в схватке лишь один!', 14, 0, 100, 0, 0, 11967, 22026, 0, 0, 0, 'Тень Всадника to Player');
INSERT INTO `creature_text` VALUES (23543, 1, 0, 'Готовьтесь, презренные, гибель все ближе. Спасайте скорей стариков и детишек. Гремят над землей грозовые раскаты. Пощады не будет! Настал час расплаты!', 14, 0, 100, 0, 0, 11966, 22022, 0, 0, 0, 'Тень Всадника to 0');
INSERT INTO `creature_text` VALUES (23564, 0, 0, '%s loses all self control and begins to attack friend and foe alike!', 16, 0, 100, 0, 0, 0, 23081, 0, 0, 0, 'Plagued Dragonflayer Tribesman');
INSERT INTO `creature_text` VALUES (23566, 3, 0, 'It would be a shame to let these leaflets go to waste, wouldn\'t it?', 12, 0, 100, 1, 0, 0, 22105, 501734, 501734, 0, 'Calia Hastings to Player');
INSERT INTO `creature_text` VALUES (23567, 3, 0, 'Mysterious hoofprints, scorched shields, stray badges... how do we make sense of all this?', 12, 0, 100, 0, 0, 0, 22038, 4030359, 4030359, 0, 'Inspector Tarem');
INSERT INTO `creature_text` VALUES (23573, 3, 0, 'I don\'t think Drazzit\'s going to have any luck finding anyone to kill this raptor. I mean, he\'s already raised the reward twice...', 12, 0, 100, 0, 0, 0, 22379, 4795157, 4795157, 0, 'Krixil Slogswitch');
INSERT INTO `creature_text` VALUES (23574, 0, 0, 'I be da predator! You da prey...', 14, 0, 0, 0, 0, 12013, 23235, 0, 0, 0, 'Akilzon aggro');
INSERT INTO `creature_text` VALUES (23574, 1, 0, 'Feed, me bruddahs!', 14, 0, 0, 0, 0, 12014, 23931, 0, 0, 0, 'Akilzon eagle');
INSERT INTO `creature_text` VALUES (23574, 2, 0, 'Stop your cryin\'!', 14, 0, 0, 0, 0, 12017, 23233, 0, 0, 0, 'Akilzon slay1');
INSERT INTO `creature_text` VALUES (23574, 2, 1, 'Ya got nothin\'!', 14, 0, 0, 0, 0, 12018, 23234, 0, 0, 0, 'Akilzon slay2');
INSERT INTO `creature_text` VALUES (23574, 3, 0, 'You can\'t... kill... me spirit!', 14, 0, 0, 0, 0, 12019, 23232, 0, 0, 0, 'Akilzon death');
INSERT INTO `creature_text` VALUES (23576, 0, 0, 'Get da move on, guards! It be killin\' time!', 14, 0, 0, 0, 0, 12066, 22144, 0, 0, 0, 'Nalorakk wave 1');
INSERT INTO `creature_text` VALUES (23576, 1, 0, 'Guards, go already! Who you more afraid of, dem... or me?', 14, 0, 0, 0, 0, 12067, 22146, 0, 0, 0, 'Nalorakk wave 2');
INSERT INTO `creature_text` VALUES (23576, 2, 0, 'Ride now! Ride out dere and bring me back some heads!', 14, 0, 0, 0, 0, 12068, 22151, 0, 0, 0, 'Nalorakk wave 3');
INSERT INTO `creature_text` VALUES (23576, 3, 0, 'I be losin\' patience! Go on: make dem wish dey was never born!', 14, 0, 0, 0, 0, 12069, 22155, 0, 0, 0, 'Nalorakk wave 4');
INSERT INTO `creature_text` VALUES (23576, 4, 0, 'You be dead soo enough!', 14, 0, 0, 0, 0, 12070, 23166, 0, 0, 0, 'Nalorakk aggro 1');
INSERT INTO `creature_text` VALUES (23576, 4, 1, 'Da Amani gonna rule again!', 14, 0, 0, 0, 0, 12076, 23172, 0, 0, 0, 'Nalorakk aggro 2');
INSERT INTO `creature_text` VALUES (23576, 5, 0, 'I bring da pain!', 14, 0, 0, 0, 0, 12071, 23167, 0, 0, 0, 'Nalorakk surge');
INSERT INTO `creature_text` VALUES (23576, 6, 0, 'You call on da beast, you gonna get more dan you bargain for!', 14, 0, 0, 0, 0, 12072, 23168, 0, 0, 0, 'Nalorakk bear');
INSERT INTO `creature_text` VALUES (23576, 7, 0, 'Make way for da Nalorakk!', 14, 0, 0, 0, 0, 12073, 23169, 0, 0, 0, 'Nalorakk troll');
INSERT INTO `creature_text` VALUES (23576, 8, 0, 'Mua-ha-ha! Now whatchoo got to say?', 14, 0, 0, 0, 0, 12075, 23171, 0, 0, 0, 'Nalorakk kill');
INSERT INTO `creature_text` VALUES (23576, 9, 0, 'I... be waitin\' on da udda side...', 14, 0, 0, 0, 0, 12077, 23173, 0, 0, 0, 'Nalorakk death');
INSERT INTO `creature_text` VALUES (23577, 0, 0, 'Get on your knees and bow to da fang and claw!', 14, 0, 0, 0, 0, 12020, 0, 0, 0, 0, 'Halazzi aggro');
INSERT INTO `creature_text` VALUES (23577, 1, 0, 'I fight wit\' untamed spirit...', 14, 0, 0, 0, 0, 12021, 0, 0, 0, 0, 'Halazzi split');
INSERT INTO `creature_text` VALUES (23577, 2, 0, 'Spirit, come back to me!', 14, 0, 0, 0, 0, 12022, 22964, 0, 0, 0, 'Halazzi combine');
INSERT INTO `creature_text` VALUES (23577, 3, 0, 'Me gonna carve you now!', 14, 0, 0, 0, 0, 12023, 0, 0, 0, 0, 'Halazzi melee01');
INSERT INTO `creature_text` VALUES (23577, 3, 1, 'You gonna leave in pieces', 14, 0, 0, 0, 0, 12024, 0, 0, 0, 0, 'Halazzi melee02');
INSERT INTO `creature_text` VALUES (23577, 4, 0, 'Chaga... chocka\'jinn.', 14, 0, 0, 0, 0, 12028, 0, 0, 0, 0, 'Halazzi death');
INSERT INTO `creature_text` VALUES (23578, 0, 0, 'Spirits of da wind be your doom!', 14, 0, 0, 0, 0, 12031, 23590, 0, 0, 0, 'Janalai aggro');
INSERT INTO `creature_text` VALUES (23578, 1, 0, 'I burn ya now!', 14, 0, 0, 0, 0, 12032, 23589, 0, 0, 0, 'Janalai firebombs');
INSERT INTO `creature_text` VALUES (23578, 2, 0, 'Where ma hatcha? Get to work on dem eggs!', 14, 0, 0, 0, 0, 12033, 23528, 0, 0, 0, 'Janalai hatchers');
INSERT INTO `creature_text` VALUES (23578, 3, 0, 'I show you strength... in numbers!', 14, 0, 0, 0, 0, 12034, 0, 0, 0, 0, 'Janalai all eggs');
INSERT INTO `creature_text` VALUES (23578, 4, 0, 'It all be over now, mon!', 14, 0, 0, 0, 0, 12036, 23585, 0, 0, 0, 'Janalai kill');
INSERT INTO `creature_text` VALUES (23578, 5, 0, 'Tazaga-choo!', 14, 0, 0, 0, 0, 12037, 23586, 0, 0, 0, 'Janalai death');
INSERT INTO `creature_text` VALUES (23586, 1, 0, 'Лазутчики! Бейте тревогу!', 14, 0, 100, 1, 0, 0, 23109, 0, 0, 0, 'Разведчик из племени Амани to Player');
INSERT INTO `creature_text` VALUES (23596, 1, 0, 'Ты скоро будешь совсем мертвый!', 12, 0, 100, 5, 0, 0, 10434, 0, 0, 0, 'Заклинатель огня племени Амани to Player');
INSERT INTO `creature_text` VALUES (23597, 3, 0, 'Тут чужаки! Бейте тревогу!', 14, 0, 100, 25, 0, 12104, 23252, 187354, 187354, 0, 'Страж племени Амани to 187359');
INSERT INTO `creature_text` VALUES (23602, 0, 0, 'If you think you can stop us, you\'re mistaken, \'friend.\'', 12, 0, 100, 1, 0, 0, 22046, 0, 0, 0, 'GossipText');
INSERT INTO `creature_text` VALUES (23602, 0, 1, 'It\'s good to see you defending Theramore with pride, friend.', 12, 0, 100, 1, 0, 0, 22050, 0, 0, 0, 'GossipText');
INSERT INTO `creature_text` VALUES (23602, 0, 2, 'It\'s people like you who weaken the Alliance and invite the Horde to take away all we\'ve fought for!', 12, 0, 100, 1, 0, 0, 22049, 0, 0, 0, 'GossipText');
INSERT INTO `creature_text` VALUES (23602, 0, 3, 'These people will know Admiral Proudmoore for the true hero he was!', 12, 0, 100, 1, 0, 0, 22048, 0, 0, 0, 'GossipText');
INSERT INTO `creature_text` VALUES (23602, 0, 4, 'When you\'re off duty, let\'s go to the inn. I\'ll buy a round and we can reminisce about the good old days.', 12, 0, 100, 1, 0, 0, 22051, 0, 0, 0, 'GossipText');
INSERT INTO `creature_text` VALUES (23602, 0, 5, 'Wouldn\'t you like to bring those days back? I have some friends who know just the way to do that...', 12, 0, 100, 1, 0, 0, 22052, 0, 0, 0, 'GossipText');
INSERT INTO `creature_text` VALUES (23602, 0, 6, 'You can\'t stop us from exposing the truth about Jaina\'s cowardice!', 12, 0, 100, 1, 0, 0, 22047, 0, 0, 0, 'GossipText');
INSERT INTO `creature_text` VALUES (23616, 0, 0, '%s howls in delight at the sight of his lunch!', 16, 0, 100, 0, 0, 0, 22068, 0, 0, 0, '');
