INSERT INTO `creature_text` VALUES (23678, 0, 0, 'I knew Lurielle would send help! Thank you friend, and give Lurielle my thanks as well!', 12, 7, 100, 1, 0, 0, 0, 0, 0, 0, 'Chill Nymph');
INSERT INTO `creature_text` VALUES (23678, 0, 1, 'Where am I? What happened to me? You... you freed me?', 12, 7, 100, 1, 0, 0, 23043, 0, 0, 0, 'Chill Nymph');
INSERT INTO `creature_text` VALUES (23678, 0, 2, 'Thank you. I thought I would die without seeing my sisters again!', 12, 7, 100, 1, 0, 0, 23042, 0, 0, 0, 'Chill Nymph');
INSERT INTO `creature_text` VALUES (23682, 0, 0, 'Unhappy, you have reached the end of the road! Fate will decide who to go forward!', 12, 0, 100, 0, 0, 11961, 22261, 0, 0, 0, 'Всадник без головы to Всадник без головы');
INSERT INTO `creature_text` VALUES (23682, 1, 0, 'Here is my body, beautiful and bold! Black souls are punished skillfully!', 14, 0, 100, 0, 0, 12567, 22271, 0, 0, 0, 'Всадник без головы to 0');
INSERT INTO `creature_text` VALUES (23682, 2, 0, 'Damn you, burn in the fire! Neither you nor me will escape from fate!', 12, 0, 100, 0, 0, 0, 40545, 0, 0, 0, 'Всадник без головы to 0');
INSERT INTO `creature_text` VALUES (23682, 3, 0, 'Rise up the servants, rush into battle! May the fallen knight find peace!', 12, 0, 100, 0, 0, 11963, 23861, 0, 0, 0, 'Всадник без головы to Всадник без головы');
INSERT INTO `creature_text` VALUES (23682, 4, 0, 'With death, we have long been friends ... What awaits me now in the wasteland?', 12, 0, 100, 0, 0, 11964, 23455, 0, 0, 0, 'Всадник без головы to Голова Всадника');
INSERT INTO `creature_text` VALUES (23682, 5, 0, 'Horseman rise...', 1, 0, 100, 0, 0, 0, 22695, 0, 0, 0, 'say');
INSERT INTO `creature_text` VALUES (23682, 6, 0, 'Your time is nigh...', 1, 0, 100, 0, 0, 0, 22696, 0, 0, 0, 'say');
INSERT INTO `creature_text` VALUES (23682, 7, 0, 'You felt death once...', 1, 0, 100, 0, 0, 0, 22720, 0, 0, 0, 'say');
INSERT INTO `creature_text` VALUES (23682, 8, 0, 'Now, know demise!', 1, 0, 100, 0, 0, 0, 22721, 0, 0, 0, 'say');
