INSERT INTO `creature_text` VALUES (23683, 0, 0, 'Эй, попробуйте это превосходное пиво!', 12, 0, 100, 0, 0, 33401, 22547, 0, 0, 0, 'Майев Ячменовар');
INSERT INTO `creature_text` VALUES (23683, 3, 0, 'Barley Brewers - Best Brewers in Azeroth!', 12, 7, 100, 396, 0, 33401, 22132, 73453, 148765, 0, 'Майев Ячменовар');
