INSERT INTO `creature_text` VALUES (23698, 3, 0, 'Парни, непременно попробуйте это...', 12, 1, 100, 396, 0, 33399, 22009, 163109, 163109, 0, 'Пьяный гуляка Хмельного фестиваля to Толпа на Хмельном фестивале');
INSERT INTO `creature_text` VALUES (23710, 3, 0, 'О, пройдись еще, лапочка! Твои ягодицы в прекрасном состоянии!', 12, 7, 100, 5, 0, 33401, 54278, 51375, 51375, 0, 'Белби Быстросмен to Player');
INSERT INTO `creature_text` VALUES (23720, 0, 0, 'Thank you! There\'s no telling what those brutes would\'ve done to me.', 12, 0, 100, 0, 0, 0, 22438, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23736, 0, 0, 'Guards!', 14, 7, 100, 0, 0, 0, 4583, 0, 0, 0, 'Pricilla Winterwind');
INSERT INTO `creature_text` VALUES (23768, 1, 0, 'James? James... No, you`re not James, but I know who you are...', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Lynn Hyal');
INSERT INTO `creature_text` VALUES (23768, 2, 0, 'You`re the one who tracked down the brutes who did this to us.', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Lynn Hyal');
INSERT INTO `creature_text` VALUES (23768, 3, 0, 'I tried so hard to tell Jim... to tell anyone... who was behind this, but I couldn`t find a way...', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Lynn Hyal');
INSERT INTO `creature_text` VALUES (23768, 4, 0, 'Thank you for helping us and for helping Jim. If you see him, tell him little Jimmy and I love him and that we`re waiting for him.', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Lynn Hyal');
INSERT INTO `creature_text` VALUES (23768, 5, 0, 'I don`t know when we`ll see Daddy again, Jimmy, but I know he loves you and he misses you very much.', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Lynn Hyal');
INSERT INTO `creature_text` VALUES (23769, 1, 0, 'Mommy, when will we see Daddy again?', 12, 0, 100, 0, 0, 0, 22248, 0, 0, 0, 'Jimmy Hyal');
INSERT INTO `creature_text` VALUES (23774, 1, 0, 'Я из тебя амулет сделаю!', 12, 0, 100, 6, 0, 0, 10435, 0, 0, 0, 'Наставник из племени Амани to Player');
INSERT INTO `creature_text` VALUES (23775, 0, 0, 'Не надоело еще убегать?', 12, 0, 100, 0, 0, 0, 22415, 0, 0, 0, 'Голова Всадника to Голова Всадника');
INSERT INTO `creature_text` VALUES (23786, 0, 0, 'I\'ll crush you!', 12, 0, 100, 0, 0, 0, 1925, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23786, 0, 1, 'Me crush puny friend of dragons!', 12, 0, 100, 0, 0, 0, 22416, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23786, 0, 2, 'Me smash! You die!', 12, 0, 100, 0, 0, 0, 1926, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23786, 0, 3, 'Why you wake ghost? Where other Stonemauls?!', 12, 0, 100, 0, 0, 0, 22418, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23786, 0, 4, 'You leave Stonemaul lands now!', 12, 0, 100, 0, 0, 0, 22417, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (23789, 0, 0, 'Your pathetic challenge has not gone unnoticed. I shall enjoy toying with you before you die.', 14, 0, 100, 1, 0, 0, 22286, 0, 0, 0, 'Smart Text');
