INSERT INTO `creature_text` VALUES (23837, 3, 0, 'За твоей спиной раздается шум!', 41, 0, 100, 0, 0, 0, 25215, 35000, 35000, 0, 'ELM General Purpose Bunny to Player');
INSERT INTO `creature_text` VALUES (23859, 0, 0, 'Guards!', 12, 0, 100, 0, 0, 0, 4583, 0, 0, 0, 'Greer Orehammer');
INSERT INTO `creature_text` VALUES (23861, 0, 0, 'The darkness... the corruption... they came too quickly for anyone to know...', 12, 0, 15, 25, 0, 0, 22362, 0, 0, 0, 'Restless Apparition');
INSERT INTO `creature_text` VALUES (23861, 0, 1, 'It is too late for us, living one. Take yourself and your friend away from here before you both are... claimed...', 12, 0, 15, 25, 0, 0, 22365, 0, 0, 0, 'Restless Apparition');
INSERT INTO `creature_text` VALUES (23861, 0, 2, 'Go away, whoever you are! Witch Hill is mine... mine!', 12, 0, 15, 25, 0, 0, 22359, 0, 0, 0, 'Restless Apparition');
INSERT INTO `creature_text` VALUES (23861, 0, 3, 'The darkness will consume all... all the living...', 12, 0, 15, 25, 0, 0, 22364, 0, 0, 0, 'Restless Apparition');
INSERT INTO `creature_text` VALUES (23861, 0, 4, 'The manor... someone else... will soon be consumed...', 12, 0, 15, 25, 0, 0, 22361, 0, 0, 0, 'Restless Apparition');
INSERT INTO `creature_text` VALUES (23861, 0, 5, 'Why have you come here, outsider? You will only find pain! Our fate will be yours...', 12, 0, 15, 25, 0, 0, 22363, 0, 0, 0, 'Restless Apparition');
INSERT INTO `creature_text` VALUES (23861, 0, 6, 'It was... terrible... the demon...', 12, 0, 15, 25, 0, 0, 22360, 0, 0, 0, 'Restless Apparition');
